  {album_id: 1, title: "안녕", ganre1: "가요", ganre2: "전체", runtime: "03:47", lyrics: "\n\t\t\t\t\t\t\t<div>안녕 - 03:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">안녕 나는 너를 아는데\r\n너는 나를 모르지\r\n그 동안 말도 하지 않고 매일\r\n저 만치서 어울리고 있는\r\n너희를 바라보고\r\n\r\n다가갈까 말까\r\n말 걸어볼까 말까\r\n이런 인사가 나을까\r\n이런 날 반겨줄까\r\n오늘도 생각만 하다가\r\n기회는 떠나가\r\n\r\n혼자라는 게\r\n얼마나 외로운지 아니\r\n날 피하는 게 보일 때\r\n얼마나 서운한지 아니 \r\n\r\n날 멀리 두지 말아줘\r\n날 여기에 이대로 두어줘 \r\n그저 너희가 있는 자리에 \r\n함께 있는 것만으로 \r\n내겐 안심이 될 테니 \r\n\r\n날 혼자 두지 말아줘 \r\n날 너희와 함께 있게 해줘 \r\n그저 너희가 있는 자리에 \r\n함께 있는 것만으로 \r\n내겐 안심이 될 테니\r\n \r\nDon't hate me \r\nDon't hate me\r\n \r\n늘 내게만 똑같은 태도\r\n내게만 드리워진 shadow\r\n잃어버린 궤도에 홀로\r\n파도 속에 남겨진 배도\r\nless than me\r\n항상 나만 혼자 남으니까\r\n기대도 안해 내 이름 불러줄까\r\nlike 먼지 덮인 하모니카\r\n목 잠겨 쉰소리만 나온다\r\n\r\n아무도 몰래 어두운 곳에서\r\n속앓이를 하고\r\n꼴에 자존심은 있어서\r\n혼자라 고백은 못하고\r\n아침마다 달갑지 않은 쓴공기와\r\n햇살을 가려버린 마음 안개가\r\nCan you understand it?\r\nNot at all\r\n\r\n안녕 나는 너를 아는데\r\n너는 나를 모르지\r\n안녕 나는 너를 아는데\r\n너는 나를 모르지\r\n \r\nDon't hate me\r\n\r\n날 멀리 두지 말아줘\r\n날 여기에 이대로 두어줘 \r\n그저 너희가 있는 자리에 \r\n함께 있는 것만으로 \r\n내겐 안심이 될 테니 \r\n\r\n날 혼자 두진 말아줘 \r\n날 너희와 함께 있게 해줘 \r\n그저 너희가 있는 자리에 \r\n함께 있는 것만으로 \r\n내겐 안심이 될 테니\r\n\r\nDon't hate me\r\nDon't hate me\r\nDon't hate me</p> \n\t\t\t\t\t\t", artist_num: 80197389, album_num: 80416897, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/197/389/80197389_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/897/80416897_1396835518342_1_600x600.JPG", song_tjnum: nil, song_num: 82425431, lowkey: nil, highkey: nil},
