  {album_id: 1, title: "길이나", ganre1: "가요", ganre2: "전체", runtime: "03:09", lyrics: "\n\t\t\t\t\t\t\t<div>길이나 - 03:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">동성이 길에 마주치면 기 싸움\r\n이성이 길에 마주치면 도도한 척\r\n그러다가도 내 맘을 사로 잡는\r\n사람이 있다 하면\r\n그래도 도도한 척\r\n \r\n첫눈에 반해도\r\n그래도 도도한 척\r\n집에 오고 나면\r\n그러면 후회하죠\r\n다시 만날 일이 없을 것 같은데\r\n왜 그냥 넘어갔을까\r\n길이라도 물어볼걸  \r\n너네 집이 어디에요\r\n안내 좀 해주세요\r\n \r\n자갈길이나\r\n껌딱지가 바닥에 눌어붙은 길이나\r\n바닷길이나\r\n꽃들이 안녕안녕하고 있는 길이나\r\n사람들이 서로 눈길을\r\n주고받는 데는\r\n모두 다 똑같은 길인걸\r\n \r\n뒤돌아보니\r\n이미 사라진 그대\r\n뒤늦게 뛰어봐도\r\n갈림길이 여러 개\r\n지우려 해봐도 그 찰나의 눈빛에\r\n \r\n지금 당장 만나요\r\n어디 근처에 사나요\r\n포털사이트에도 올렸어요\r\n확인해봐요\r\n사람들이 응원한대요\r\n \r\n자갈길이나\r\n껌딱지가 바닥에 늘러붙은 길이나\r\n바닷길이나\r\n꽃들이 안녕안녕하고 있는 길이나\r\n사람들이 서로 눈길을\r\n주고받는 데는\r\n모두 다 똑같은 길인 걸\r\n나는 아는데\r\n\r\n왜 막상 내 타입이 지나가면\r\n나 도도해지는데\r\n왜 나는 나는 나는 나는 난\r\n \r\n골목길이나\r\n빨간불 파란불이 엇갈리는 길이나\r\n언덕길이나\r\n꼬부랑 할머니가 넘어가던 길이나\r\n사람들이 서로 눈길을\r\n주고받는 데는\r\n모두 다 똑같은 길인걸\r\n \r\n놓치고 싶지 않아</p> \n\t\t\t\t\t\t", artist_num: 80197389, album_num: 80416897, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/197/389/80197389_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/897/80416897_1396835518342_1_600x600.JPG", song_tjnum: nil, song_num: 82425433, lowkey: nil, highkey: nil},
  {album_id: 1, title: "소재", ganre1: "가요", ganre2: "전체", runtime: "03:20", lyrics: "\n\t\t\t\t\t\t\t<div>소재 - 03:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">요새 마음만큼\r\n생각이 안 따라줘\r\n의욕은 넘치는데\r\n소재가 다 떨어졌네요\r\n내 이야기의 소재가\r\n되어 줄 분 없나요\r\n \r\n손을 높이 들고\r\n눈을 크게 뜨고 \r\n뭐? 모자는 쓰지 말고\r\n이때 이때까지 갈고 \r\n닦았던 (닦았던)\r\n너만의 걸 (너만의 걸) 보여봐 \r\nShow me what you have your own\r\n \r\n음 음 소질이 있군\r\n충분히 소재로 쓰이겠어\r\n(I like it)\r\n너 거기 패딩 잠바\r\n오리털이군 쓸모가 있겠어\r\n(so good)\r\n사랑은 초콜릿이다?\r\n어 미안해 흔해\r\n다음 기회에 도전해\r\n소재TOP STAR2 참가자 여러분\r\n대망의 1위는 두구두구두구두 \r\n \r\n어어 어어어 어어어어어어\r\n어어 어어어 어어어어어어\r\n주위에 흔하디 흔한 곳에서\r\n너를 발견하겠지\r\n그리곤 안녕하겠지\r\n \r\n어어 어어어 어어어어어어\r\n어어 어어어 어어어어어어\r\n전혀 예상하지 못한 곳에서\r\n네가 내게 오겠지 yeah \r\n \r\n3 2 1\r\n \r\n전엔 익숙하던 게\r\n쉽게 안 떠올라\r\n두 손에 잡히는 게\r\n없어 난 끝인가 봐요\r\n내 이야기의 소재가\r\n되어줄 분 없나요\r\n \r\n피곤한 아침 허무한 밤 \r\n오늘과 같이 따분한 날\r\n나 좀 특별하고 싶다\r\n손 hands up\r\n그래 솔직히 너 정돈\r\n좀 handsome\r\n틀리든 말든 자존심\r\n다 무대로 올리고\r\n이제 보여줘 (보여줘!)\r\n \r\n수 많은 페이지 속에\r\n내가 한 소재로 남을 수 있게\r\n기다려왔던 오늘을 위해\r\n아껴둔 걸 모두 shout it out\r\n긴장하지마 괜찮아\r\n맘이 두근두근 거리면\r\n거기가 내 자리야\r\nBe where you should be\r\n \r\n어어 어어어 어어어어어어\r\n어어 어어어 어어어어어어\r\n주위에 흔하디 흔한 곳에서\r\n너를 발견하겠지\r\n그리곤 안녕하겠지\r\n \r\n어어 어어어 어어어어어어\r\n어어 어어어 어어어어어어\r\n전혀 예상하지 못한 곳에서\r\n네가 내게 오겠지\r\n \r\n손을 높이 들고 HEY\r\n눈을 크게 뜨고 HEY\r\n특별한 무대를 꿈꾸고 있는 사람\r\nall say HEY HEY\r\n손을 높이 들고 HEY\r\n아껴둔 너만의 걸 보여봐\r\nSHOW ME WHAT YOU HAVE YOUR OWN </p> \n\t\t\t\t\t\t", artist_num: 80197389, album_num: 80416897, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/197/389/80197389_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/897/80416897_1396835518342_1_600x600.JPG", song_tjnum: nil, song_num: 82425434, lowkey: nil, highkey: nil},
  {album_id: 1, title: "Galaxy", ganre1: "가요", ganre2: "전체", runtime: "02:59", lyrics: "\n\t\t\t\t\t\t\t<div>Galaxy - 02:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">galaxy\r\ngalaxy\r\n\r\n갤럭시 너 혹시\r\n나와 같이 걸어가 볼래\r\n반짝이는 은하 너머 손잡고\r\n나와 같이 걸어가 볼래\r\n \r\n누가 살고 있나 아무도 몰라\r\n그 너머 뭐 있는지 누구도 몰라\r\n다만 분명히 화려한 무지개\r\n너머 내 꿈 둥 둥 떠다닐 거예요\r\n\r\nTap the galaxy oh\r\nDab the melody ya\r\n\r\n할까 말까 고민 끝에\r\n한여름날 쉬다 간 \r\n여우비 소리에 묻혀\r\n말하지 못한 내 고백이\r\n저 하늘 희미하게\r\n반짝이고 있는\r\n은하수로 흘러갔을까\r\n\r\n갤럭시 너 혹시\r\n나와 같이 날아가 볼래\r\n반짝이는 팅커벨의 가루가\r\n너와 나를 띄워 줄 거야\r\n\r\n누가 숨어 우릴 볼지도 몰라\r\n날 위한 축제가 있을지도 몰라\r\n다만 분명히 영롱한 물안개\r\n너머 내 꿈 둥 둥 떠다닐 거예요\r\n\r\nTap the galaxy oh\r\nDap the melody ya\r\n\r\n할까 말까 고민 끝에\r\n한겨울밤 몰래 간\r\n도둑눈에 숨이 멎어\r\n도망가 버린 고백 말이\r\n저 하늘 희미하게\r\n반짝이고 있는\r\n은하수로 흘러갔을까\r\n\r\n갤럭시 너 혹시\r\n나와 같이 걸어가 볼래\r\n반짝이는 은하 너머 손잡고\r\n나와 같이 걸어가 볼래\r\n갤럭시 너 혹시\r\n나와 같이 날아가 볼래\r\n반짝이는 팅커벨의 가루가\r\n너와 나를 띄워 줄 거야</p> \n\t\t\t\t\t\t", artist_num: 80197389, album_num: 80416897, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/197/389/80197389_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/897/80416897_1396835518342_1_600x600.JPG", song_tjnum: nil, song_num: 82425435, lowkey: nil, highkey: nil},
  {album_id: 2, title: "못다한 사랑", ganre1: "가요", ganre2: "댄스", runtime: "03:19", lyrics: "\n\t\t\t\t\t\t\t<div>못다한 사랑 - 03:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80246409, album_num: 80416898, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/898/80416898_1396602026975_1_600x600.JPG", song_tjnum: nil, song_num: 82425436, lowkey: nil, highkey: nil},
  {album_id: 3, title: "사랑 그리고 이별", ganre1: "가요", ganre2: "댄스", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>사랑 그리고 이별 - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이유라도 말해줄래 \r\n나를 떠나가는 이유\r\n영원할 줄 알았던 \r\n우리 사랑 끝인거니\r\n\r\n너만 보고 살았는데 \r\n내 마음은 어떡하니\r\n사랑이란게 이렇게도 \r\n어려운 거였니\r\n\r\n매일 사랑한다 말했던 \r\n지난 시절들은 뭐였니\r\n이제 이별한다면 모두 \r\n다 잊혀질까\r\n\r\n*너와 사랑 그리고 \r\n이별을 모두 겪을줄은 몰랐어\r\n아직 꿈같은 이별을 \r\n언제 인정할 수 있을까\r\n\r\n어떻게든 끝나는게 \r\n사랑일까 그런걸까\r\n많은 사랑해봐도 \r\n결국엔 다 이별이야\r\n\r\n언제쯤 나 운명처럼 \r\n반쪽 찾을 수 있을까\r\n이대로 너를 보내는게 \r\n너무나 힘들어\r\n\r\n너를 사랑했던 마음이 \r\n아직도 내겐 가득한데\r\n남은 사랑 어떡해 \r\n내 마음 어떡하니\r\n\r\n*\r\n*\r\n*</p> \n\t\t\t\t\t\t", artist_num: 80220041, album_num: 80416900, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/900/80416900_1396602401040_1_600x600.JPG", song_tjnum: nil, song_num: 82425437, lowkey: nil, highkey: nil},
