  {album_id: 32, title: "흔한 이야기", ganre1: "가요", ganre2: "인디", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>흔한 이야기 - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무 말도 못해 그대 앞에 서면\r\n그저\r\n안절부절 하지 못해 미치겠어\r\n어떻게든 재미있게 해 주려고\r\n그저\r\n재미있던 없던 아무 얘기 하죠\r\n\r\n아무 말도 못해 그대 앞에 서면\r\n그저\r\n어떻게 말해야 할지 미치겠어\r\n나를 보는 눈이 또 어제와 달라\r\n지금이 좋은데 이만큼만 \r\n\r\n이대로 바라본다 하면\r\n그대는 내게 오지 않겠죠\r\n이렇게 다가선다 하면\r\n그대는 나를 볼까요\r\n\r\n사랑한다 말 쉽지 않게\r\n수백 번 내어도\r\nsad story\r\n오늘 많은 만남들 속에 \r\n너와나 우린 결국\r\nsad story\r\n\r\n이대로 바라본다 하면\r\n그대는 내게 오지 않겠죠\r\n너와나 다가선다 하면\r\n우리 둘 이야기는\r\n\r\n사랑한다 말 쉽지 않게 \r\n수백 번 내어도\r\nsad story\r\n오늘 많은 만남들 속에 \r\n너와나 우린 결국\r\nsad story\r\n\r\n사랑한다 말 쉽지 않게\r\n수백 번 내어도\r\nsad story\r\n오늘 많은 만남들 속에\r\n너와나 우린 결국\r\nsad story</p> \n\t\t\t\t\t\t", artist_num: 80261593, album_num: 80416928, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/928/80416928_1396861515127_1_600x600.JPG", song_tjnum: nil, song_num: 82425576, lowkey: nil, highkey: nil},
  {album_id: 32, title: "시간내줘요", ganre1: "가요", ganre2: "인디", runtime: "02:48", lyrics: "\n\t\t\t\t\t\t\t<div>시간내줘요 - 02:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘 하루 내게 시간 좀 내줘\r\n그대와 같이 가고 싶은 곳이 있어\r\n바쁘다는 핑계 대지 말고 나와요\r\n\r\n싫다고 하진 않았지만 기다려요\r\n생각 조금 해보고 연락해 줄게요\r\n급하다는 생각 들지는 않나요\r\n\r\n음~\r\n하루 종일 거짓말을 하죠 오 난\r\n어떻게든 한번 만나 보려고\r\n그댈 내 눈에 그리려고 \r\n뻔한 거짓말 \r\n\r\n이번 주말 내게 시간 좀 내줘요\r\n영화 시사회 당첨 콘서트 초대권\r\n공짜 표가 생겼어\r\n나와 함께 가 줘요 제발\r\n\r\n의심하지 않아도 다 내 눈에 보여\r\n공짜 표는 무슨 그럴리 없어\r\n솔직히 그냥 내가\r\n보고 싶다 말해요 음~\r\n\r\n하루 종일 그대만 보여요 오 난\r\n멋진 영화 예쁜 공원도\r\n그대와 함께 그리는 꿈\r\n함께해 줘요\r\n\r\n오늘 하루 내게 시간 좀 내줘요</p> \n\t\t\t\t\t\t", artist_num: 80261593, album_num: 80416928, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/928/80416928_1396861515127_1_600x600.JPG", song_tjnum: nil, song_num: 82425577, lowkey: nil, highkey: nil},
