  {album_id: 36, title: "너를 죽였다", ganre1: "가요", ganre2: "인디", runtime: "03:06", lyrics: "\n\t\t\t\t\t\t\t<div>너를 죽였다 - 03:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 오늘 너를 죽였다\r\n그 눈빛 미소 모두 다\r\n너를 죽였다\r\n그 감격 눈물 모두 다\r\n\r\n너는 가고 그가 남았다\r\n내가 모르는\r\n\r\n내 볼에 남은 너의 온기가\r\n차게 식었다\r\n날 감싸던 너의 품 안이\r\n비어 버렸다\r\n\r\n지우기 전에 사라지고\r\n끄기도 전에 사그러진 너\r\n이제는 나만 혼자 남아\r\n너의 안녕을 바라본다\r\n\r\n난 오늘 너를 죽였다\r\n그 눈빛 미소 모두 다\r\n너를 죽였다\r\n그 감격 눈물 모두 다\r\n\r\n너는 가고 그가 남았다\r\n내가 모르는\r\n\r\n너는 가고 그가 남았다\r\n나를 모르는\r\n\r\n너는 나를 죽인다\r\n숨도 쉴 수 없이\r\n너는 나를 죽인다\r\n눈도 뜰 수 없이\r\n\r\n난 인사조차 할 수 없다\r\n이 시간은 영원을 흐른다\r\n\r\n난 오늘 너를 죽였다\r\n그 눈빛 미소 모두 다\r\n너를 죽였다 \r\n그 감격 눈물 모두 다\r\n\r\n너는 가고 그가 남았다\r\n내가 모르는\r\n\r\n너는 가고 내가 남았다\r\n너를 사랑한\r\n\r\n너는 가고 내가 남았다\r\n너를 사랑한</p> \n\t\t\t\t\t\t", artist_num: 80204261, album_num: 80416932, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/204/261/80204261_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/932/80416932_1396861322476_1_600x600.JPG", song_tjnum: nil, song_num: 82425597, lowkey: nil, highkey: nil},
  {album_id: 37, title: "It's On Again (Feat. Kendrick Lamar) (From The Amazing Spider-Man 2 OST)", ganre1: "OST", ganre2: "해외영화", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>It's On Again (Feat. Kendrick Lamar) (From The Amazing Spider-Man 2 OST) - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[Kendrick Lamar]\r\nAnd everybody know the story of David and Goliath\r\nBut this is bigger than triumph\r\nThis is for the warrior, this is for you and I\r\nThis is for euphoria, give me a piece of mind\r\nGod is recording this, wont you look in the sky\r\nTell him you got the behavior of your neighbor\r\nEven when stabilitys never in your favor\r\nFly with the turbulence, only last a minute\r\nLand on your dreams, and recognize you live it\r\nWalk through the valley of peace, with bare feet\r\nRun through the flames, thats more passion for me\r\nI passed testimony just so the world can see\r\nBattle wounds on me, now watch me lick em clean\r\nI know, I know, my pride, my goals, my highs, my lows\r\nI know, I know, its mind control\r\nI know I could prosper, no impostor, prosecute my posture\r\nI stand up and I stand by her, what\r\n\r\n[Alicia Keys]\r\nI am a freedom fighter, the name that history wrote\r\nAnd even through disaster, eye of the tiger for hope\r\nIm trying to find my way back, theres no day off for heroes\r\nAnd even when Im tired, go is the only word I know\r\n\r\nAnd the night is takin over, and the moonlight gets exposure\r\nAnd the players have been chosen, and it seems like fate has spoken\r\nWhen it seems your faith has broken, by the second, losin focus\r\nAint no way to get off, get off, get off, get off\r\nUnless you move forward\r\n\r\nI bet they wonder how I go on\r\nI bet they wonder how I go on\r\nI bet they wonder how I go on\r\n\r\nIll simply say its on again, its on again\r\nThe world dont stop, its on again, \r\nits on again\r\n\r\nI am a lonely hero, trying to fight my battles\r\nLife likes to blow the cold wind, \r\nometimes it freezes my shadow\r\nIn the midst of all this darkness, I sacrifice my ego\r\nThere aint no room for selfish, we do it for the people\r\n\r\nAnd the night is takin over, and the moonlight gets exposure\r\nAnd the players have been chosen, and it seems like fate has spoken\r\nWhen it seems your faith has broken, by the second, losin focus\r\nAint no way to get off, get off, get off, get off\r\nUnless you move forward\r\n\r\nI bet they wonder how I go on\r\nI bet they wonder how I go on\r\nI bet they wonder how I go on\r\n\r\nIll simply say its on again, its on again,\r\nThe world dont stop, its on again, \r\nits on again\r\n\r\nThe work dont stop, cause they dont stop\r\nAnd everybody here tryna get on top\r\nEverybody from the burbs down to the block\r\nGotta hold on tight and dont let go, let go\r\nHuh, so you think you hot\r\nGotta grind hard, give it all you got\r\nYou can have, or you can have not\r\nYou see that a lot in the ghetto ghetto\r\n\r\nI bet they wonder how I go on\r\nI bet they wonder how I go on\r\nI bet they wonder how I go on\r\n\r\nIll simply say its on again, its on again,\r\nThe world dont stop, its on again, \r\nits on again</p> \n\t\t\t\t\t\t", artist_num: 14936799, album_num: 80416935, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/936/799/14936799_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/935/80416935_1396597475850_1_600x600.JPG", song_tjnum: nil, song_num: 82425601, lowkey: nil, highkey: nil},
