6.22]28.하나님이 그들에게 복을 주시며 하나님이 그들에게 이르시되 생육하고 번성하여 땅에 충만 하라, 땅을 정복하라, 바다의 물고기와 하늘의 새와 땅에 움직이는 모든 생물을 다스 리라 하시니라 \r\n[04:01.70]29.하나님이 이르시되 내가 온 지면의 씨 맺는 모든 채소와 씨 가진 열매 맺는 모든 나무를 너희에게 주노니 너희의 먹을거리가 되리라 \r\n[04:11.79]30.또 땅의 모든 짐승과 하늘의 모든 새와 생명이 있어 땅에 기는 모든 것에게는 내가 모든 푸른 풀을 먹을거리로 주노라 하시니 그대로 되니라 \r\n[04:23.50]31.하나님이 지으신 그 모든 것을 보시니 보시기에 심히 좋았더라 저녁이 되고 아침이 되니 이는 여섯째 날이니라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425742, lowkey: nil, highkey: nil},
