  {album_id: 49, title: "창세기 6장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:20", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 6장 (개역개정) - 03:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 6장\r\n[00:07.20]01.사람이 땅 위에 번성하기 시작할 때에 그들에게서 딸들이 나니 \r\n[00:12.09]02.하나님의 아들들이 사람의 딸들의 아름다움을 보고 자기들이 좋아하는 모든 여자를 아내로 삼는지라 \r\n[00:19.11]03.여호와께서 이르시되 나의 영이 영원히 사람과 함께 하지 아니하리니 이는 그들이 육신이 됨이라 그러나 그들의 날은 백이십 년이 되리라 하시니라 \r\n[00:31.74]04.당시에 땅에는 네피림이 있었고 그 후에도 하나님의 아들들이 사람의 딸들에게로 들어와 자식을 낳았으니 그들은 용사라 고대에 명성이 있는 사람들이었더라 \r\n[00:44.84]05.여호와께서 사람의 죄악이 세상에 가득함과 그의 마음으로 생각하는 모든 계획이 항상 악할 뿐임을 보시고 \r\n[00:54.08]06.땅 위에 사람 지으셨음을 한탄하사 마음에 근심하시고 \r\n[00:58.53]07.이르시되 내가 창조한 사람을 내가 지면에서 쓸어버리되 사람으로부터 가축과 기는 것과 공중의 새까지 그리하리니 이는 내가 그것들을 지었음을 한탄함이니라 하시니라 \r\n[01:13.23]08.그러나 노아는 여호와께 은혜를 입었더라 \r\n[01:17.05]09.이것이 노아의 족보니라 노아는 의인이요 당대에 완전한 자라 그는 하나님과 동행하였으며 \r\n[01:26.08]10.세 아들을 낳았으니 셈과 함과 야벳이라 \r\n[01:30.23]11.그 때에 온 땅이 하나님 앞에 부패하여 포악함이 땅에 가득한지라 \r\n[01:36.34]12.하나님이 보신즉 땅이 부패하였으니 이는 땅에서 모든 혈육 있는 자의 행위가 부패함이었더라 \r\n[01:44.47]13.하나님이 노아에게 이르시되 모든 혈육 있는 자의 포악함이 땅에 가득하므로 그 끝 날이 내 앞에 이르렀으니 내가 그들을 땅과 함께 멸하리라 \r\n[01:55.87]14.너는 고페르 나무로 너를 위하여 방주를 만들되 그 안에 칸들을 막고 역청을 그 안팎에 칠하라 \r\n[02:04.52]15.네가 만들 방주는 이러하니 그 길이는 삼백 규빗, 너비는 오십 규빗, 높이는 삼십 규빗이라 \r\n[02:12.76]16.거기에 창을 내되 위에서부터 한 규빗에 내고 그 문은 옆으로 내고 상 중 하 삼층으로 할지니라 \r\n[02:22.10]17.내가 홍수를 땅에 일으켜 무릇 생명의 기운이 있는 모든 육체를 천하에서 멸절하리니 땅에 있는 것들이 다 죽으리라 \r\n[02:32.02]18.그러나 너와는 내가 내 언약을 세우리니 너는 네 아들들과 네 아내와 네 며느리들과 함께 그 방주로 들어가고 \r\n[02:42.36]19.혈육 있는 모든 생물을 너는 각기 암수 한 쌍씩 방주로 이끌어 들여 너와 함께 생명을 보존하게 하되 \r\n[02:50.84]20.새가 그 종류대로, 가축이 그 종류대로, 땅에 기는 모든 것이 그 종류대로 각기 둘씩 네게로 나아오리니 그 생명을 보존하게 하라 \r\n[03:02.11]21.너는 먹을 모든 양식을 네게로 가져다가 저축하라 이것이 너와 그들의 먹을 것이 되리라 \r\n[03:09.33]22.노아가 그와 같이하여 하나님이 자기에게 명하신 대로 다 준행 하였더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425747, lowkey: n