  {album_id: 49, title: "창세기 8장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:01", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 8장 (개역개정) - 03:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 8장\r\n[00:06.55]01.하나님이 노아와 그와 함께 방주에 있는 모든 들짐승과 가축을 기억하사 하나님이 바람을 땅 위에 불게 하시매 물이 줄어들었고 \r\n[00:16.76]02.깊음의 샘과 하늘의 창문이 닫히고 하늘에서 비가 그치매 \r\n[00:21.71]03.물이 땅에서 물러가고 점점 물러가서 백오십 일 후에 줄어들고 \r\n[00:27.13]04.일곱째 달 곧 그 달 열이렛날에 방주가 아라랏 산에 머물렀으며 \r\n[00:33.84]05.물이 점점 줄어들어 열째 달 곧 그 달 초하룻날에 산들의 봉우리가 보였더라 \r\n[00:40.85]06.사십 일을 지나서 노아가 그 방주에 낸 창문을 열고 \r\n[00:45.42]07.까마귀를 내놓으매 까마귀가 물이 땅에서 마르기까지 날아 왕래하였더라 \r\n[00:50.93]08.그가 또 비둘기를 내놓아 지면에서 물이 줄어들었는지를 알고자하매 \r\n[00:56.56]09.온 지면에 물이 있으므로 비둘기가 발 붙일 곳을 찾지 못하고 방주로 돌아와 그에게로 오는지라 그가 손을 내밀어 방주 안 자기에게로 받아들이고 \r\n[01:07.97]10.또 칠 일을 기다려 다시 비둘기를 방주에서 내놓으매 \r\n[01:12.60]11.저녁때에 비둘기가 그에게로 돌아왔는데 그 입에 감람나무 새 잎사귀가 있는지라 이에 노아가 땅에 물이 줄어든 줄을 알았으며 \r\n[01:23.14]12.또 칠 일을 기다려 비둘기를 내놓으매 다시는 그에게로 돌아오지 아니하였더라 \r\n[01:29.39]13.육백일 년 첫째 달 곧 그 달 초하룻날에 땅 위에서 물이 걷힌지라 노아가 방주 뚜껑을 제치고 본즉 지면에서 물이 걷혔더니 \r\n[01:41.27]14.둘째 달 스무이렛날에 땅이 말랐더라 \r\n[01:44.76]15.하나님이 노아에게 말씀하여 이르시되 \r\n[01:48.26]16.너는 네 아내와 네 아들들과 네 며느리들과 함께 방주에서 나오고 \r\n[01:53.99]17.너와 함께 한 모든 혈육 있는 생물 곧 새와 가축과 땅에 기는 모든 것을 다 이끌어내라 이것들이 땅에서 생육하고 땅에서 번성하리라 하시매 \r\n[02:06.01]18.노아가 그 아들들과 그의 아내와 그 며느리들과 함께 나왔고 \r\n[02:11.52]19.땅 위의 동물 곧 모든 짐승과 모든 기는 것과 모든 새도 그 종류대로 방주에서 나왔더라 \r\n[02:19.66]20.노아가 여호와께 제단을 쌓고 모든 정결한 짐승과 모든 정결한 새 중에서 제물을 취하여 번제로 제단에 드렸더니 \r\n[02:29.62]21.여호와께서 그 향기를 받으시고 그 중심에 이르시되 내가 다시는 사람으로 말미암아 땅을 저주하지 아니하리니 이는 사람의 마음이 계획하는 바가 어려서부터 악함이라 내가 전에 행한 것 같이 모든 생물을 다시 멸하지 아니하리니 \r\n[02:48.31]22.땅이 있을 동안에는 심음과 거둠과 추위와 더위와 여름과 겨울과 낮과 밤이 쉬지 아니하리라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425748, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 10장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 10장 (개역개정) - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 10장\r\n[00:07.85]01.노아의 아들 셈과 함과 야벳의 족보는 이러하니라 홍수 후에 그들이 아들들을 낳았으니 \r\n[00:15.31]02.야벳의 아들을 고멜과 마곡과 마대와 야완과 두발과 메섹과 디라스요 \r\n[00:22.40]03.고멜의 아들은 아스그나스와 리밧과 도갈마요 \r\n[00:26.56]04.야완의 아들은 엘리사와 달시스와 깃딤과 도다님이라 \r\n[00:31.69]05.이들로부터 여러 나라 백성으로 나뉘어서 각기 언어와 종족과 나라대로 바닷가의 땅에 머물렀더라 \r\n[00:40.06]06.함의 아들은 구스와 미스라임과 붓과 가나안이요 \r\n[00:45.72]07.구스의 아들은 스바와 하윌라와 삽다와 라아마와 삽드가요 라아마의 아들은 스바와 드단이며 \r\n[00:54.14]08.구스가 또 니므롯을 낳았으니 그는 세상에 첫 용사라 \r\n[00:58.86]09.그가 여호와 앞에서 용감한 사냥꾼이 되었으므로 속담에 이르기를 아무는 여호와 앞에 니므롯 같이 용감한 사냥꾼이로다 하더라 \r\n[01:08.76]10.그의 나라는 시날 땅의 바벨과 에렉과 악갓과 갈레에서 시작되었으며 \r\n[01:15.69]11.그가 그 땅에서 앗수르로 나아가 니느웨와 르호보딜과 갈라와 \r\n[01:21.57]12.및 니느웨와 갈라 사이의 레센을 건설하였으니 이는 큰 성읍이라 \r\n[01:27.24]13.미스라임은 루딤과 아나밈과 르하빔과 납두힘과 \r\n[01:32.74]14.바드루심과 가슬루힘과 갑도림을 낳았더라(가슬루힘에게서 블레셋이 나왔더라) \r\n[01:39.41]15.가나안은 장자 시돈과 헷을 낳고 \r\n[01:43.28]16.또 여부스 족속과 아모리 족속과 기르가스 족속과 \r\n[01:47.88]17.히위 족속과 알가 족속과 신 족속과 \r\n[01:51.56]18.아르왓 족속과 스말 족속과 하맛 족속을 낳았더니 이 후로 가나안 자손의 족속이 흩어져 나아갔더라 \r\n[02:00.12]19.가나안의 경계는 시돈에서부터 그랄을 지나 가사까지와 소돔과 고모라와 아드마와 스보임을 지나 라사까지였더라 \r\n[02:09.55]20.이들은 함의 자손이라 각기 족속과 언어와 지방과 나라대로였더라 \r\n[02:16.42]21.셈은 에벨 온 자손의 조상이요 야벳의 형이라 그에게도 자녀가 출생하였으니 \r\n[02:23.80]22.셈의 아들은 엘람과 앗수르와 아르박삿과 룻과 아람이요 \r\n[02:29.16]23.아람의 아들은 우스와 홀과 게델과 마스며 \r\n[02:33.50]24.아르박삿은 셀라를 낳고 셀라는 에벨을 낳았으며 \r\n[02:37.76]25.에벨은 두 아들을 낳고 하나의 이름을 벨렉이라 하였으니 그 때에 세상이 나뉘었음이요 벨렉의 아우의 이름은 욕단이며 \r\n[02:46.82]26.욕단은 알모닷과 셀렙과 하살마웻과 예라와 \r\n[02:51.81]27.하도람과 우살과 디글라와 \r\n[02:54.30]28.오발과 아비마엘과 스바와 \r\n[02:57.06]29.오빌과 하윌라와 요밥을 낳았으니 이들은 다 욕단의 아들이며 \r\n[03:02.09]30.그들이 거주하는 곳은 메사에서부터 스발로 가는 길의 동쪽 산이었더라 \r\n[03:07.37]31.이들은 셈의 자손이니 그 족속과 언어와 지방과 나라대로였더라 \r\n[03:13.67]32.이들은 그 백성들의 족보에 따르면 노아 자손의 족속들이요 홍수 후에 이들에게서 그 땅의 백성들이 나뉘었더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacke