  {album_id: 49, title: "창세기 12장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:10", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 12장 (개역개정) - 03:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 12장\r\n[00:08.18]1. 여호와께서 아브람에게 이르시되 너는 너의 고향과 친척과 아버지의 집을 떠나 내가 네게 보여 줄 땅으로 가라 \r\n[00:16.53]2. 내가 너로 큰 민족을 이루고 네게 복을 주어 네 이름을 창대하게 하리니 너는 복이 될지라 \r\n[00:24.50]3. 너를 축복하는 자에게는 내가 복을 내리고 너를 저주하는 자에게는 내가 저주하리니 땅의 모든 족속이 너로 말미암아 복을 얻을 것이라 하신지라 \r\n[00:35.87]4. 이에 아브람이 여호와의 말씀을 따라갔고 롯도 그와 함께 갔으며 아브람이 하란을 떠날 때에 칠십오 세였더라 \r\n[00:45.72]5. 아브람이 그의 아내 사래와 조카 롯과 하란에서 모은 모든 소유와 얻은 사람들을 이끌고 가나안 땅으로 가려고 떠나서 마침내 가나안 땅에 들어갔더라 \r\n[00:58.26]6. 아브람이 그 땅을 지나 세겜 땅 모레 상수리나무에 이르니 그 때에 가나안 사람이 그 땅에 거주하였더라 \r\n[01:07.22]7. 여호와께서 아브람에게 나타나 이르시되 내가 이 땅을 네 자손에게 주리라 하신지라 자기에게 나타나신 여호와께 그가 그 곳에서 제단을 쌓고 \r\n[01:19.32]8. 거기서 벧엘 동쪽 산으로 옮겨 장막을 치니 서쪽은 벧엘이요 동쪽은 아이라 그가 그 곳에서 여호와께 제단을 쌓고 여호와의 이름을 부르더니 \r\n[01:31.25]9. 점점 남방으로 옮겨갔더라 \r\n[01:33.81]10. 그 땅에 기근이 들었으므로 아브람이 애굽에 거류하려고 그리로 내려갔으니 이는 그 땅에 기근이 심하였음이라 \r\n[01:42.50]11. 그가 애굽에 가까이 이르렀을 때에 그의 아내 사래에게 말하되 내가 알기에 그대는 아리따운 여인이라 \r\n[01:51.07]12. 애굽 사람이 그대를 볼 때에 이르기를 이는 그의 아내라 하여 나는 죽이고 그대는 살리리니 \r\n[01:58.17]13. 원하건대 그대는 나의 누이라 하라 그러면 내가 그대로 말미암아 안전하고 내 목숨이 그대로 말미암아 보존되리라 하니라 \r\n[02:07.85]14. 아브람이 애굽에 이르렀을 때에 애굽 사람들이 그 여인이 심히 아리따움을 보았고 \r\n[02:15.21]15. 바로의 고관들도 그를 보고 바로 앞에서 칭찬하므로 그 여인을 바로의 궁으로 이끌어들인지라 \r\n[02:22.00]16. 이에 바로가 그로 말미암아 아브람을 후대하므로 아브람이 양과 소와 노비와 암수 나귀와 낙타를 얻었더라 \r\n[02:32.04]17. 여호와께서 아브람의 아내 사래의 일로 바로와 그 집에 큰 재앙을 내리신지라 \r\n[02:38.56]18. 바로가 아브람을 불러서 이르되 네가 어찌하여 나에게 이렇게 행하였느냐 네가 어찌하여 그를 네 아내라고 내게 말하지 아니 하였느냐 \r\n[02:49.09]19. 네가 어찌 그를 누이라 하여 내가 그를 데려다가 아내를 삼게 하였느냐 네 아내가 여기 있으니 이제 데려가라 하고 \r\n[02:57.98]20. 바로가 사람들에게 그의 일을 명하매 그들이 그와 함께 그의 아내와 그의 모든 소유를 보내었더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425750, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 21장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "04:32", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 21장 (개역개정) - 04:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 21장\r\n[00:08.43]1. 여호와께서 말씀하신 대로 사라를 돌보셨고 여호와께서 말씀하신 대로 사라에게 행하셨으므로 \r\n[00:15.35]2. 사라가 임신하고 하나님이 말씀하신 시기가 되어 노년의 아브라함에게 아들을 낳으니 \r\n[00:21.44]3. 아브라함이 그에게 태어난 아들 곧 사라가 자기에게 낳은 아들을 이름하여 이삭이라 하였고 \r\n[00:28.34]4. 그 아들 이삭이 난 지 팔 일 만에 그가 하나님이 명령하신 대로 할례를 행하였더라 \r\n[00:34.50]5. 아브라함이 그의 아들 이삭이 그에게 태어날 때에 백 세라 \r\n[00:40.08]6. 사라가 이르되 하나님이 나를 웃게 하시니 듣는 자가 다 나와 함께 웃으리로다 \r\n[00:46.22]7. 또 이르되 사라가 자식들을 젖먹이겠다고 누가 아브라함에게 말하였으리요마는 아브라함의 노경에 내가 아들을 낳았도다 하니라 \r\n[00:56.74]8. 아이가 자라매 젖을 떼고 이삭이 젖을 떼는 날에 아브라함이 큰 잔치를 베풀었더라 \r\n[01:03.63]9. 사라가 본즉 아브라함의 아들 애굽 여인 하갈의 아들이 이삭을 놀리는지라 \r\n[01:10.09]10. 그가 아브라함에게 이르되 이 여종과 그 아들을 내쫓으라 이 종의 아들은 내 아들 이삭과 함께 기업을 얻지 못하리라 하므로 \r\n[01:19.31]11. 아브라함이 그의 아들로 말미암아 그 일이 매우 근심이 되었더니 \r\n[01:24.22]12. 하나님이 아브라함에게 이르시되 네 아이나 네 여종으로 말미암아 근심하지 말고 사라가 네게 이른 말을 다 들으라 이삭에게서 나는 자라야 네 씨라 부를 것임이니라 \r\n[01:37.35]13. 그러나 여종의 아들도 네 씨니 내가 그로 한 민족을 이루게 하리라 하신지라 \r\n[01:43.57]14. 아브라함이 아침에 일찍이 일어나 떡과 물 한 가죽부대를 가져다가 하갈의 어깨에 메워 주고 그 아이를 데리고 가게 하니 하갈이 나가서 브엘세바 광야에서 방황하더니 \r\n[01:56.77]15. 가죽부대의 물이 떨어진지라 그 자식을 관목덤불 아래에 두고 \r\n[02:02.32]16. 이르되 아이가 죽는 것을 차마 보지 못하겠다 하고 화살 한 바탕 거리 떨어져 마주 앉아 바라보며 소리 내어 우니 \r\n[02:10.54]17. 하나님이 그 어린 아이의 소리를 들으셨으므로 하나님의 사자가 하늘에서부터 하갈을 불러 이르시되 하갈아 무슨 일이냐 두려워하지 말라 하나님이 저기 있는 아이의 소리를 들으셨나니 \r\n[02:24.41]18. 일어나 아이를 일으켜 네 손으로 붙들라 그가 큰 민족을 이루게 하리라 하시니라 \r\n[02:31.15]19. 하나님이 하갈의 눈을 밝히셨으므로 샘물을 보고 가서 가죽부대에 물을 채워다가 그 아이에게 마시게 하였더라 \r\n[02:40.35]20. 하나님이 그 아이와 함께 계시매 그가 장성하여 광야에서 거주하며 활 쏘는 자가 되었더니 \r\n[02:47.99]21. 그가 바란 광야에 거주할 때에 그의 어머니가 그를 위하여 애굽 땅에서 아내를 얻어 주었더라 \r\n[02:55.32]22. 그 때에 아비멜렉과 그 군대 장관 비골이 아브라함에게 말하여 이르되 네가 무슨 일을 하든지 하나님이 너와 함께 계시도다 \r\n[03:05.04]23. 그런즉 너는 나와 내 아들과 내 손자에게 거짓되이 행하지 아니하기를 이제 여기서 하나님을 가리켜 내게 맹세하라 내가 네게 후대한 대로 너도 나와 네가 머무는 이 땅에서 행하여 보이라 \r\n[03:19.67]24. 아브라함이 이르되 내가 맹세하리라 하고 \r\n[03:24.45]25. 아비멜렉의 종들이 아브라함의 우물을 빼앗은 일에 관하여