  {album_id: 49, title: "창세기 16장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "02:48", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 16장 (개역개정) - 02:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 16장\r\n[00:08.15]1. 아브람의 아내 사래는 출산하지 못하였고 그에게 한 여종이 있으니 애굽 사람이요 이름은 하갈이라 \r\n[00:15.74]2. 사래가 아브람에게 이르되 여호와께서 내 출산을 허락하지 아니 하셨으니 원하건대 내 여종에게 들어가라 내가 혹 그로 말미암아 자녀를 얻을까 하노라 하매 아브람이 사래의 말을 들으니라 \r\n[00:30.84]3. 아브람의 아내 사래가 그 여종 애굽 사람 하갈을 데려다가 그 남편 아브람에게 첩으로 준 때는 아브람이 가나안 땅에 거주한지 십 년 후였더라 \r\n[00:42.79]4. 아브람이 하갈과 동침하였더니 하갈이 임신하매 그가 자기의 임신함을 알고 그의 여주인을 멸시한지라 \r\n[00:51.56]5. 사래가 아브람에게 이르되 내가 받는 모욕은 당신이 받아야 옳도다 내가 나의 여종을 당신의 품에 두었거늘 그가 자기의 임신함을 알고 나를 멸시하니 당신과 나 사이에 여호와께서 판단하시기를 원하노라 \r\n[01:07.49]6. 아브람이 사래에게 이르되 당신의 여종은 당신의 수중에 있으니 당신의 눈에 좋을 대로 그에게 행하라 하매 사래가 하갈을 학대하였더니 하갈이 사래 앞에서 도망하였더라 \r\n[01:20.26]7. 여호와의 사자가 광야의 샘물 곁 곧 술 길 샘 곁에서 그를 만나 \r\n[01:26.65]8. 이르되 사래의 여종 하갈아 네가 어디서 왔으며 어디로 가느냐 그가 이르되 나는 내 여주인 사래를 피하여 도망하나이다 \r\n[01:36.09]9. 여호와의 사자가 그에게 이르되 네 여주인에게로 돌아가서 그 수하에 복종하라 \r\n[01:42.66]10. 여호와의 사자가 또 그에게 이르되 내가 네 씨를 크게 번성하여 그 수가 많아 셀 수 없게 하리라 \r\n[01:50.32]11. 여호와의 사자가 또 그에게 이르되 네가 임신하였은즉 아들을 낳으리니 그 이름을 이스마엘이라 하라 이는 여호와께서 네 고통을 들으셨음이니라 \r\n[02:02.68]12. 그가 사람 중에 들나귀 같이 되리니 그의 손이 모든 사람을 치겠고 모든 사람의 손이 그를 칠지며 그가 모든 형제와 대항해서 살리라 하니라 \r\n[02:13.96]13. 하갈이 자기에게 이르신 여호와의 이름을 나를 살피시는 하나님이라 하였으니 이는 내가 어떻게 여기서 나를 살피시는 하나님을 뵈었는고 함이라 \r\n[02:25.31]14. 이러므로 그 샘을 브엘라해로이라 불렀으며 그것은 가데스와 베렛 사이에 있더라 \r\n[02:33.25]15. 하갈이 아브람의 아들을 낳으매 아브람이 하갈이 낳은 그 아들을 이름하여 이스마엘이라 하였더라 \r\n[02:41.26]16. 하갈이 아브람에게 이스마엘을 낳았을 때에 아브람이 팔십육 세였더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425756, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 15장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:04", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 15장 (개역개정) - 03:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 15장\r\n[00:08.50]1. 이 후에 여호와의 말씀이 환상 중에 아브람에게 임하여 이르시되 아브람아 두려워하지 말라 나는 네 방패요 너의 지극히 큰 상급이니라 \r\n[00:19.49]2. 아브람이 이르되 주 여호와여 무엇을 내게 주시려 하나이까 나는 자식이 없사오니 나의 상속자는 이 다메섹 사람 엘리에셀이니이다 \r\n[00:30.67]3. 아브람이 또 이르되 주께서 내게 씨를 주지 아니하셨으니 내 집에서 길린 자가 내 상속자가 될 것이니이다 \r\n[00:39.43]4. 여호와의 말씀이 그에게 임하여 이르시되 그 사람이 네 상속자가 아니라 네 몸에서 날 자가 네 상속자가 되리라 하시고 \r\n[00:48.85]5. 그를 이끌고 밖으로 나가 이르시되 하늘을 우러러 뭇별을 셀 수 있나 보라 또 그에게 이르시되 네 자손이 이와 같으리라 \r\n[00:59.22]6. 아브람이 여호와를 믿으니 여호와께서 이를 그의 의로 여기시고 \r\n[01:05.47]7. 또 그에게 이르시되 나는 이 땅을 네게 주어 소유를 삼게 하려고 너를 갈대아인의 우르에서 이끌어 낸 여호와니라 \r\n[01:14.53]8. 그가 이르되 주 여호와여 내가 이 땅을 소유로 받을 것을 무엇으로 알리이까 \r\n[01:21.66]9. 여호와께서 그에게 이르시되 나를 위하여 삼 년 된 암소와 삼 년 된 암염소와 삼 년 된 숫양과 산비둘기와 집비둘기 새끼를 가져올지니라 \r\n[01:33.40]10. 아브람이 그 모든 것을 가져다가 그 중간을 쪼개고 그 쪼갠 것을 마주 대하여 놓고 그 새는 쪼개지 아니하였으며 \r\n[01:42.53]11. 솔개가 그 사체 위에 내릴 때에는 아브람이 쫓았더라 \r\n[01:47.09]12. 해 질 때에 아브람에게 깊은 잠이 임하고 큰 흑암과 두려움이 그에게 임하였더니 \r\n[01:54.00]13. 여호와께서 아브람에게 이르시되 너는 반드시 알라 네 자손이 이방에서 객이 되어 그들을 섬기겠고 그들은 사백 년 동안 네 자손을 괴롭히리니 \r\n[02:05.69]14. 그들이 섬기는 나라를 내가 징벌할지며 그 후에 네 자손이 큰 재물을 이끌고 나오리라 \r\n[02:12.62]15. 너는 장수하다가 평안히 조상에게로 돌아가 장사될 것이요 \r\n[02:17.93]16. 네 자손은 사대 만에 이 땅으로 돌아오리니 이는 아모리 족속의 죄악이 아직 가득 차지 아니함이니라 하시더니 \r\n[02:26.35]17. 해가 져서 어두울 때에 연기 나는 화로가 보이며 타는 횃불이 쪼갠 고기 사이로 지나더라 \r\n[02:33.27]18. 그 날에 여호와께서 아브람과 더불어 언약을 세워 이르시되 내가 이 땅을 애굽 강에서부터 그 큰 강 유브라데까지 네 자손에게 주노니 \r\n[02:44.52]19. 곧 겐 족속과 그니스 족속과 갓몬 족속과 \r\n[02:48.84]20. 헷 족속과 브리스 족속과 르바 족속과 \r\n[02:52.22]21. 아모리 족속과 가나안 족속과 기르가스 족속과 여부스 족속의 땅이니라 하셨더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425757, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 14장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 14장 (개역개정) - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 14장\r\n[00:07.95]1. 당시에 시날 왕 아므라벨과 엘라살 왕 아리옥과 엘람 왕 그돌라오멜과 고임 왕 디달이 \r\n[00:16.60]2. 소돔 왕 베라와 고모라 왕 비르사와 아드마 왕 시납과 스보임 왕 세메벨과 벨라 곧 소알 왕과 싸우니라 \r\n[00:26.41]3. 이들이 다 싯딤 골짜기 곧 지금의 염해에 모였더라 \r\n[00:31.82]4. 이들이 십이 년 동안 그돌라오멜을 섬기다가 제십삼년에 배반한지라 \r\n[00:38.46]5. 제십사년에 그돌라오멜과 그와 함께 한 왕들이 나와서 아스드롯 가르나임에서 르바 족속을, 함에서 수스 족속을, 사웨 기랴다임에서 엠 족속을 치고 \r\n[00:51.37]6. 호리 족속을 그 산 세일에서 쳐서 광야 근방 엘바란까지 이르렀으며 \r\n[00:57.27]7. 그들이 돌이켜 엔미스밧 곧 가데스에 이르러 아말렉 족속의 온 땅과 하사손다말에 사는 아모리 족속을 친지라 \r\n[01:06.66]8. 소돔 왕과 고모라 왕과 아드마 왕과 스보임 왕과 벨라 곧 소알 왕이 나와서 싯딤 골짜기에서 그들과 전쟁을 위하여 진을 쳤더니 \r\n[01:18.81]9. 엘람 왕 그돌라오멜과 고임 왕 디달과 시날 왕 아므라벨과 엘라살 왕 아리옥 네 왕이 곧 그 다섯 왕과 맞서니라 \r\n[01:29.92]10. 싯딤 골짜기에는 역청 구덩이가 많은지라 소돔 왕과 고모라 왕이 달아날 때에 그들이 거기 빠지고 그 나머지는 산으로 도망하매 \r\n[01:40.46]11. 네 왕이 소돔과 고모라의 모든 재물과 양식을 빼앗아 가고 \r\n[01:45.52]12. 소돔에 거주하는 아브람의 조카 롯도 사로잡고 그 재물까지 노략하여 갔더라 \r\n[01:51.44]13. 도망한 자가 와서 히브리 사람 아브람에게 알리니 그 때에 아브람이 아모리 족속 마므레의 상수리 수풀 근처에 거주하였더라 마므레는 에스골의 형제요 또 아넬의 형제라 이들은 아브람과 동맹한 사람들이더라 \r\n[02:09.82]14. 아브람이 그의 조카가 사로잡혔음을 듣고 집에서 길리고 훈련된 자 삼백십팔 명을 거느리고 단까지 쫓아가서 \r\n[02:18.87]15. 그와 그의 가신들이 나뉘어 밤에 그들을 쳐부수고 다메섹 왼편 호바까지 쫓아가 \r\n[02:25.70]16. 모든 빼앗겼던 재물과 자기의 조카 롯과 그의 재물과 또 부녀와 친척을 다 찾아왔더라 \r\n[02:33.85]17. 아브람이 그돌라오멜과 그와 함께 한 왕들을 쳐부수고 돌아올 때에 소돔 왕이 사웨 골짜기 곧 왕의 골짜기로 나와 그를 영접하였고 \r\n[02:46.08]18. 살렘 왕 멜기세덱이 떡과 포도주를 가지고 나왔으니 그는 지극히 높으신 하나님의 제사장이었더라 \r\n[02:53.84]19. 그가 아브람에게 축복하여 이르되 천지의 주재이시요 지극히 높으신 하나님이여 아브람에게 복을 주옵소서 \r\n[03:03.02]20. 너희 대적을 네 손에 붙이신 지극히 높으신 하나님을 찬송할지로다 하매 아브람이 그 얻은 것에서 십분의 일을 멜기세덱에게 주었더라 \r\n[03:14.10]21. 소돔 왕이 아브람에게 이르되 사람은 내게 보내고 물품은 네가 가지라 \r\n[03:20.58]22. 아브람이 소돔 왕에게 이르되 천지의 주재이시요 지극히 높으신 하나님 여호와께 내가 손을 들어 맹세하노니 \r\n[03:29.49]23. 네 말이 내가 아브람으로 치부하게 하였다 할까 하여 네게 속한 것은 실 한 오라기나 들메끈 한 가닥도 내가 가지지 아니하리라 \r\n[03:39.72]24. 오직 젊은이들이 먹은 것과 나와 동행한 아넬과 에스골과 마므레의 분깃을 제할지니 그들이 그 분깃을 가질 것이니라</p> \n\t\t\t\t\t\t"