  {album_id: 49, title: "창세기 13장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "02:36", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 13장 (개역개정) - 02:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 13장\r\n[00:08.08]1. 아브람이 애굽에서 그와 그의 아내와 모든 소유와 롯과 함께 네게브로 올라가니 \r\n[00:15.12]2. 아브람에게 가축과 은과 금이 풍부하였더라 \r\n[00:19.13]3. 그가 네게브에서부터 길을 떠나 벧엘에 이르며 벧엘과 아이 사이 곧 전에 장막 쳤던 곳에 이르니 \r\n[00:27.58]4. 그가 처음으로 제단을 쌓은 곳이라 그가 거기서 여호와의 이름을 불렀더라 \r\n[00:33.30]5. 아브람의 일행 롯도 양과 소와 장막이 있으므로 \r\n[00:38.46]6. 그 땅이 그들이 동거하기에 넉넉하지 못하였으니 이는 그들의 소유가 많아서 동거할 수 없었음이니라 \r\n[00:45.91]7. 그러므로 아브람의 가축의 목자와 롯의 가축의 목자가 서로 다투고 또 가나안 사람과 브리스 사람도 그 땅에 거주하였는지라 \r\n[00:56.54]8. 아브람이 롯에게 이르되 우리는 한 친족이라 나나 너나 내 목자나 네 목자나 서로 다투게 하지 말자 \r\n[01:05.55]9. 네 앞에 온 땅이 있지 아니하냐 나를 떠나가라 네가 좌하면 나는 우하고 네가 우하면 나는 좌하리라 \r\n[01:14.66]10. 이에 롯이 눈을 들어 요단 지역을 바라본즉 소알까지 온 땅에 물이 넉넉하니 여호와께서 소돔과 고모라를 멸하시기 전이었으므로 여호와의 동산 같고 애굽 땅과 같았더라 \r\n[01:28.67]11. 그러므로 롯이 요단 온 지역을 택하고 동으로 옮기니 그들이 서로 떠난 지라 \r\n[01:35.44]12. 아브람은 가나안 땅에 거주하였고 롯은 그 지역의 도시들에 머무르며 그 장막을 옮겨 소돔까지 이르렀더라 \r\n[01:44.47]13. 소돔 사람은 여호와 앞에 악하며 큰 죄인이었더라 \r\n[01:49.51]14. 롯이 아브람을 떠난 후에 여호와께서 아브람에게 이르시되 너는 눈을 들어 너 있는 곳에서 북쪽과 남쪽 그리고 동쪽과 서쪽을 바라보라 \r\n[02:02.26]15. 보이는 땅을 내가 너와 네 자손에게 주리니 영원히 이르리라 \r\n[02:08.11]16. 내가 네 자손이 땅의 티끌 같게 하리니 사람이 땅의 티끌을 능히 셀 수 있을진대 네 자손도 세리라 \r\n[02:16.36]17. 너는 일어나 그 땅을 종과 횡으로 두루 다녀 보라 내가 그것을 네게 주리라 \r\n[02:23.16]18. 이에 아브람이 장막을 옮겨 헤브론에 있는 마므레 상수리 수풀에 이르러 거주하며 거기서 여호와를 위하여 제단을 쌓았더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425759, lowkey: nil, highkey: nil},
