  {album_id: 49, title: "창세기 27장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "07:37", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 27장 (개역개정) - 07:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 27장\r\n[00:08.08]1. 이삭이 나이가 많아 눈이 어두워 잘 보지 못하더니 맏아들 에서를 불러 이르되 내 아들아 하매 그가 이르되 내가 여기 있나이다 하니 \r\n[00:19.06]2. 이삭이 이르되 내가 이제 늙어 어느 날 죽을는지 알지 못하니 \r\n[00:24.44]3. 그런즉 네 기구 곧 화살통과 활을 가지고 들에 가서 나를 위하여 사냥하여 \r\n[00:31.22]4. 내가 즐기는 별미를 만들어 내게로 가져와서 먹게 하여 내가 죽기 전에 내 마음껏 네게 축복하게 하라 \r\n[00:39.10]5. 이삭이 그의 아들 에서에게 말할 때에 리브가가 들었더니 에서가 사냥하여 오려고 들로 나가매 \r\n[00:46.91]6. 리브가가 그의 아들 야곱에게 말하여 이르되 네 아버지가 네 형 에서에게 말씀하시는 것을 내가 들으니 이르시기를 \r\n[00:55.62]7. 나를 위하여 사냥하여 가져다가 별미를 만들어 내가 먹게 하여 죽기 전에 여호와 앞에서 네게 축복하게 하라 하셨으니 \r\n[01:04.12]8. 그런즉 내 아들아 내 말을 따라 내가 네게 명하는 대로 \r\n[01:09.12]9. 염소 떼에 가서 거기서 좋은 염소 새끼 두 마리를 내게로 가져오면 내가 그것으로 네 아버지를 위하여 그가 즐기시는 별미를 만들리니 \r\n[01:18.66]10. 네가 그것을 네 아버지께 가져다 드려서 그가 죽기 전에 네게 축복하기 위하여 잡수시게 하라 \r\n[01:25.78]11. 야곱이 그 어머니 리브가에게 이르되 내 형 에서는 털이 많은 사람이요 나는 매끈매끈한 사람인즉 \r\n[01:34.24]12. 아버지께서 나를 만지실진대 내가 아버지의 눈에 속이는 자로 보일지라 복은 고사하고 저주를 받을까 하나이다 \r\n[01:42.85]13. 어머니가 그에게 이르되 내 아들아 너의 저주는 내게로 돌리리니 내 말만 따르고 가서 가져오라 \r\n[01:51.04]14. 그가 가서 끌어다가 어머니에게로 가져왔더니 그의 어머니가 그의 아버지가 즐기는 별미를 만들었더라 \r\n[01:58.95]15. 리브가가 집 안 자기에게 있는 그의 맏아들 에서의 좋은 의복을 가져다가 그의 작은아들 야곱에게 입히고 \r\n[02:07.69]16. 또 염소 새끼의 가죽을 그의 손과 목의 매끈매끈한 곳에 입히고 \r\n[02:13.06]17. 자기가 만든 별미와 떡을 자기 아들 야곱의 손에 주니 \r\n[02:17.35]18. 야곱이 아버지에게 나아가서 내 아버지여 하고 부르니 이르되 내가 여기 있노라 내 아들아 네가 누구냐 \r\n[02:26.24]19. 야곱이 아버지에게 대답하되 나는 아버지의 맏아들 에서로소이다 아버지께서 내게 명하신 대로 내가 하였사오니 원하건대 일어나 앉아서 내가 사냥한 고기를 잡수시고 아버지 마음껏 내게 축복하소서 \r\n[02:42.54]20. 이삭이 그의 아들에게 이르되 내 아들아 네가 어떻게 이같이 속히 잡았느냐 그가 이르되 아버지의 하나님 여호와께서 나로 순조롭게 만나게 하셨음이니이다 \r\n[02:55.31]21. 이삭이 야곱에게 이르되 내 아들아 가까이 오라 네가 과연 내 아들 에서인지 아닌지 내가 너를 만져보려 하노라 \r\n[03:04.79]22. 야곱이 그 아버지 이삭에게 가까이 가니 이삭이 만지며 이르되 음성은 야곱의 음성이나 손은 에서의 손이로다 하며 \r\n[03:14.55]23. 그의 손이 형 에서의 손과 같이 털이 있으므로 분별하지 못하고 축복하였더라 \r\n[03:20.64]24. 이삭이 이르되 네가 참 내 아들 에서냐 그가 대답하되 그러하니이다 \r\n[03:27.97]25. 이삭이 이르되 내게로 가져오라 내 아들이 사냥한 고기를 먹고 내 