[03:38.78]28. 이삭은 에서가 사냥한 고기를 좋아하므로 그를 사랑하고 리브가는 야곱을 사랑하였더라 \r\n[03:45.76]29. 야곱이 죽을 쑤었더니 에서가 들에서 돌아와서 심히 피곤하여 \r\n[03:51.45]30. 야곱에게 이르되 내가 피곤하니 그 붉은 것을 내가 먹게 하라 한지라 그러므로 에서의 별명은 에돔이더라 \r\n[04:00.13]31. 야곱이 이르되 형의 장자의 명분을 오늘 내게 팔라 \r\n[04:05.19]32. 에서가 이르되 내가 죽게 되었으니 이 장자의 명분이 내게 무엇이 유익하리요 \r\n[04:11.43]33. 야곱이 이르되 오늘 내게 맹세하라 에서가 맹세하고 장자의 명분을 야곱에게 판지라 \r\n[04:19.14]34. 야곱이 떡과 팥죽을 에서에게 주매 에서가 먹으며 마시고 일어나 갔으니 에서가 장자의 명분을 가볍게 여김이었더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425765, lowkey: nil, highkey: nil},
