 손목고리 한 쌍을 그에게 주며 \r\n[03:31.84]23. 이르되 네가 누구의 딸이냐 청하건대 내게 말하라 네 아버지의 집에 우리가 유숙할 곳이 있느냐 \r\n[03:40.35]24. 그 여자가 그에게 이르되 나는 밀가가 나홀에게서 낳은 아들 브두엘의 딸이니이다 \r\n[03:46.76]25. 또 이르되 우리에게 짚과 사료가 족하며 유숙할 곳도 있나이다 \r\n[03:52.37]26. 이에 그 사람이 머리를 숙여 여호와께 경배하고 \r\n[03:56.15]27. 이르되 나의 주인 아브라함의 하나님 여호와를 찬송하나이다 나의 주인에게 주의 사랑과 성실을 그치지 아니하셨사오며 여호와께서 길에서 나를 인도하사 내 주인의 동생 집에 이르게 하셨나이다 하니라 \r\n[04:11.63]28. 소녀가 달려가서 이 일을 어머니 집에 알렸더니 \r\n[04:15.90]29. 리브가에게 오라버니가 있어 그의 이름은 라반이라 그가 우물로 달려가 그 사람에게 이르러 \r\n[04:22.84]30. 그의 누이의 코걸이와 그 손의 손목고리를 보고 또 그의 누이 리브가가 그 사람이 자기에게 이같이 말하더라 함을 듣고 그 사람에게로 나아감이라 그 때에 그가 우물가 낙타 곁에 서 있더라 \r\n[04:37.21]31. 라반이 이르되 여호와께 복을 받은 자여 들어오소서 어찌 밖에 서 있나이까 내가 방과 낙타의 처소를 준비하였나이다 \r\n[04:48.00]32. 그 사람이 그 집으로 들어가매 라반이 낙타의 짐을 부리고 짚과 사료를 낙타에게 주고 그 사람의 발과 그의 동행자들의 발 씻을 물을 주고 \r\n[04:59.06]33. 그 앞에 음식을 베푸니 그 사람이 이르되 내가 내 일을 진술하기 전에는 먹지 아니하겠나이다 라반이 이르되 말하소서 \r\n[05:08.83]34. 그가 이르되 나는 아브라함의 종이니이다 \r\n[05:12.68]35. 여호와께서 나의 주인에게 크게 복을 주시어 창성하게 하시되 소와 양과 은금과 종들과 낙타와 나귀를 그에게 주셨고 \r\n[05:23.24]36. 나의 주인의 아내 사라가 노년에 나의 주인에게 아들을 낳으매 주인이 그의 모든 소유를 그 아들에게 주었나이다 \r\n[05:32.11]37. 나의 주인이 나에게 맹세하게 하여 이르되 너는 내 아들을 위하여 내가 사는 땅 가나안 족속의 딸들 중에서 아내를 택하지 말고 \r\n[05:42.26]38. 내 아버지의 집, 내 족속에게로 가서 내 아들을 위하여 아내를 택하라 하시기로 \r\n[05:48.34]39. 내가 내 주인에게 여쭈되 혹 여자가 나를 따르지 아니하면 어찌 하리이까 한즉 \r\n[05:54.54]40. 주인이 내게 이르되 내가 섬기는 여호와께서 그의 사자를 너와 함께 보내어 네게 평탄한 길을 주시리니 너는 내 족속 중 내 아버지 집에서 내 아들을 위하여 아내를 택할 것이니라 \r\n[06:07.92]41. 네가 내 족속에게 이를 때에는 네가 내 맹세와 상관이 없으리라 만일 그들이 네게 주지 아니할지라도 네가 내 맹세와 상관이 없으리라 하시기로 \r\n[06:20.16]42. 내가 오늘 우물에 이르러 말하기를 내 주인 아브라함의 하나님 여호와여 만일 내가 행하는 길에 형통함을 주실진대 \r\n[06:29.08]43. 내가 이 우물 곁에 서 있다가 젊은 여자가 물을 길으러 오거든 내가 그에게 청하기를 너는 물동이의 물을 내게 조금 마시게 하라 하여 \r\n[06:39.07]44. 그의 대답이 당신은 마시라 내가 또 당신의 낙타를 위하여도 길으리라 하면 그 여자는 여호와께서 내 주인의 아들을 위하여 정하여 주신 자가 되리이다 하며 \r\n[06:50.82]45. 내가 마음속으로 말하기를 마치기도 전에 리브가가 물동이를 어깨에 메고 나와서 우물로 내려와 긷기로 내가 그에게 이르기를 청하건대 내게 마시게 하라 한즉 \r\n[07:02.54]46. 그가 급히 물동이를 어깨에서 내리며 이르되 마시라 내가 당신의 낙타에게도 마시게 하리라 하기로 내가 마시매 그가 또 낙타에게도 마시게 한지라 \r\n[07:13.34]47. 내가 그에게 묻기를 네가 뉘 딸이냐 한즉 이르되 밀가가 나홀에게서 낳은 브두엘의 딸이라 하기로 내가 코걸이를 그 코에 꿰고 손목고리를 그 손에 끼우고 \r\n[07:25.97]48. 내 주인 아브라함의 하나님 여호와께서 나를 바른 길로 인도하사 나의 주인의 동생의 딸을 그의 아들을 위하여 택하게 하셨으므로 내가 머리를 숙여 그에게 경배하고 찬송하였나이다 \r\n[07:38.88]49. 이제 당신들이 인자함과 진실함으로 내 주인을 대접하려거든 내게 알게 해 주시고 그렇지 아니할지라도 내게 알게 해 주셔서 내가 우로든지 좌로든지 행하게 하소서 \r\n[07:52.43]50. 라반과 브두엘이 대답하여 이르되 이 일이 여호와께로 말미암았으니 우리는 가부를 말할 수 없노라 \r\n[08:00.67]51. 리브가가 당신 앞에 있으니 데리고 가서 여호와의 명령대로 그를 당신의 주인의 아들의 아내가 되게 하라 \r\n[08:08.69]52. 아브라함의 종이 그들의 말을 듣고 땅에 엎드려 여호와께 절하고 \r\n[08:13.92]53. 은금 패물과 의복을 꺼내어 리브가에게 주고 그의 오라버니와 어머니에게도 보물을 주니라 \r\n[08:20.95]54. 이에 그들 곧 종과 동행자들이 먹고 마시고 유숙하고 아침에 일어나서 그가 이르되 나를 보내어 내 주인에게로 돌아가게 하소서 \r\n[08:32.44]55. 리브가의 오라버니와 그의 어머니가 이르되 이 아이로 하여금 며칠 또는 열흘을 우리와 함께 머물게 하라 그 후에 그가 갈 것이니라 \r\n[08:42.89]56. 그 사람이 그들에게 이르되 나를 만류하지 마소서 여호와께서 내게 형통한 길을 주셨으니 나를 보내어 내 주인에게로 돌아가게 하소서 \r\n[08:53.08]57. 그들이 이르되 우리가 소녀를 불러 그에게 물으리라 하고 \r\n[08:58.04]58. 리브가를 불러 그에게 이르되 네가 이 사람과 함께 가려느냐 그가 대답하되 가겠나이다 \r\n[09:05.44]59. 그들이 그 누이 리브가와 그의 유모와 아브라함의 종과 그 동행자들을 보내며 \r\n[09:11.91]60. 리브가에게 축복하여 이르되 우리 누이여 너는 천만인의 어머니가 될지어다 네 씨로 그 원수의 성 문을 얻게 할지어다 \r\n[09:21.67]61. 리브가가 일어나 여자 종들과 함께 낙타를 타고 그 사람을 따라가니 그 종이 리브가를 데리고 가니라 \r\n[09:29.31]62. 그 때에 이삭이 브엘라해로이에서 왔으니 그가 네게브 지역에 거주하였음이라 \r\n[09:36.27]63. 이삭이 저물 때에 들에 나가 묵상하다가 눈을 들어보매 낙타들이 오는지라 \r\n[09:43.17]64. 리브가가 눈을 들어 이삭을 바라보고 낙타에서 내려 \r\n[09:48.51]65. 종에게 말하되 들에서 배회하다가 우리에게로 마주 오는 자가 누구냐 종이 이르되 이는 내 주인이니이다 리브가가 너울을 가지고 자기의 얼굴을 가리더라 \r\n[10:00.80]66. 종이 그 행한 일을 다 이삭에게 아뢰매 \r\n[10:04.74]67. 이삭이 리브가를 인도하여 그의 어머니 사라의 장막으로 들이고 그를 맞이하여 아내로 삼고 사랑하였으니 이삭이 그의 어머니를 장례한 후에 위로를 얻었더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425766, lowkey: nil, highkey: nil},
