  {album_id: 49, title: "창세기 45장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 45장 (개역개정) - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 45장\r\n[00:07.99]1. 요셉이 시종하는 자들 앞에서 그 정을 억제하지 못하여 소리 질러 모든 사람을 자기에게서 물러가라 하고 그 형제들에게 자기를 알리니 그 때에 그와 함께 한 다른 사람이 없었더라 \r\n[00:21.82]2. 요셉이 큰 소리로 우니 애굽 사람에게 들리며 바로의 궁중에 들리더라 \r\n[00:28.32]3. 요셉이 그 형들에게 이르되 나는 요셉이라 내 아버지께서 아직 살아 계시니이까 형들이 그 앞에서 놀라서 대답하지 못하더라 \r\n[00:39.40]4. 요셉이 형들에게 이르되 내게로 가까이 오소서 그들이 가까이 가니 이르되 나는 당신들의 아우 요셉이니 당신들이 애굽에 판 자라 \r\n[00:50.95]5. 당신들이 나를 이 곳에 팔았다고 해서 근심하지 마소서 한탄하지 마소서 하나님이 생명을 구원하시려고 나를 당신들보다 먼저 보내셨나이다 \r\n[01:02.48]6. 이 땅에 이 년 동안 흉년이 들었으나 아직 오 년은 밭갈이도 못하고 추수도 못할지라 \r\n[01:09.54]7. 하나님이 큰 구원으로 당신들의 생명을 보존하고 당신들의 후손을 세상에 두시려고 나를 당신들보다 먼저 보내셨나니 \r\n[01:18.61]8. 그런즉 나를 이리로 보낸 이는 당신들이 아니요 하나님이시라 하나님이 나를 바로에게 아버지로 삼으시고 그 온 집의 주로 삼으시며 애굽 온 땅의 통치자로 삼으셨나이다 \r\n[01:32.26]9. 당신들은 속히 아버지께로 올라가서 아뢰기를 아버지의 아들 요셉의 말에 하나님이 나를 애굽 전국의 주로 세우셨으니 지체 말고 내게로 내려오사 \r\n[01:43.76]10. 아버지의 아들들과 아버지의 손자들과 아버지의 양과 소와 모든 소유가 고센 땅에 머물며 나와 가깝게 하소서 \r\n[01:53.35]11. 흉년이 아직 다섯 해가 있으니 내가 거기서 아버지를 봉양하리이다 아버지와 아버지의 가족과 아버지께 속한 모든 사람에게 부족함이 없도록 하겠나이다 하더라고 전하소서 \r\n[02:06.85]12. 당신들의 눈과 내 아우 베냐민의 눈이 보는 바 당신들에게 이 말을 하는 것은 내 입이라 \r\n[02:14.47]13. 당신들은 내가 애굽에서 누리는 영화와 당신들이 본 모든 것을 다 내 아버지께 아뢰고 속히 모시고 내려오소서 하며 \r\n[02:23.64]14. 자기 아우 베냐민의 목을 안고 우니 베냐민도 요셉의 목을 안고 우니라 \r\n[02:29.09]15. 요셉이 또 형들과 입맞추며 안고 우니 형들이 그제서야 요셉과 말하니라 \r\n[02:36.23]16. 요셉의 형들이 왔다는 소문이 바로의 궁에 들리매 바로와 그의 신하들이 기뻐하고 \r\n[02:43.52]17. 바로는 요셉에게 이르되 네 형들에게 명령하기를 너희는 이렇게 하여 너희 양식을 싣고 가서 가나안 땅에 이르거든 \r\n[02:52.00]18. 너희 아버지와 너희 가족을 이끌고 내게로 오라 내가 너희에게 애굽의 좋은 땅을 주리니 너희가 나라의 기름진 것을 먹으리라 \r\n[03:01.38]19. 이제 명령을 받았으니 이렇게 하라 너희는 애굽 땅에서 수레를 가져다가 너희 자녀와 아내를 태우고 너희 아버지를 모셔 오라 \r\n[03:11.08]20. 또 너희의 기구를 아끼지 말라 온 애굽 땅의 좋은 것이 너희 것임이니라 \r\n[03:17.14]21. 이스라엘의 아들들이 그대로 할 새 요셉이 바로의 명령대로 그들에게 수레를 주고 길 양식을 주며 \r\n[03:24.99]22. 또 그들에게 다 각기 옷 한 벌씩을 주되 베냐민에게는 은 삼백과 옷 다섯 벌을 주고 \r\n[03:32.30]23. 그가 또 이와 같이 그 아버지에게 보내되 수나귀 열 필에 애굽의 아름다운 물품을 실리