  {album_id: 49, title: "창세기 44장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "05:18", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 44장 (개역개정) - 05:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 44장\r\n[00:08.55]1. 요셉이 그의 집 청지기에게 명하여 이르되 양식을 각자의 자루에 운반할 수 있을 만큼 채우고 각자의 돈을 그 자루에 넣고 \r\n[00:17.81]2. 또 내 잔 곧 은잔을 그 청년의 자루 아귀에 넣고 그 양식 값 돈도 함께 넣으라 하매 그가 요셉의 명령대로 하고 \r\n[00:26.83]3. 아침이 밝을 때에 사람들과 그들의 나귀들을 보내니라 \r\n[00:31.48]4. 그들이 성읍에서 나가 멀리 가기 전에 요셉이 청지기에게 이르되 일어나 그 사람들의 뒤를 따라가서 그들에게 이르기를 너희가 어찌하여 선을 악으로 갚느냐 \r\n[00:43.21]5. 이것은 내 주인이 가지고 마시며 늘 점치는 데에 쓰는 것이 아니냐 너희가 이같이 하니 악하도다 하라 \r\n[00:50.95]6. 청지기가 그들에게 따라 가서 그대로 말하니 \r\n[00:54.93]7. 그들이 그에게 대답하되 내 주여 어찌 이렇게 말씀하시나이까 당신의 종들이 이런 일은 결단코 아니하나이다 \r\n[01:03.22]8. 우리 자루에 있던 돈도 우리가 가나안 땅에서부터 당신에게로 가져왔거늘 우리가 어찌 당신의 주인의 집에서 은 금을 도둑질하리이까 \r\n[01:14.12]9. 당신의 종들 중 누구에게서 발견되든지 그는 죽을 것이요 우리는 내 주의 종들이 되리이다 \r\n[01:21.45]10. 그가 이르되 그러면 너희의 말과 같이 하리라 그것이 누구에게서든지 발견되면 그는 내게 종이 될 것이요 너희는 죄가 없으리라 \r\n[01:31.56]11. 그들이 각각 급히 자루를 땅에 내려놓고 자루를 각기 푸니 \r\n[01:36.60]12. 그가 나이 많은 자에게서부터 시작하여 나이 적은 자에게까지 조사하매 그 잔이 베냐민의 자루에서 발견된지라 \r\n[01:44.97]13. 그들이 옷을 찢고 각기 짐을 나귀에 싣고 성으로 돌아 가니라 \r\n[01:50.03]14. 유다와 그의 형제들이 요셉의 집에 이르니 요셉이 아직 그 곳에 있는지라 그의 앞에서 땅에 엎드리니 \r\n[01:58.22]15. 요셉이 그들에게 이르되 너희가 어찌하여 이런 일을 행하였느냐 나 같은 사람이 점을 잘 치는 줄을 너희는 알지 못하였느냐 \r\n[02:07.18]16. 유다가 말하되 우리가 내 주께 무슨 말을 하오리이까 무슨 설명을 하오리이까 우리가 어떻게 우리의 정직함을 나타내리이까 하나님이 종들의 죄악을 찾아내셨으니 우리와 이 잔이 발견된 자가 다 내 주의 노예가 되겠나이다 \r\n[02:24.45]17. 요셉이 이르되 내가 결코 그리하지 아니하리라 잔이 그 손에서 발견된 자만 내 종이 되고 너희는 평안히 너희 아버지께로 도로 올라갈 것이니라 \r\n[02:35.83]18. 유다가 그에게 가까이 가서 이르되 내 주여 원하건대 당신의 종에게 내 주의 귀에 한 말씀을 아뢰게 하소서 주의 종에게 노하지 마소서 주는 바로와 같으심이니이다 \r\n[02:50.05]19. 이전에 내 주께서 종들에게 물으시되 너희는 아버지가 있느냐 아우가 있느냐 하시기에 \r\n[02:57.69]20. 우리가 내 주께 아뢰되 우리에게 아버지가 있으니 노인이요 또 그가 노년에 얻은 아들 청년이 있으니 그의 형은 죽고 그의 어머니가 남긴 것은 그뿐이므로 그의 아버지가 그를 사랑하나이다 하였더니 \r\n[03:12.47]21. 주께서 또 종들에게 이르시되 그를 내게로 데리고 내려와서 내가 그를 보게 하라 하시기로 \r\n[03:19.12]22. 우리가 내 주께 말씀드리기를 그 아이는 그의 아버지를 떠나지 못할지니 떠나면 그의 아버지가 죽겠나이다 \r\n[03:26.99]23. 주께서 또 주의 종들에게 말씀하시되 너희 막내 아우가 너희