  {album_id: 49, title: "창세기 50장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 50장 (개역개정) - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 50장\r\n[00:08.19]1. 요셉이 그의 아버지 얼굴에 구푸려 울며 입맞추고 \r\n[00:13.21]2. 그 수종 드는 의원에게 명하여 아버지의 몸을 향으로 처리하게 하매 의원이 이스라엘에게 그대로 하되 \r\n[00:20.45]3. 사십 일이 걸렸으니 향으로 처리하는 데는 이 날수가 걸림이며 애굽 사람들은 칠십 일 동안 그를 위하여 곡하였더라 \r\n[00:29.87]4. 곡하는 기한이 지나매 요셉이 바로의 궁에 말하여 이르되 내가 너희에게 은혜를 입었으면 원하건대 바로의 귀에 아뢰기를 \r\n[00:39.94]5. 우리 아버지가 나로 맹세하게 하여 이르되 내가 죽거든 가나안 땅에 내가 파 놓은 묘실에 나를 장사하라 하였나니 나로 올라가서 아버지를 장사하게 하소서 내가 다시 오리이다 하라 하였더니 \r\n[00:54.71]6. 바로가 이르되 그가 네게 시킨 맹세대로 올라가서 네 아버지를 장사하라 \r\n[01:00.70]7. 요셉이 자기 아버지를 장사하러 올라가니 바로의 모든 신하와 바로 궁의 원로들과 애굽 땅의 모든 원로와 \r\n[01:09.67]8. 요셉의 온 집과 그의 형제들과 그의 아버지의 집이 그와 함께 올라가고 그들의 어린 아이들과 양 떼와 소 떼만 고센 땅에 남겼으며 \r\n[01:20.54]9. 병거와 기병이 요셉을 따라 올라가니 그 떼가 심히 컸더라 \r\n[01:25.74]10. 그들이 요단 강 건너편 아닷 타작 마당에 이르러 거기서 크게 울고 애통하며 요셉이 아버지를 위하여 칠 일 동안 애곡하였더니 \r\n[01:35.94]11. 그 땅 거민 가나안 백성들이 아닷 마당의 애통을 보고 이르되 이는 애굽 사람의 큰 애통이라 하였으므로 그 땅 이름을 아벨 미스라임이라 하였으니 곧 요단 강 건너편이더라 \r\n[01:49.86]12. 야곱의 아들들이 아버지가 그들에게 명령한 대로 그를 위해 따라 행하여 \r\n[01:55.93]13. 그를 가나안 땅으로 메어다가 마므레 앞 막벨라 밭 굴에 장사하였으니 이는 아브라함이 헷 족속 에브론에게 밭과 함께 사서 매장지를 삼은 곳이더라 \r\n[02:07.86]14. 요셉이 아버지를 장사한 후에 자기 형제와 호상꾼과 함께 애굽으로 돌아왔더라 \r\n[02:15.04]15. 요셉의 형제들이 그들의 아버지가 죽었음을 보고 말하되 요셉이 혹시 우리를 미워하여 우리가 그에게 행한 모든 악을 다 갚지나 아니할까 하고 \r\n[02:26.07]16. 요셉에게 말을 전하여 이르되 당신의 아버지가 돌아가시기 전에 명령하여 이르시기를 \r\n[02:32.34]17. 너희는 이같이 요셉에게 이르라 네 형들이 네게 악을 행하였을지라도 이제 바라건대 그들의 허물과 죄를 용서하라 하셨나니 당신 아버지의 하나님의 종들인 우리 죄를 이제 용서하소서 하매 요셉이 그들이 그에게 하는 말을 들을 때에 울었더라 \r\n[02:52.31]18. 그의 형들이 또 친히 와서 요셉의 앞에 엎드려 이르되 우리는 당신의 종들이니이다 \r\n[02:59.26]19. 요셉이 그들에게 이르되 두려워하지 마소서 내가 하나님을 대신 하리이까 \r\n[03:05.60]20. 당신들은 나를 해하려 하였으나 하나님은 그것을 선으로 바꾸사 오늘과 같이 많은 백성의 생명을 구원하게 하시려 하셨나니 \r\n[03:14.37]21. 당신들은 두려워하지 마소서 내가 당신들과 당신들의 자녀를 기르리이다 하고 그들을 간곡한 말로 위로하였더라 \r\n[03:23.66]22. 요셉이 그의 아버지의 가족과 함께 애굽에 거주하여 백십 세를 살며 \r\n[03:29.31]23. 에브라임의 자손 삼대를 보았으며 므낫세의 아들 마길의 아들들도 요셉의 슬하에서 양육되었더라 \r\n[03:37.26]24. 요셉이 그의 형제들에게 이르되 나는 죽을 것이나 하나님이 당신들을 돌보시고 당신들을 이 땅에서 인도하여 내사 아브라함과 이삭과 야곱에게 맹세하신 땅에 이르게 하시리라 하고 \r\n[03:51.16]25. 요셉이 또 이스라엘 자손에게 맹세시켜 이르기를 하나님이 반드시 당신들을 돌보시리니 당신들은 여기서 내 해골을 메고 올라가겠다 하라 하였더라 \r\n[04:02.29]26. 요셉이 백십 세에 죽으매 그들이 그의 몸에 향 재료를 넣고 애굽에서 입관하였더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425778, lowkey: nil, highkey: nil},
