  {album_id: 49, title: "창세기 48장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "04:09", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 48장 (개역개정) - 04:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 48장\r\n[00:08.19]1. 이 일 후에 어떤 사람이 요셉에게 말하기를 네 아버지가 병들었다 하므로 그가 곧 두 아들 므낫세와 에브라임과 함께 이르니 \r\n[00:17.98]2. 어떤 사람이 야곱에게 말하되 네 아들 요셉이 네게 왔다 하매 이스라엘이 힘을 내어 침상에 앉아 \r\n[00:25.69]3. 요셉에게 이르되 이전에 가나안 땅 루스에서 전능하신 하나님이 내게 나타나사 복을 주시며 \r\n[00:32.74]4. 내게 이르시되 내가 너로 생육하고 번성하게 하여 네게서 많은 백성이 나게 하고 내가 이 땅을 네 후손에게 주어 영원한 소유가 되게 하리라 하셨느니라 \r\n[00:44.38]5. 내가 애굽으로 와서 네게 이르기 전에 애굽에서 네가 낳은 두 아들 에브라임과 므낫세는 내 것이라 르우벤과 시므온처럼 내 것이 될 것이요 \r\n[00:55.72]6. 이들 후의 네 소생은 네 것이 될 것이며 그들의 유산은 그들의 형의 이름으로 함께 받으리라 \r\n[01:02.67]7. 내게 대하여는 내가 이전에 밧단에서 올 때에 라헬이 나를 따르는 도중 가나안 땅에서 죽었는데 그 곳은 에브랏까지 길이 아직도 먼 곳이라 내가 거기서 그를 에브랏 길에 장사하였느니라 (에브랏은 곧 베들레헴이라) \r\n[01:21.05]8. 이스라엘이 요셉의 아들들을 보고 이르되 이들은 누구냐 \r\n[01:26.33]9. 요셉이 그의 아버지에게 아뢰되 이는 하나님이 여기서 내게 주신 아들들이니이다 아버지가 이르되 그들을 데리고 내 앞으로 나아오라 내가 그들에게 축복하리라 \r\n[01:40.17]10. 이스라엘의 눈이 나이로 말미암아 어두워서 보지 못하더라 요셉이 두 아들을 이끌어 아버지 앞으로 나아가니 이스라엘이 그들에게 입맞추고 그들을 안고 \r\n[01:51.89]11. 요셉에게 이르되 내가 네 얼굴을 보리라고는 생각하지 못하였더니 하나님이 내게 내 자손까지도 보게 하셨도다 \r\n[02:01.17]12. 요셉이 아버지의 무릎 사이에서 두 아들을 물러나게 하고 땅에 엎드려 절하고 \r\n[02:07.52]13. 오른손으로는 에브라임을 이스라엘의 왼손을 향하게 하고 왼손으로는 므낫세를 이스라엘의 오른손을 향하게 하여 이끌어 그에게 가까이 나아가매 \r\n[02:17.60]14. 이스라엘이 오른손을 펴서 차남 에브라임의 머리에 얹고 왼손을 펴서 므낫세의 머리에 얹으니 므낫세는 장자라도 팔을 엇바꾸어 얹었더라 \r\n[02:29.00]15. 그가 요셉을 위하여 축복하여 이르되 내 조부 아브라함과 아버지 이삭이 섬기던 하나님, 나의 출생으로부터 지금까지 나를 기르신 하나님, \r\n[02:40.81]16. 나를 모든 환난에서 건지신 여호와의 사자께서 이 아이들에게 복을 주시오며 이들로 내 이름과 내 조상 아브라함과 이삭의 이름으로 칭하게 하시오며 이들이 세상에서 번식되게 하시기를 원하나이다 \r\n[02:56.77]17. 요셉이 그 아버지가 오른손을 에브라임의 머리에 얹은 것을 보고 기뻐하지 아니하여 아버지의 손을 들어 에브라임의 머리에서 므낫세의 머리로 옮기고자하여 \r\n[03:08.08]18. 그의 아버지에게 이르되 아버지여 그리 마옵소서 이는 장자이니 오른손을 그의 머리에 얹으소서 하였으나 \r\n[03:16.12]19. 그의 아버지가 허락하지 아니하며 이르되 나도 안다 내 아들아 나도 안다 그도 한 족속이 되며 그도 크게 되려니와 그의 아우가 그보다 큰 자가 되고 그의 자손이 여러 민족을 이루리라 하고 \r\n[03:30.79]20. 그 날에 그들에게 축복하여 이르되 이스라엘이 너로 말미암아 축복하기를 하나님이 네게 에브라임 같고 므낫세 같게 하시리라 하며 에브라임을 므낫세보다 앞세웠더라 \r\n[03:43.26]21. 이스라엘이 요셉에게 또 이르되 나는 죽으나 하나님이 너희와 함께 계시사 너희를 인도하여 너희 조상의 땅으로 돌아가게 하시려니와 \r\n[03:54.57]22. 내가 네게 네 형제보다 세겜 땅을 더 주었나니 이는 내가 내 칼과 활로 아모리 족속의 손에서 빼앗은 것이니라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425780, lowkey: nil, highkey: nil},
