  {album_id: 49, title: "창세기 36장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "05:37", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 36장 (개역개정) - 05:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 36장\r\n[00:08.40]1. 에서 곧 에돔의 족보는 이러하니라 \r\n[00:11.74]2. 에서가 가나안 여인 중 헷 족속 엘론의 딸 아다와 히위 족속 시브온의 딸인 아나의 딸 오홀리바마를 자기 아내로 맞이하고 \r\n[00:21.33]3. 또 이스마엘의 딸 느바욧의 누이 바스맛을 맞이하였더니 \r\n[00:25.61]4. 아다는 엘리바스를 에서에게 낳았고 바스맛은 르우엘을 낳았고 \r\n[00:30.81]5. 오홀리바마는 여우스와 얄람과 고라를 낳았으니 이들은 에서의 아들들이요 가나안 땅에서 그에게 태어난 자들이더라 \r\n[00:40.15]6. 에서가 자기 아내들과 자기 자녀들과 자기 집의 모든 사람과 자기의 가축과 자기의 모든 짐승과 자기가 가나안 땅에서 모은 모든 재물을 이끌고 그의 동생 야곱을 떠나 다른 곳으로 갔으니 \r\n[00:55.16]7. 두 사람의 소유가 풍부하여 함께 거주할 수 없음이러라 그들이 거주하는 땅이 그들의 가축으로 말미암아 그들을 용납할 수 없었더라 \r\n[01:05.74]8. 이에 에서 곧 에돔이 세일 산에 거주하니라 \r\n[01:10.99]9. 세일 산에 있는 에돔 족속의 조상 에서의 족보는 이러하고 \r\n[01:15.50]10. 그 자손의 이름은 이러하니라 에서의 아내 아다의 아들은 엘리바스요 에서의 아내 바스맛의 아들은 르우엘이며 \r\n[01:24.14]11. 엘리바스의 아들들은 데만과 오말과 스보와 가담과 그나스요 \r\n[01:29.77]12. 에서의 아들 엘리바스의 첩 딤나는 아말렉을 엘리바스에게 낳았으니 이들은 에서의 아내 아다의 자손이며 \r\n[01:37.99]13. 르우엘의 아들들은 나핫과 세라와 삼마와 미사니 이들은 에서의 아내 바스맛의 자손이며 \r\n[01:46.33]14. 시브온의 손녀 아나의 딸 에서의 아내 오홀리바마의 아들들은 이러하니 그가 여우스와 얄람과 고라를 에서에게 낳았더라 \r\n[01:56.59]15. 에서 자손 중 족장은 이러하니라 에서의 장자 엘리바스의 자손으로 데만 족장, 오말 족장, 스보 족장, 그나스 족장과 \r\n[02:08.40]16. 고라 족장, 가담 족장, 아말렉 족장이니 이들은 에돔 땅에 있는 엘리바스의 족장들이요 이들은 아다의 자손이며 \r\n[02:17.83]17. 에서의 아들 르우엘의 자손으로는 나핫 족장, 세라 족장, 삼마 족장, 미사 족장이니 이들은 에돔 땅에 있는 르우엘의 족장들이요 이들은 에서의 아내 바스맛의 자손이며 \r\n[02:31.63]18. 에서의 아내인 오홀리바마의 아들들은 여우스 족장, 얄람 족장, 고라 족장이니 이들은 아나의 딸이요 에서의 아내인 오홀리바마로 말미암아 나온 족장들이라 \r\n[02:44.17]19. 에서 곧 에돔의 자손으로서 족장 된 자들이 이러하였더라 \r\n[02:49.89]20. 그 땅의 주민 호리 족속 세일의 자손은 로단과 소발과 시브온과 아나와 \r\n[02:56.97]21. 디손과 에셀과 디산이니 이들은 에돔 땅에 있는 세일의 자손 중 호리 족속의 족장들이요 \r\n[03:04.41]22. 로단의 자녀는 호리와 헤맘과 로단의 누이 딤나요 \r\n[03:09.59]23. 소발의 자녀는 알완과 마나핫과 에발과 스보와 오남이요 \r\n[03:15.32]24. 시브온의 자녀는 아야와 아나며 이 아나는 그 아버지 시브온의 나귀를 칠 때에 광야에서 온천을 발견하였고 \r\n[03:24.80]25. 아나의 자녀는 디손과 오홀리바마니 오홀리바마는 아나의 딸이며 \r\n[03:31.05]26. 디손의 자녀는 헴단과 에스반과 이드란과 그란이요 \r\n[03:35.81]27. 에셀의 자녀는 빌한과 사아완과 아간이요 \r\n[03:39.97]28. 디산의 자녀는 우스와 아란이니 \r\n[03:42.89]29. 호리 족속의 족장들은 곧 로단 족장, 소발 족장, 시브온 족장, 아나 족장, \r\n[03:49.95]30. 디손 족장, 에셀 족장, 디산 족장이라 이들은 그들의 족속들에 따라 세일 땅에 있는 호리 족속의 족장들이었더라 \r\n[03:59.93]31. 이스라엘 자손을 다스리는 왕이 있기 전에 에돔 땅을 다스리던 왕들은 이러하니라 \r\n[04:06.42]32. 브올의 아들 벨라가 에돔의 왕이 되었으니 그 도성의 이름은 딘하바며 \r\n[04:12.50]33. 벨라가 죽고 보스라 사람 세라의 아들 요밥이 그를 대신하여 왕이 되었고 \r\n[04:18.15]34. 요밥이 죽고 데만 족속의 땅의 후삼이 그를 대신하여 왕이 되었고 \r\n[04:23.55]35. 후삼이 죽고 브닷의 아들 곧 모압 들에서 미디안 족속을 친 하닷이 그를 대신하여 왕이 되었으니 그 도성 이름은 아윗이며 \r\n[04:34.28]36. 하닷이 죽고 마스레가의 삼라가 그를 대신하여 왕이 되었고 \r\n[04:39.60]37. 삼라가 죽고 유브라데 강변 르호봇의 사울이 그를 대신하여 왕이 되었고 \r\n[04:45.75]38. 사울이 죽고 악볼의 아들 바알하난이 그를 대신하여 왕이 되었고 \r\n[04:51.43]39. 악볼의 아들 바알하난이 죽고 하달이 그를 대신하여 왕이 되었으니 그 도성 이름은 바우며 그의 아내의 이름은 므헤다벨이니 마드렛의 딸이요 메사합의 손녀더라 \r\n[05:04.40]40. 에서에게서 나온 족장들의 이름은 그 종족과 거처와 이름을 따라 나누면 이러하니 딤나 족장, 알와 족장, 여뎃 족장, \r\n[05:14.99]41. 오홀리바마 족장, 엘라 족장, 비논 족장, \r\n[05:18.83]42. 그나스 족장, 데만 족장, 밉살 족장, \r\n[05:22.17]43. 막디엘 족장, 이람 족장이라 이들은 그 구역과 거처를 따른 에돔 족장들이며 에돔 족속의 조상은 에서더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425783, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 35장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 35장 (개역개정) - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 35장\r\n[00:09.02]1. 하나님이 야곱에게 이르시되 일어나 벧엘로 올라가서 거기 거주하며 네가 네 형 에서의 낯을 피하여 도망하던 때에 네게 나타났던 하나님께 거기서 제단을 쌓으라 하신지라 \r\n[00:22.13]2. 야곱이 이에 자기 집과 사람과 자기와 함께 한 모든 자에게 이르되 너희 중에 있는 이방 신상들을 버리고 자신을 정결하게 하고 너희들의 의복을 바꾸어 입으라 \r\n[00:34.89]3. 우리가 일어나 벧엘로 올라가자 내 환난 날에 내게 응답하시며 내가 가는 길에서 나와 함께 하신 하나님께 내가 거기서 제단을 쌓으려 하노라 하매 \r\n[00:46.78]4. 그들이 자기 손에 있는 모든 이방 신상들과 자기 귀에 있는 귀고리들을 야곱에게 주는지라 야곱이 그것들을 세겜 근처 상수리 나무 아래에 묻고 \r\n[00:58.52]5. 그들이 떠났으나 하나님이 그 사면 고을들로 크게 두려워하게 하셨으므로 야곱의 아들들을 추격하는 자가 없었더라 \r\n[01:07.41]6. 야곱과 그와 함께 한 모든 사람이 가나안 땅 루스 곧 벧엘에 이르고 \r\n[01:14.24]7. 그가 거기서 제단을 쌓고 그 곳을 엘벧엘이라 불렀으니 이는 그의 형의 낯을 피할 때에 하나님이 거기서 그에게 나타나셨음이더라 \r\n[01:24.47]8. 리브가의 유모 드보라가 죽으매 그를 벧엘 아래에 있는 상수리나무 밑에 장사하고 그 나무 이름을 알론바굿이라 불렀더라 \r\n[01:34.66]9. 야곱이 밧단아람에서 돌아오매 하나님이 다시 야곱에게 나타나사 그에게 복을 주시고 \r\n[01:42.02]10. 하나님이 그에게 이르시되 네 이름이 야곱이지마는 네 이름을 다시는 야곱이라 부르지 않겠고 이스라엘이 네 이름이 되리라 하시고 그가 그의 이름을 이스라엘이라 부르시고 \r\n[01:55.07]11. 하나님이 그에게 이르시되 나는 전능한 하나님이라 생육하며 번성하라 한 백성과 백성들의 총회가 네게서 나오고 왕들이 네 허리에서 나오리라 \r\n[02:07.55]12. 내가 아브라함과 이삭에게 준 땅을 네게 주고 내가 네 후손에게도 그 땅을 주리라 하시고 \r\n[02:14.82]13. 하나님이 그와 말씀하시던 곳에서 그를 떠나 올라가시는지라 \r\n[02:19.51]14. 야곱이 하나님이 자기와 말씀하시던 곳에 기둥 곧 돌기둥을 세우고 그 위에 전제물을 붓고 또 그 위에 기름을 붓고 \r\n[02:30.40]15. 하나님이 자기와 말씀하시던 곳의 이름을 벧엘이라 불렀더라 \r\n[02:35.24]16. 그들이 벧엘에서 길을 떠나 에브랏에 이르기까지 얼마간 거리를 둔 곳에서 라헬이 해산하게 되어 심히 고생하여 \r\n[02:45.01]17. 그가 난산할 즈음에 산파가 그에게 이르되 두려워하지 말라 지금 네가 또 득남하느니라 하매 \r\n[02:53.08]18. 그가 죽게 되어 그의 혼이 떠나려 할 때에 아들의 이름을 베노니라 불렀으나 그의 아버지는 그를 베냐민이라 불렀더라 \r\n[03:02.46]19. 라헬이 죽으매 에브랏 곧 베들레헴 길에 장사되었고 \r\n[03:07.53]20. 야곱이 라헬의 묘에 비를 세웠더니 지금까지 라헬의 묘비라 일컫더라 \r\n[03:13.27]21. 이스라엘이 다시 길을 떠나 에델 망대를 지나 장막을 쳤더라 \r\n[03:19.19]22. 이스라엘이 그 땅에 거주할 때에 르우벤이 가서 그 아버지의 첩 빌하와 동침하매 이스라엘이 이를 들었더라 야곱의 아들은 열둘이라 \r\n[03:30.49]23. 레아의 아들들은 야곱의 장자 르우벤과 그 다음 시므온과 레위와 유다와 잇사갈과 스불론이요 \r\n[03:39.36]24. 라헬의 아들들은 요셉과 베냐민이며 \r\n[03:42.62]25. 라헬의 여종 빌하의 아들들은 단과 납달리요 \r\n[03:46.87]26. 레아의 여종 실바의 아들들은 갓과 아셀이니 이들은 야곱의 아들들이요 밧단아람에서 그에게 낳은 자더라 \r\n[03:55.71]27. 야곱이 기럇아르바의 마므레로가서 그의 아버지 이삭에게 이르렀으니 기럇아르바는 곧 아브라함과 이삭이 거류하던 헤브론이더라 \r\n[04:06.37]28. 이삭의 나이가 백팔십 세라 \r\n[04:09.22]29. 이삭이 나이가 많고 늙어 기운이 다하매 죽어 자기 열조에게로 돌아가니 그의 아들 에서와 야곱이 그를 장사하였더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425784, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 34장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "04:49", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 34장 (개역개정) - 04:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 34장\r\n[00:08.32]1. 레아가 야곱에게 낳은 딸 디나가 그 땅의 딸들을 보러 나갔더니 \r\n[00:13.50]2. 히위 족속 중 하몰의 아들 그 땅의 추장 세겜이 그를 보고 끌어들여 강간하여 욕되게 하고 \r\n[00:20.88]3. 그 마음이 깊이 야곱의 딸 디나에게 연연하며 그 소녀를 사랑하여 그의 마음을 말로 위로하고 \r\n[00:28.45]4. 그의 아버지 하몰에게 청하여 이르되 이 소녀를 내 아내로 얻게 하여 주소서 하였더라 \r\n[00:34.96]5. 야곱이 그 딸 디나를 그가 더럽혔다 함을 들었으나 자기의 아들들이 들에서 목축하므로 그들이 돌아오기까지 잠잠하였고 \r\n[00:44.85]6. 세겜의 아버지 하몰은 야곱에게 말하러 왔으며 \r\n[00:48.78]7. 야곱의 아들들은 들에서 이를 듣고 돌아와서 그들 모두가 근심하고 심히 노하였으니 이는 세겜이 야곱의 딸을 강간하여 이스라엘에게 부끄러운 일 곧 행하지 못할 일을 행하였음이더라 \r\n[01:03.51]8. 하몰이 그들에게 이르되 내 아들 세겜이 마음으로 너희 딸을 연연하여 하니 원하건대 그를 세겜에게 주어 아내로 삼게 하라 \r\n[01:13.63]9. 너희가 우리와 통혼하여 너희 딸을 우리에게 주며 우리 딸을 너희가 데려가고 \r\n[01:19.56]10. 너희가 우리와 함께 거주하되 땅이 너희 앞에 있으니 여기 머물러 매매하며 여기서 기업을 얻으라 하고 \r\n[01:27.32]11. 세겜도 디나의 아버지와 그의 남자 형제들에게 이르되 나로 너희에게 은혜를 입게 하라 너희가 내게 말하는 것은 내가 다 주리니 \r\n[01:37.60]12. 이 소녀만 내게 주어 아내가 되게 하라 아무리 큰 혼수와 예물을 청할지라도 너희가 내게 말한 대로 주리라 \r\n[01:45.58]13. 야곱의 아들들이 세겜과 그의 아버지 하몰에게 속여 대답하였으니 이는 세겜이 그 누이 디나를 더럽혔음이라 \r\n[01:55.14]14. 야곱의 아들들이 그들에게 말하되 우리는 그리하지 못하겠노라 할례 받지 아니한 사람에게 우리 누이를 줄 수 없노니 이는 우리의 수치가 됨이니라 \r\n[02:06.51]15. 그런즉 이같이 하면 너희에게 허락하리라 만일 너희 중 남자가 다 할례를 받고 우리 같이 되면 \r\n[02:14.53]16. 우리 딸을 너희에게 주며 너희 딸을 우리가 데려오며 너희와 함께 거주하여 한 민족이 되려니와 \r\n[02:21.45]17. 너희가 만일 우리 말을 듣지 아니하고 할례를 받지 아니하면 우리는 곧 우리 딸을 데리고 가리라 \r\n[02:28.95]18. 그들의 말을 하몰과 그의 아들 세겜이 좋게 여기므로 \r\n[02:33.83]19. 이 소년이 그 일 행하기를 자체하지 아니하였으니 그가 야곱의 딸을 사랑함이며 그는 그의 아버지 집에서 가장 존귀하였더라 \r\n[02:43.18]20. 하몰과 그의 아들 세겜이 그들의 성읍 문에 이르러 그들의 성읍 사람들에게 말하여 이르되 \r\n[02:50.22]21. 이 사람들은 우리와 친목하고 이 땅은 넓어 그들을 용납할 만하니 그들이 여기서 거주하며 매매하게 하고 우리가 그들의 딸들을 아내로 데려오고 우리 딸들도 그들에게 주자 \r\n[03:03.39]22. 그러나 우리 중의 모든 남자가 그들이 할례를 받음 같이 할례를 받아야 그 사람들이 우리와 함께 거주하여 한 민족 되기를 허락할 것이라 \r\n[03:14.06]23. 그러면 그들의 가축과 재산과 그들의 모든 짐승이 우리의 소유가 되지 않겠느냐 다만 그들의 말대로 하자 그러면 그들이 우리와 함께 거주하리라 \r\n[03:26.39]24. 성문으로 출입하는 모든 자가 하몰과 그의 아들 세겜의 말을 듣고 성문으로 출입하는 그 모든 남자가 할례를 받으니라 \r\n[03:36.42]25. 제삼일에 아직 그들이 아파할 때에 야곱의 두 아들 디나의 오라버니 시므온과 레위가 각기 칼을 가지고 가서 몰래 그 성읍을 기습하여 그 모든 남자를 죽이고 \r\n[03:49.99]26. 칼로 하몰과 그의 아들 세겜을 죽이고 디나를 세겜의 집에서 데려오고 \r\n[03:56.12]27. 야곱의 여러 아들이 그 시체 있는 성읍으로 가서 노략하였으니 이는 그들이 그들의 누이를 더럽힌 까닭이라 \r\n[04:05.91]28. 그들이 양과 소와 나귀와 그 성읍에 있는 것과 들에 있는 것과 \r\n[04:12.11]29. 그들의 모든 재물을 빼앗으며 그들의 자녀와 그들의 아내들을 사로잡고 집 속의 물건을 다 노략한지라 \r\n[04:19.62]30. 야곱이 시므온과 레위에게 이르되 너희가 내게 화를 끼쳐 나로 하여금 이 땅의 주민 곧 가나안 족속과 브리스 족속에게 악취를 내게 하였도다 나는 수가 적은즉 그들이 모여 나를 치고 나를 죽이리니 그러면 나와 내 집이 멸망하리라 \r\n[04:39.50]31. 그들이 이르되 그가 우리 누이를 창녀 같이 대우함이 옳으니이까</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425785, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 33장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:03", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 33장 (개역개정) - 03:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 33장\r\n[00:09.00]1. 야곱이 눈을 들어보니 에서가 사백 명의 장정을 거느리고 오고 있는지라 그의 자식들을 나누어 레아와 라헬과 두 여종에게 맡기고 \r\n[00:18.70]2. 여종들과 그들의 자식들은 앞에 두고 레아와 그의 자식들은 다음에 두고 라헬과 요셉은 뒤에 두고 \r\n[00:26.80]3. 자기는 그들 앞에서 나아가되 몸을 일곱 번 땅에 굽히며 그의 형 에서에게 가까이 가니 \r\n[00:33.32]4. 에서가 달려와서 그를 맞이하여 안고 목을 어긋맞추어 그와 입맞추고 서로 우니라 \r\n[00:40.17]5. 에서가 눈을 들어 여인들과 자식들을 보고 묻되 너와 함께 한 이들은 누구냐 야곱이 이르되 하나님이 주의 종에게 은혜로 주신 자식들이니이다. \r\n[00:51.93]6. 그 때에 여종들이 그의 자식들과 더불어 나아와 절하고 \r\n[00:57.14]7. 레아도 그의 자식들과 더불어 나아와 절하고 그 후에 요셉이 라헬과 더불어 나아와 절하니 \r\n[01:04.05]8. 에서가 또 이르되 내가 만난 바 이 모든 떼는 무슨 까닭이냐 야곱이 이르되 내 주께 은혜를 입으려 함이니이다 \r\n[01:13.60]9. 에서가 이르되 내 동생아 내게 있는 것이 족하니 네 소유는 네게 두라 \r\n[01:19.88]10. 야곱이 이르되 그렇지 아니하니이다 내가 형님의 눈앞에서 은혜를 입었사오면 청하건대 내 손에서 이 예물을 받으소서 내가 형님의 얼굴을 뵈온즉 하나님의 얼굴을 본 것 같사오며 형님도 나를 기뻐하심이니이다 \r\n[01:36.93]11. 하나님이 내게 은혜를 베푸셨고 내 소유도 족하오니 청하건대 내가 형님께 드리는 예물을 받으소서 하고 그에게 강권하매 받으니라 \r\n[01:47.88]12. 에서가 이르되 우리가 떠나자 내가 너와 동행하리라 \r\n[01:53.12]13. 야곱이 그에게 이르되 내 주도 아시거니와 자식들은 연약하고 내게 있는 양 떼와 소가 새끼를 데리고 있은즉 하루만 지나치게 몰면 모든 떼가 죽으리니 \r\n[02:05.08]14. 청하건대 내 주는 종보다 앞서 가소서 나는 앞에 가는 가축과 자식들의 걸음대로 천천히 인도하여 세일로 가서 내 주께 나아가리이다 \r\n[02:16.58]15. 에서가 이르되 내가 내 종 몇 사람을 네게 머물게 하리라 야곱이 이르되 어찌하여 그리하리이까 나로 내 주께 은혜를 얻게 하소서 하매 \r\n[02:27.91]16. 이 날에 에서는 세일로 돌아가고 \r\n[02:31.12]17. 야곱은 숙곳에 이르러 자기를 위하여 집을 짓고 그의 가축을 위하여 우릿간을 지었으므로 그 땅 이름을 숙곳이라 부르더라 \r\n[02:40.32]18. 야곱이 밧단아람에서부터 평안히 가나안 땅 세겜 성읍에 이르러 그 성읍 앞에 장막을 치고 \r\n[02:48.27]19. 그가 장막을 친 밭을 세겜의 아버지 하몰의 아들들의 손에서 백 크시타에 샀으며 \r\n[02:55.09]20. 거기에 제단을 쌓고 그 이름을 엘엘로헤이스라엘이라 불렀더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425786, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 32장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "05:07", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 32장 (개역개정) - 05:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 32장\r\n[00:07.78]1. 야곱이 길을 가는데 하나님의 사자들이 그를 만난지라 \r\n[00:12.58]2. 야곱이 그들을 볼 때에 이르기를 이는 하나님의 군대라 하고 그 땅 이름을 마하나임이라 하였더라 \r\n[00:19.88]3. 야곱이 세일 땅 에돔 들에 있는 형 에서에게로 자기보다 앞서 사자들을 보내며 \r\n[00:26.56]4. 그들에게 명령하여 이르되 너희는 내 주 에서에게 이같이 말하라 주의 종 야곱이 이같이 말하기를 내가 라반과 함께 거류하며 지금까지 머물러 있었사오며 \r\n[00:38.85]5. 내게 소와 나귀와 양 떼와 노비가 있으므로 사람을 보내어 내 주께 알리고 내 주께 은혜 받기를 원하나이다 하라 하였더니 \r\n[00:48.89]6. 사자들이 야곱에게 돌아와 이르되 우리가 주인의 형 에서에게 이른즉 그가 사백 명을 거느리고 주인을 만나려고 오더이다 \r\n[00:58.09]7. 야곱이 심히 두렵고 답답하여 자기와 함께 한 동행자와 양과 소와 낙타를 두 떼로 나누고 \r\n[01:06.01]8. 이르되 에서가 와서 한 떼를 치면 남은 한 떼는 피하리라 하고 \r\n[01:10.65]9. 야곱이 또 이르되 내 조부 아브라함의 하나님, 내 아버지 이삭의 하나님 여호와여 주께서 전에 내게 명하시기를 네 고향, 네 족속에게로 돌아가라 내가 네게 은혜를 베풀리라 하셨나이다 \r\n[01:26.02]10. 나는 주께서 주의 종에게 베푸신 모든 은총과 모든 진실하심을 조금도 감당할 수 없사오나 내가 내 지팡이만 가지고 이 요단을 건넜더니 지금은 두 떼나 이루었나이이다 \r\n[01:40.31]11. 내가 주께 간구하오니 내 형의 손에서, 에서의 손에서 나를 건져내시옵소서 내가 그를 두려워함은 그가 와서 나와 내 처자들을 칠까 겁이 나기 때문이니이다 \r\n[01:53.58]12. 주께서 말씀하시기를 내가 반드시 네게 은혜를 베풀어 네 씨로 바다의 셀 수 없는 모래와 같이 많게 하리라 하셨나이다 \r\n[02:03.58]13. 야곱이 거기서 밤을 지내고 그 소유 중에서 형 에서를 위하여 예물을 택하니 \r\n[02:10.97]14. 암염소가 이백이요 숫염소가 이십이요 암양이 이백이요 숫양이 이십이요 \r\n[02:17.93]15. 젖 나는 낙타 삼십과 그 새끼요 암소가 사십이요 황소가 열이요 암나귀가 이십이요 그 새끼 나귀가 열이라 \r\n[02:27.98]16. 그것을 각각 떼로 나누어 종들의 손에 맡기고 그의 종에게 이르되 나보다 앞서 건너가서 각 떼로 거리를 두게 하라 하고 \r\n[02:38.30]17. 그가 또 앞선 자에게 명령하여 이르되 내 형 에서가 너를 만나 묻기를 네가 누구의 사람이며 어디로 가느냐 네 앞의 것은 누구의 것이냐 하거든 \r\n[02:49.65]18. 대답하기를 주의 종 야곱의 것이요 자기 주 에서에게로 보내는 예물이오며 야곱도 우리 뒤에 있나이다 하라 하고 \r\n[02:58.57]19. 그 둘째와 셋째와 각 떼를 따라가는 자에게 명령하여 이르되 너희도 에서를 만나거든 곧 이같이 그에게 말하고 \r\n[03:07.63]20. 또 너희는 말하기를 주의 종 야곱이 우리 뒤에 있다 하라 하니 이는 야곱이 말하기를 내가 내 앞에 보내는 예물로 형의 감정을 푼 후에 대면하면 형이 혹시 나를 받아 주리라 함이었더라 \r\n[03:22.83]21. 그 예물은 그에 앞서 보내고 그는 무리 가운데서 밤을 지내다가 \r\n[03:28.95]22. 밤에 일어나 두 아내와 두 여종과 열한 아들을 인도하여 얍복 나루를 건널새 \r\n[03:35.32]23. 그들을 인도하여 시내를 건너가게 하며 그의 소유도 건너가게 하고 \r\n[03:40.19]24. 야곱은 홀로 남았더니 어떤 사람이 날이 새도록 야곱과 씨름하다가 \r\n[03:45.94]25. 자기가 야곱을 이기지 못함을 보고 그가 야곱의 허벅지 관절을 치매 야곱의 허벅지 관절이 그 사람과 씨름할 때에 어긋났더라 \r\n[03:55.63]26. 그가 이르되 날이 새려하니 나로 가게 하라 야곱이 이르되 당신이 내게 축복하지 아니하면 가게 하지 아니하겠나이다 \r\n[04:05.55]27. 그 사람이 그에게 이르되 네 이름이 무엇이냐 그가 이르되 야곱이니이다 \r\n[04:13.06]28. 그가 이르되 네 이름을 다시는 야곱이라 부를 것이 아니요 이스라엘이라 부를 것이니 이는 네가 하나님과 및 사람들과 겨루어 이겼음이니라 \r\n[04:24.08]29. 야곱이 청하여 이르되 당신의 이름을 알려주소서 그 사람이 이르되 어찌하여 내 이름을 묻느냐 하고 거기서 야곱에게 축복한지라 \r\n[04:34.99]30. 그러므로 야곱이 그 곳 이름을 브니엘이라 하였으니 그가 이르기를 내가 하나님과 대면하여 보았으나 내 생명이 보전되었다 함이더라 \r\n[04:45.33]31. 그가 브니엘을 지날 때에 해가 돋았고 그의 허벅다리로 말미암아 절었더라 \r\n[04:51.59]32. 그 사람이 야곱의 허벅지 관절에 있는 둔부의 힘줄을 쳤으므로 이스라엘 사람들이 지금까지 허벅지 관절에 있는 둔부의 힘줄을 먹지 아니하더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425787, lowkey: nil, highkey: nil},
  {album_id: 49, title: "창세기 31장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "09:08", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 31장 (개역개정) - 09:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 31장\r\n[00:08.30]1. 야곱이 라반의 아들들이 하는 말을 들은즉 야곱이 우리 아버지의 소유를 다 빼앗고 우리 아버지의 소유로 말미암아 이 모든 재물을 모았다 하는지라 \r\n[00:18.41]2. 야곱이 라반의 안색을 본즉 자기에게 대하여 전과 같지 아니하더라 \r\n[00:23.85]3. 여호와께서 야곱에게 이르시되 네 조상의 땅 네 족속에게로 돌아가라 내가 너와 함께 있으리라 하신지라 \r\n[00:33.01]4. 야곱이 사람을 보내어 라헬과 레아를 자기 양 떼가 있는 들로 불러다가 \r\n[00:39.02]5. 그들에게 이르되 내가 그대들의 아버지의 안색을 본즉 내게 대하여 전과 같지 아니하도다 그러할 지라도 내 아버지의 하나님은 나와 함께 계셨느니라 \r\n[00:50.39]6. 그대들도 알거니와 내가 힘을 다하여 그대들의 아버지를 섬겼거늘 \r\n[00:56.00]7. 그대들의 아버지가 나를 속여 품삯을 열 번이나 변경하였느니라 그러나 하나님이 그를 막으사 나를 해치지 못하게 하셨으며 \r\n[01:06.12]8. 그가 이르기를 점 있는 것이 네 삯이 되리라 하면 온 양 떼가 낳은 것이 점 있는 것이요 또 얼룩무늬 있는 것이 네 삯이 되리라 하면 온 양 떼가 낳은 것이 얼룩무늬 있는 것이니 \r\n[01:19.84]9. 하나님이 이같이 그대들의 아버지의 가축을 빼앗아 내게 주셨느니라 \r\n[01:25.17]10. 그 양 떼가 새끼 밸 때에 내가 꿈에 눈을 들어보니 양 떼를 탄 숫양은 다 얼룩무늬 있는 것과 점 있는 것과 아롱진 것이었더라 \r\n[01:35.77]11. 꿈에 하나님의 사자가 내게 말씀하시기를 야곱아 하기로 내가 대답하기를 여기 있나이다 하매 \r\n[01:43.52]12. 이르시되 네 눈을 들어 보라 양 떼를 탄 숫양은 다 얼룩무늬 있는 것, 점 있는 것과 아롱진 것이니라 라반이 네게 행한 모든 것을 내가 보았노라 \r\n[01:56.06]13. 나는 벧엘의 하나님이라 네가 거기서 기둥에 기름을 붓고 거기서 내게 서원하였으니 지금 일어나 이 곳을 떠나서 네 출생지로 돌아가라 하셨느니라 \r\n[02:09.05]14. 라헬과 레아가 그에게 대답하여 이르되 우리가 우리 아버지 집에서 무슨 분깃이나 유산이 있으리요 \r\n[02:16.35]15. 아버지가 우리를 팔고 우리의 돈을 다 먹어버렸으니 아버지가 우리를 외국인처럼 여기는 것이 아닌가 \r\n[02:24.17]16. 하나님이 우리 아버지에게서 취하여 가신 재물은 우리와 우리 자식의 것이니 이제 하나님이 당신에게 이르신 일을 다 준행하라 \r\n[02:34.07]17. 야곱이 일어나 자식들과 아내들을 낙타들에게 태우고 \r\n[02:38.68]18. 그 모은 바 모든 가축과 모든 소유물 곧 그가 밧단아람에서 모은 가축을 이끌고 가나안 땅에 있는 그의 아버지 이삭에게로 가려 할새 \r\n[02:49.43]19. 그 때에 라반이 양털을 깎으러 갔으므로 라헬은 그의 아버지의 드라빔을 도둑질하고 \r\n[02:56.14]20. 야곱은 그 거취를 아람 사람 라반에게 말하지 아니하고 가만히 떠났더라 \r\n[03:02.52]21. 그가 그의 모든 소유를 이끌고 강을 건너 길르앗 산을 향하여 도망한 지 \r\n[03:08.48]22. 삼 일 만에 야곱이 도망한 것이 라반에게 들린지라 \r\n[03:12.10]23. 라반이 그의 형제를 거느리고 칠 일 길을 쫓아가 길르앗 산에서 그에게 이르렀더니 \r\n[03:19.72]24. 밤에 하나님이 아람 사람 라반에게 현몽하여 이르시되 너는 삼가 야곱에게 선악간에 말하지 말라 하셨더라 \r\n[03:28.39]25. 라반이 야곱을 뒤쫓아 이르렀으니 야