  {album_id: 49, title: "창세기 9장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 9장 (개역개정) - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 9장\r\n[00:06.91]01.하나님이 노아와 그 아들들에게 복을 주시며 그들에게 이르시되 생육하고 번성하여 땅에 충만하라 \r\n[00:14.61]02.땅의 모든 짐승과 공중의 모든 새와 땅에 기는 모든 것과 바다의 모든 물고기가 너희를 두려워하며 너희를 무서워하리니 이것들은 너희의 손에 붙였음이니라 \r\n[00:27.45]03.모든 산 동물은 너희의 먹을 것이 될지라 채소 같이 내가 이것을 다 너희에게 주노라 \r\n[00:35.73]04.그러나 고기를 그 생명 되는 피째 먹지 말 것이니라 \r\n[00:40.81]05.내가 반드시 너희의 피 곧 너희의 생명의 피를 찾으리니 짐승이면 그 짐승에게서, 사람이나 사람의 형제면 그에게서 그의 생명을 찾으리라 \r\n[00:53.18]06.다른 사람의 피를 흘리면 그 사람의 피도 흘릴 것이니 이는 하나님이 자기 형상대로 사람을 지으셨음이니라 \r\n[01:01.91]07.너희는 생육하고 번성하며 땅에 가득하여 그 중에서 번성하라 하셨더라 \r\n[01:08.97]08.하나님이 노아와 그와 함께 한 아들들에게 말씀하여 이르시되 \r\n[01:14.31]09.내가 내 언약을 너희와 너희 후손과 \r\n[01:17.55]10.너희와 함께 한 모든 생물 곧 너희와 함께 한 새와 가축과 땅의 모든 생물에게 세우리니 방주에서 나온 모든 것 곧 땅의 모든 짐승에게니라 \r\n[01:29.55]11.내가 너희와 언약을 세우리니 다시는 모든 생물을 홍수로 멸하지 아니할 것이라 땅을 멸한 홍수가 다시 있지 아니 하리라 \r\n[01:39.77]12.하나님이 이르시되 내가 나와 너희와 및 너희와 함께 하는 모든 생물 사이에 대대로 영원히 세우는 언약의 증거는 이것이니라 \r\n[01:50.04]13.내가 내 무지개를 구름 속에 두었나니 이것이 나와 세상 사이의 언약의 증거니라 \r\n[01:56.82]14.내가 구름으로 땅을 덮을 때에 무지개가 구름 속에 나타나면 \r\n[02:01.54]15.내가 나와 너희와 및 육체를 가진 모든 생물 사이의 내 언약을 기억하리니 다시는 물이 모든 육체를 멸하는 홍수가 되지 아니할지라 \r\n[02:12.13]16.무지개가 구름 사이에 있으리니 내가 보고 나 하나님과 모든 육체를 가진 땅의 모든 생물 사이의 영원한 언약을 기억하리라 \r\n[02:22.55]17.하나님이 노아에게 또 이르시되 내가 나와 땅에 있는 모든 생물 사이에 세운 언약의 증거가 이것이라 하셨더라 \r\n[02:31.72]18.방주에서 나온 노아의 아들들은 셈과 함과 야벳이며 함은 가나안의 아버지라 \r\n[02:38.76]19.노아의 이 세 아들로부터 사람들이 온 땅에 퍼지니라 \r\n[02:43.88]20.노아가 농사를 시작하여 포도나무를 심었더니 \r\n[02:48.02]21.포도주를 마시고 취하여 그 장막 안에서 벌거벗은지라 \r\n[02:52.17]22.가나안의 아버지 함이 그의 아버지의 하체를 보고 밖으로 나가서 그의 두 형제에게 알리매 \r\n[02:59.22]23.셈과 야벳이 옷을 가져다가 자기들의 어깨에 메고 뒷걸음쳐 들어가서 그들의 아버지의 하체를 덮었으며 그들이 얼굴을 돌이키고 그들의 아버지의 하체를 보지 아니하였더라 \r\n[03:12.57]24.노아가 술이 깨어 그의 작은아들이 자기에게 행한 일을 알고 \r\n[03:17.78]25.이에 이르되 가나안은 저주를 받아 그의 형제의 종들의 종이 되기를 원하노라 하고 \r\n[03:24.19]26.또 이르되 셈의 하나님 여호와를 찬송하리로다 가나안은 셈의 종이 되고 \r\n[03:30.52]27.하나님이 야벳을 창대하게 하사 셈의 장막에 거하게 하시고 가나안은 그의 