  {album_id: 49, title: "창세기 7장 (개역개정)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:01", lyrics: "\n\t\t\t\t\t\t\t<div>창세기 7장 (개역개정) - 03:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">[00:00.00]창세기 7장\r\n[00:07.58]01.여호와께서 노아에게 이르시되 너와 네 온 집은 방주로 들어가라 이 세대에서 네가 내 앞에 의로움을 내가 보았음이니라 \r\n[00:17.15]02.너는 모든 정결한 짐승은 암수 일곱씩, 부정한 것은 암수 둘씩을 네게로 데려오며 \r\n[00:24.95]03.공중의 새도 암수 일곱씩을 데려와 그 씨를 온 지면에 유전하게 하라 \r\n[00:30.83]04.지금부터 칠 일이면 내가 사십 주야를 땅에 비를 내려 내가 지은 모든 생물을 지면에서 쓸어버리리라 \r\n[00:39.28]05.노아가 여호와께서 자기에게 명하신 대로 다 준행하였더라 \r\n[00:44.52]06.홍수가 땅에 있을 때에 노아가 육백 세라 \r\n[00:48.79]07.노아는 아들들과 아내와 며느리들과 함께 홍수를 피하여 방주에 들어갔고 \r\n[00:55.28]08.정결한 짐승과 부정한 짐승과 새와 땅에 기는 모든 것은 \r\n[01:00.69]09.하나님이 노아에게 명하신 대로 암수 둘씩 노아에게 나아와 방주로 들어갔으며 \r\n[01:06.67]10.칠 일 후에 홍수가 땅에 덮이니 \r\n[01:09.94]11.노아가 육백 세 되던 해 둘째 달 곧 그 달 열이렛날이라 그 날에 큰 깊음의 샘들이 터지며 하늘의 창문들이 열려 \r\n[01:20.33]12.사십 주야를 비가 땅에 쏟아졌더라 \r\n[01:23.30]13.곧 그 날에 노아와 그의 아들 셈, 함, 야벳과 노아의 아내와 세 며느리가 다 방주로 들어갔고 \r\n[01:32.46]14.그들과 모든 들짐승이 그 종류대로, 모든 가축이 그 종류대로, 땅에 기는 모든 것이 그 종류대로, 모든 새가 그 종류대로 \r\n[01:43.02]15.무릇 생명의 기운이 있는 육체가 둘씩 노아에게 나아와 방주로 들어갔으니 \r\n[01:49.05]16.들어간 것들은 모든 것의 암수라 하나님이 그에게 명하신 대로 들어가매 여호와께서 그를 들여보내고 문을 닫으시니라 \r\n[01:58.60]17.홍수가 땅에 사십 일 동안 계속된지라 물이 많아져 방주가 땅에서 떠올랐고 \r\n[02:06.20]18.물이 더 많아져 땅에 넘치매 방주가 물 위에 떠 다녔으며 \r\n[02:11.20]19.물이 땅에 더욱 넘치매 천하의 높은 산이 다 잠겼더니 \r\n[02:16.21]20.물이 불어서 십오 규빗이나 오르니 산들이 잠긴지라 \r\n[02:20.54]21.땅 위에 움직이는 생물이 다 죽었으니 곧 새와 가축과 들짐승과 땅에 기는 모든 것과 모든 사람이라 \r\n[02:30.71]22.육지에 있어 그 코에 생명의 기운의 숨이 있는 것은 다 죽었더라 \r\n[02:36.67]23.지면의 모든 생물을 쓸어버리시니 곧 사람과 가축과 기는 것과 공중의 새까지라 이들은 땅에서 쓸어버림을 당하였으되 오직 노아와 그와 함께 방주에 있던 자들만 남았더라 \r\n[02:52.68]24.물이 백오십 일을 땅에 넘쳤더라</p> \n\t\t\t\t\t\t", artist_num: 80261645, album_num: 80416948, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/948/80416948_1396852524497_1_600x600.JPG", song_tjnum: nil, song_num: 82425791, lowkey: nil, highkey: nil},
