  {album_id: 51, title: "How You Doing? (Inst.)", ganre1: "가요", ganre2: "랩/힙합", runtime: "03:46", lyrics: "\n\t\t\t\t\t\t\t<div>How You Doing? (Inst.) - 03:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 14950747, album_num: 80416950, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/950/747/14950747_6_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/950/80416950_1396604192539_1_600x600.JPG", song_tjnum: nil, song_num: 82425810, lowkey: nil, highkey: nil},
  {album_id: 51, title: "How You Doing? (Code Kunst Remix)", ganre1: "가요", ganre2: "랩/힙합", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>How You Doing? (Code Kunst Remix) - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 14950747, album_num: 80416950, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/950/747/14950747_6_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/950/80416950_1396604192539_1_600x600.JPG", song_tjnum: nil, song_num: 82425811, lowkey: nil, highkey: nil},
  {album_id: 51, title: "How You Doing?", ganre1: "가요", ganre2: "랩/힙합", runtime: "03:46", lyrics: "\n\t\t\t\t\t\t\t<div>How You Doing? - 03:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Hook)\r\nMy life.i'm doing it right.\r\nfuck ya'll 나 뿐이니까.\r\n내겐 현실인게 네겐 꿈이니까.\r\n신경끄고 살어 \r\ni'm jus doing it right.\r\nHow you doing? How you doing? \r\nHow you doing? (Huh)\r\nHow you doing? How you doing? \r\nHow you doing? (Huh)\r\n\r\nVerse1)\r\nMy rap money. 날 마다 늘어.\r\n나는 나름데로 잘 살아.\r\nBMW, Benz 따윈 없어도 \r\n주어진것에 감사하지. \r\n나는 날 알어 주제 아는 놈. \r\n뛰는 놈 위 나는 나는 \r\n놈이 되보려고 \r\n자존심 파는놈이 되긴싫어 \r\n내 멋에 사는놈.\r\n결국 인정받음 되는거야 \r\n내 방식대로.\r\n돈이 되고 안되고는 음악성, \r\n그 다음 문제여.\r\n이 바닥에 14년 차. \r\n불가능하단길을 가는자. \r\n뭐, 시간은 공평해. no rolex\r\n난 즐길테니 넌 노동해.\r\n\r\nBridge)\r\n어떻게 지내? man it \r\nain't no hard tell.\r\nI made it from the hell.\r\nwell, I ain't going back. \r\n(굳이 말하자면) \r\n\r\nHook)\r\n\r\nVerse2)\r\nI love my life. \r\n벌써 과건 잊고 앞의 것만봐.\r\n시간이 약인 건가봐 한때 \r\n내가 느꼈던 절망감.\r\n무뎌진지 오래. 이혼 내가 했던 \r\n선택중에 가장 용기가 필요했던일. \r\n나는 잘못없어 절대.\r\n너희가 뭐라 생각하던지, \r\n날 뭐라 부르던지.\r\n상관없지 난 내길을 걸어 fuck it.\r\ni don't care about ya'll\r\n내 아들은 잘살아. \r\n엄마없이도 잘 자라.\r\n동정의 눈빛은 필요없어. \r\n내삶은 누구에겐 딴따라. \r\n반대로 누구에겐 음악가란. \r\n삶을 살아가는 남자.\r\n돈보다는 내가 하고싶은걸 해도 \r\n이렇게 살아감을 감사.\r\nMan I'm better than \r\nI've ever been. \r\n난 될놈! 주문을 외우곤해.\r\n그러면 내  미랜 곧 Peter Pan. \r\nForever Young. \r\nNeverland. Never End.\r\n\r\nBridge)\r\n\r\nHook)</p> \n\t\t\t\t\t\t", artist_num: 14950747, album_num: 80416950, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/950/747/14950747_6_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/950/80416950_1396604192539_1_600x600.JPG", song_tjnum: nil, song_num: 82425812, lowkey: nil, highkey: nil},
