  {album_id: 52, title: "Beethoven : Piano Sonata No. 7 In D Major, Op. 103 - 3. Menuettoo Allegro (베토벤 : 피아노 소나타 7번 D장조 Op.103 - 3악장 미뉴에트 알레그로)", ganre1: "클래식", ganre2: "독주곡", runtime: "02:51", lyrics: "\n\t\t\t\t\t\t\t<div>Beethoven : Piano Sonata No. 7 In D Major, Op. 103 - 3. Menuettoo Allegro (베토벤 : 피아노 소나타 7번 D장조 Op.103 - 3악장 미뉴에트 알레그로) - 02:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80261648, album_num: 80416952, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/952/80416952_1396852229622_1_600x600.JPG", song_tjnum: nil, song_num: 82425917, lowkey: nil, highkey: nil},
  {album_id: 53, title: "Rain", ganre1: "가요", ganre2: "인디", runtime: "03:40", lyrics: "\n\t\t\t\t\t\t\t<div>Rain - 03:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">rain~ 왜 이런지 몰랐지 \r\nrain~ 멈출 수도 없는데 \r\n오늘도 여전히 비에 젖어 든\r\n마음속에 너를 부른다\r\n곧 이 비가 멈추면 너를\r\n다시 비워낼 수가 있을까 \r\n\r\n너에게 가고 싶어 내 맘은\r\n너에게 닿고 싶어 비처럼 \r\nI just can't stop\r\nmy love for darling \r\nI just can't stop\r\nmy love for darling \r\n\r\nmy love 더 아픈 사랑이 내려 \r\n\r\nrain~ 오늘따라 이 비는\r\nrain~ 소리마저 서글퍼 \r\n아마도 나처럼 지난날들을\r\n놓지 못해 울고 있는지\r\n더 시간이 흐른 뒤 우린\r\n다시 웃음지을 수 있을까</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425918, lowkey: nil, highkey: nil},
  {album_id: 53, title: "Sweet Child O'Mine", ganre1: "가요", ganre2: "인디", runtime: "04:39", lyrics: "\n\t\t\t\t\t\t\t<div>Sweet Child O'Mine - 04:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">She's got a smile that\r\nit seems to me Reminds\r\nme of childhood memories\r\nWhere everything Was as\r\nfresh as the bright blue sky\r\nNow and then when\r\nI see her face She takes me\r\naway to that\r\nspecial place And\r\nif I'd stare too long\r\nI'd probably break\r\ndown and cry\r\n\r\nwoah oh oh Sweet child\r\no' mine woah oh oh oh\r\nSweet love of mine\r\n\r\nShe's got eyes of the\r\nbluest skies As if they\r\nthought of rain\r\nI hate to look into those\r\neyes And see an ounce of\r\npain Her hair reminds me\r\nof a warm safe place Where\r\nas a child I'd hide And\r\npray for the thunder\r\nAnd the rain To quietly\r\npass me by\r\n\r\nwoah oh oh Sweet child\r\no' mine woah oh oh oh\r\nSweet love of mine </p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425919, lowkey: nil, highkey: nil},
  {album_id: 53, title: "햇살", ganre1: "가요", ganre2: "인디", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>햇살 - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">햇살에 눈뜰 때\r\n네가 없음을 느끼고\r\n애꿎은 커튼에\r\n화풀이를 해본다 \r\n너없는 아침이\r\n이젠 제법 익숙해 \r\n기지개도 켜보고\r\n아침도 먹게 된다 \r\n\r\n하지만 말야\r\n가끔은 서글퍼지기도 해 \r\n그토록 내게 잘해주던 너인데\r\n솔직히 말야\r\n가끔은 미안해지기도 해\r\n그런 너에게 모질게 굴었던게\r\n\r\n햇살에 눈뜰 때\r\n네가 없음을 느끼고 \r\n애꿎은 커튼에\r\n화풀이를 해본다 </p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425920, lowkey: nil, highkey: nil},
  {album_id: 53, title: "4月 30日", ganre1: "가요", ganre2: "인디", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>4月 30日 - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잊을 수 없어요\r\n어느 따스한 오후 \r\n그대 내 맘에 들어 온 순간 \r\n\r\n아무도 모르죠 소중하게 간직한 \r\n이런 내 마음 얘기하고파 \r\n\r\n햇살이 내려온 은빛 물결처럼 \r\n아름다운 그대 미소만으로도\r\n난 행복하죠\r\n\r\n잊을 수 없어요\r\n어느 따스한 오후 \r\n그대 내 맘에 들어온 순간 \r\n\r\n아무도 모르죠 소중하게 간직한 \r\n이런 내 마음 얘기하고파</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425921, lowkey: nil, highkey: nil},
  {album_id: 53, title: "외로움이 서툴러", ganre1: "가요", ganre2: "인디", runtime: "04:02", lyrics: "\n\t\t\t\t\t\t\t<div>외로움이 서툴러 - 04:02</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">외로움이 서툴러 나 오늘 아침도\r\n너로 시작하나 봐 모든 게 서툴러 \r\n너 떠나가던 날 그 뒷모습마저\r\n나 너무 그리워 바보처럼 눈물이 \r\n\r\n잠들기 전 듣던 자장노래도\r\n처음 고백하던 따뜻한 말도\r\n적어도 거짓이 아니라 믿고 싶어\r\n그래야 나 견딜 것 같아\r\n\r\n나는 아직도 네가 내일 아침이면\r\n무슨 일이 있었냐는 듯이\r\n돌아올 것만 같은데 \r\n\r\n잠들기 전 듣던 자장노래도\r\n처음 고백하던 따뜻한 말도\r\n적어도 거짓이 아니라 믿고 싶어\r\n그래야 나 견딜 것 같아\r\n\r\n나는 아직도 네가 내일 아침이면 \r\n무슨 일이 있었냐는 듯이\r\n돌아올 것만 같은데 \r\n너도 가끔은 내가 생각이 나는지 \r\n그렇다고 나는 믿고 싶어\r\n너도 나와 같은 맘이라</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425922, lowkey: nil, highkey: nil},
  {album_id: 53, title: "Qui A Tue Grand Maman", ganre1: "가요", ganre2: "인디", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>Qui A Tue Grand Maman - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Il y avait du temps\r\nde grand-maman\r\nDes fleurs qui poussaient\r\ndans son jardin\r\nLe temps a passe, seules\r\nrestent les pensees\r\nEt dans tes mains il ne\r\nreste plus rien\r\n\r\nQui a tue grand-maman,\r\nest-c' le temps\r\nOu les hommes qui\r\nn'ont plus l'temps\r\nD' passer le temps?\r\nLa la la la la,\r\nla la la la\r\nLa la la, la la la,\r\nla la la \r\n\r\nIl y avait du temps\r\nde grand-maman\r\nDu silence a ecouter\r\nDes branches sur\r\nles arbres, \r\nDes feuilles sur\r\nles branches\r\nDes oiseaux sur\r\nles feuilles \r\nEt qui chantaient\r\n\r\nQui a tue grand-maman,\r\nest-c' le temps\r\nOu les hommes qui\r\nn'ont plus l'temps\r\nD' passer le temps?\r\nLa la la la la,\r\nla la la la\r\nLa la la, la la la,\r\nla la la \r\n\r\nLe bulldozer a tue grand-maman\r\nEt change ses fleurs\r\nen marteaux-piqueurs\r\nLes oiseaux pour chanter \r\nNe trouv' que des chantiers\r\nEst-ce pour cela que\r\nl'on te pleure?\r\n\r\nQui a tue grand-maman,\r\nest-c' le temps\r\nOu les hommes qui\r\nn'ont plus l'temps\r\nD' passer le temps?\r\nLa la la la la, la la la\r\nLa la, la la la, la la la \r\n\r\nQui a tue grand-maman,\r\nest-c' le temps\r\nOu les hommes qui\r\nn'ont plus l'temps\r\nD' passer le temps?\r\nLa la la la la, la la la la\r\nLa la la, la la la, la la la</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425923, lowkey: nil, highkey: nil},
  {album_id: 53, title: "I Love You", ganre1: "가요", ganre2: "인디", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>I Love You - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I love you I will cherish \r\nthis moment with you\r\nover and over again \r\n\r\nwe can't deny the love\r\nthat we shared \r\nI love you I love you \r\nso with all of my heart \r\n\r\nI just want to say to you \r\nI'll say you're \r\nthe only one \r\n\r\nwoo~ \r\n\r\nyou don't have to\r\nsay your love \r\nI can't feel your heart\r\n\r\nwoo~</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425924, lowkey: nil, highkey: nil},
  {album_id: 53, title: "Lalala", ganre1: "가요", ganre2: "인디", runtime: "03:08", lyrics: "\n\t\t\t\t\t\t\t<div>Lalala - 03:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">lalala lalala\r\nlalalala lalala\r\nlalala lalala\r\nlalalala lalala \r\n\r\n그렇게도 힘들었던 기억이 \r\n모두다 지난일인 걸\r\n의미가 없잖아 \r\n수많은 시련에\r\n닫혀버린 너의 맘\r\n널 다시 찾을 수 있는\r\n시간이 필요해 \r\n\r\nlalala lalala\r\nlalalala lalala\r\nlalala lalala\r\nlalalala lalala \r\n\r\n언제라도 쉬어갈 수 있도록 \r\n너에게 힘이 되 줄게\r\n소중한 너에게 \r\n세상에 무엇도\r\n대신할 수 없는걸\r\n새로운 시작을 위한\r\n용기가 필요해 \r\n\r\nlalala lalala\r\nlalalala lalala\r\nlalala lalala\r\nlalalala lalala \r\n\r\nlalala lalala\r\nlalalala lalala\r\nlalala lalala\r\nlalalala lalala </p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425925, lowkey: nil, highkey: nil},
  {album_id: 53, title: "Hello Mr.Monkey", ganre1: "가요", ganre2: "인디", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>Hello Mr.Monkey - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">once he was so famous\r\nthat little old clown\r\neverybody used to\r\nknow his name\r\nnow he's a nameless\r\nbut happy old guy \r\nthe children laugh\r\nif only he goes by\r\n\r\nhello hello mr.\r\nmonkey you're still\r\nso fast and funky\r\nhello hello mr.\r\nmonkey you should\r\nhave been a clown \r\n\r\nwhen the sun is shining\r\nhe goes to the park \r\nclimbs the empty\r\nbandstand on the green \r\n\r\ndoing for the children\r\nhis famous routine \r\nso they still laugh\r\nwhen slowly he walks home \r\n\r\nhello hello mr.\r\nmonkey you're still\r\nso fast and funky\r\nhello hello mr.\r\nmonkey you should\r\nhave been a clown </p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425926, lowkey: nil, highkey: nil},
  {album_id: 53, title: "이별도 사랑이라면...", ganre1: "가요", ganre2: "인디", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>이별도 사랑이라면... - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가질 수 없이 모두 지나가버린 \r\n너와의 시간들\r\n덧없는 사랑 영원할 수 없는걸 \r\n어차피 잊혀질 추억\r\n아픈 기억도 어떤 미련도\r\n이젠 다 지워질 기억인데\r\n\r\n그래 이제 서로 잊혀지는 건\r\n남겨진 우리의 운명\r\n\r\n내생에 처음 받았던 사랑\r\n이세상 날 지켜준 \r\n유일한 너란 걸 \r\n꿈에서라도 볼 수 있다면\r\n마지막 못다한 말 전할텐데 \r\n\r\n슬픈 사랑 이젠 널 놓아줄래\r\n이별도 사랑이라면...</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425927, lowkey: nil, highkey: nil},
  {album_id: 53, title: "True Love", ganre1: "가요", ganre2: "인디", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>True Love - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">행복했던 기억들이\r\n나에게 빛이 되어 밝혀주고\r\n외로울 때 슬퍼질 때\r\n항상 날 위로해주네\r\n\r\n사랑했던 넌 없지만\r\n내 맘속엔 언제나 네가 있어\r\n하루하루 지나가도\r\n너만이 날 숨쉬게 해\r\n\r\nIt was true love~\r\ndon't be afraid\r\n이젠 내 손 잡아줘\r\ntrue love~ don't be afraid\r\n네가 없이는 자신이 없어\r\nI'll never let you go\r\n\r\n따뜻했던 네 목소리\r\n아직도 내 귓가에 남아있어\r\n언제라도 함께하잔\r\n그 말 난 기억하는데\r\n\r\nIt was true love~\r\ndon't be afraid\r\n이젠 내 손 잡아줘\r\ntrue love~ don't be afraid\r\n네가 없이는 무엇도 \r\ntrue love~ don't be afraid\r\n이젠 내 손잡아줘 \r\ntrue love~ don't be afraid\r\n네가 없이는 자신이 없어\r\nI'll never let you go</p> \n\t\t\t\t\t\t", artist_num: 80233969, album_num: 80416953, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/233/969/80233969_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/953/80416953_1396860493691_1_600x600.JPG", song_tjnum: nil, song_num: 82425928, lowkey: nil, highkey: nil},
