  {album_id: 55, title: "여행 (Feat. 주형우)", ganre1: "가요", ganre2: "R&amp;B/소울", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>여행 (Feat. 주형우) - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하루 한번 웃을수가 없었던 \r\n내게 말해줄래 \r\n지금 떠나면 모두 사라져 \r\n왜 하루도 삶의 가장 \r\n소중함 찾아 본 적 없이 \r\n현실 가혹하단 생각만해 \r\n멀리 떠나 \r\n나만을 위한 나를 위한 \r\n여행 멀리 떠나\r\n웃고서 있는 나를 찾아\r\n이 시간 다시 오지 않아 \r\n한번 뿐인걸\r\n이 시간 다시 네게오지 않아 \r\n지금처럼만\r\n처음같은 마음으로 \r\nComing Back To\r\n되돌리긴 어렵지만 \r\nComing Back To\r\n누구도 날 막지 못해 \r\n지금 이 순간엔\r\n아무때나 찾아 오는 기회는 아냐\r\n지나고 나면 후회할게 불보듯 뻔해\r\n이제부터 뒤는 안봐 \r\n직진만 할래\r\n처음같은 마음으로\r\n되돌리긴 어렵지만\r\n멀리 떠나 \r\n나만을 위한 나를 위한 여행\r\n멀리 떠나 \r\n웃고서 있는 나를 찾아 \r\n이 시간 다시 오지 않아 \r\n한번 뿐인걸\r\n이 시간 다시 네게오지 않아 \r\n지금처럼만\r\n처음같은 마음으로\r\nComing Back To \r\n되돌리긴 어렵지만 \r\nComing Back To</p> \n\t\t\t\t\t\t", artist_num: 80110533, album_num: 80416955, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/110/533/80110533_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/955/80416955_1396605917293_1_600x600.JPG", song_tjnum: nil, song_num: 82426007, lowkey: nil, highkey: nil},
