  {album_id: 59, title: "Classic Blue", ganre1: "뉴에이지", ganre2: "뉴에이지", runtime: "05:18", lyrics: "\n\t\t\t\t\t\t\t<div>Classic Blue - 05:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 14948445, album_num: 80416959, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/948/445/14948445_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/959/80416959_1397024556823_1_600x600.JPG", song_tjnum: nil, song_num: 82426100, lowkey: nil, highkey: nil},
  {album_id: 59, title: "Cat And Angel", ganre1: "뉴에이지", ganre2: "뉴에이지", runtime: "05:05", lyrics: "\n\t\t\t\t\t\t\t<div>Cat And Angel - 05:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 14948445, album_num: 80416959, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/948/445/14948445_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/959/80416959_1397024556823_1_600x600.JPG", song_tjnum: nil, song_num: 82426101, lowkey: nil, highkey: nil},
  {album_id: 60, title: "어쩔사 (어쩔 수 없는 사랑)", ganre1: "가요", ganre2: "전체", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>어쩔사 (어쩔 수 없는 사랑) - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">당신을 사랑한다고 웃으며 \r\n말은 했지만\r\n돌아서 우는 내 발길을 \r\n당신은 영영 모르리\r\n당신의 그 말이 거짓 말인줄 \r\n알면서도 속아준 것이\r\n가슴에서 울고 바람 따라 울고 \r\n강물처럼 흘러도 \r\n어쩔수 없는 나의 사랑은 \r\n어쩔사 어쩔사 사랑 \r\n어쩔수 없는 내 사랑</p> \n\t\t\t\t\t\t", artist_num: 79972292, album_num: 80416960, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/079/972/292/79972292_10_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/960/80416960_1396836217123_1_600x600.JPG", song_tjnum: nil, song_num: 82426102, lowkey: nil, highkey: nil},
  {album_id: 60, title: "여여 (如如)", ganre1: "가요", ganre2: "전체", runtime: "03:24", lyrics: "\n\t\t\t\t\t\t\t<div>여여 (如如) - 03:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">돌아보면 아쉬운 듯 살아가야지 \r\n살면은 그 얼마나 우리 산다고 \r\n일일희비 아등바둥 그 세월속에 \r\n오늘도 우리 인생 분주로구나\r\n가진 사람 못가진 사람 \r\n애당초 뭣하나 달랐더냐 \r\n있으면 있는대로 \r\n없으면 없는대로 \r\n살아가야지\r\n좋으면 좋은 대로 싫으면 \r\n싫은 대로 우리 인생 여여지\r\n\r\n오늘은 오늘이라 좋은 날이고 \r\n내일은 내일이라 좋은 날일세\r\n마음속에 무거운 짐 던져 버리고 \r\n오늘도 웃음으로 살아나 보세\r\n가진 사람 못가진 사람 애당초 \r\n뭣하나 달랐더냐 \r\n있으면 있는대로 \r\n없으면 없는대로 \r\n살아가야지\r\n좋으면 좋은 대로 \r\n싫으면 싫은 대로 \r\n우리 인생 여여지</p> \n\t\t\t\t\t\t", artist_num: 79972292, album_num: 80416960, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/079/972/292/79972292_10_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/960/80416960_1396836217123_1_600x600.JPG", song_tjnum: nil, song_num: 82426103, lowkey: nil, highkey: nil},
  {album_id: 60, title: "신데렐라", ganre1: "가요", ganre2: "전체", runtime: "03:16", lyrics: "\n\t\t\t\t\t\t\t<div>신데렐라 - 03:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">신데렐라는 어려서부터 \r\n부모님을 잃었지만\r\n나는 나는 나이들어 \r\n부모님을 잊고 사네\r\n그리운 옛이야기 \r\n들려주던 어머니\r\n지금도 남아있는 \r\n추억속의 그 모습이\r\n영화처럼 내 기억 저편에 \r\n아련히 떠오르네요\r\n\r\n신데렐라는 검은재라는 \r\n뜻이라고 하는데\r\n우리부모 자식생각에 \r\n가슴속이 타들어갔네\r\n내 자식 생각하는 \r\n반만 생각 했더라도\r\n세월이 흘러가며 \r\n후회하지 않을텐데\r\n고마운 마음 눈물이 되어 \r\n가슴에 흘러 내리네</p> \n\t\t\t\t\t\t", artist_num: 79972292, album_num: 80416960, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/079/972/292/79972292_10_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/960/80416960_1396836217123_1_600x600.JPG", song_tjnum: nil, song_num: 82426104, lowkey: nil, highkey: nil},
  {album_id: 60, title: "신데렐라 (MR)", ganre1: "가요", ganre2: "전체", runtime: "03:15", lyrics: "\n\t\t\t\t\t\t\t<div>신데렐라 (MR) - 03:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 79972292, album_num: 80416960, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/079/972/292/79972292_10_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/960/80416960_1396836217123_1_600x600.JPG", song_tjnum: nil, song_num: 82426105, lowkey: nil, highkey: nil},
