  {album_id: 60, title: "어쩔사 (어쩔수 없는 사랑) (MR)", ganre1: "가요", ganre2: "전체", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>어쩔사 (어쩔수 없는 사랑) (MR) - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 79972292, album_num: 80416960, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/079/972/292/79972292_10_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/960/80416960_1396836217123_1_600x600.JPG", song_tjnum: nil, song_num: 82426108, lowkey: nil, highkey: nil},
  {album_id: 60, title: "청풍명월", ganre1: "가요", ganre2: "전체", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>청풍명월 - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">남한강 구비 구비 \r\n그림 같은 청풍호\r\n물 안개 핀 강물에는 \r\n억새가 춤을 추네\r\n대나무 옥순봉아 \r\n거북이 구담봉아\r\n붉게 물든 저녁노을 \r\n호수에 띄워놓고\r\n아름다운 꽃봉오리 \r\n청풍호에 빠져있네\r\n\r\n수륙 길 백삼십리 \r\n그림 같은 청풍호 \r\n은빛 파도 황금 물결 \r\n여기가 청풍 일세\r\n단풍 옷 갈아입고 \r\n님 맞을 청풍 아가씨\r\n석류 같이 빨간 사랑 \r\n가슴에 물들이고\r\n월악산에 걸린 달빛 \r\n그대 품에 안겨주리</p> \n\t\t\t\t\t\t", artist_num: 79972292, album_num: 80416960, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/079/972/292/79972292_10_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/960/80416960_1396836217123_1_600x600.JPG", song_tjnum: nil, song_num: 82426109, lowkey: nil, highkey: nil},
  {album_id: 61, title: "사랑은 (언제나) (MR)", ganre1: "CCM", ganre2: "국내CCM", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 (언제나) (MR) - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 14945068, album_num: 15032344, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/945/068/14945068_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/032/344/15032344_1408948301784_1_600x600.JPG", song_tjnum: nil, song_num: 82426110, lowkey: nil, highkey: nil},
