  {album_id: 67, title: "Soulflower", ganre1: "가요", ganre2: "락", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>Soulflower - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무도, 들리지 않는\r\n시커먼 방한 구석에\r\n깊은 잠 어떤 꿈속에\r\n하얗게 축제가 열리네.\r\n\r\n여기저기 갇힌 너의 의식도 \r\nI can paint your soul,\r\ncan paint your soul\r\n도시 속에 갇힌 혼돈의 soul\r\nI can paint your soul,\r\ncan paint your soul\r\n\r\n아무런 색깔 도 없는\r\n(피부로 느낄 수 없고\r\n눈으로 볼 수 없었지)\r\n나는 널 느낄 수 있어\r\n(보고 믿는 것이 아닌 것처럼\r\n나는 널 느낄 수 있어)\r\n\r\n둥글게 모여 앉아서\r\n서로를 숨기고 있네.\r\n\r\n여기저기 갇힌 너의 의식도 \r\nI can paint your soul,\r\ncan paint your soul\r\n도시 속에 갇힌 혼돈의 soul\r\nI can paint your soul,\r\ncan paint your soul</p> \n\t\t\t\t\t\t", artist_num: 80139388, album_num: 80416965, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/139/388/80139388_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/965/80416965_1396853508169_1_600x600.JPG", song_tjnum: nil, song_num: 82426171, lowkey: nil, highkey: nil},
