  {album_id: 95, title: "나의 그대", ganre1: "가요", ganre2: "발라드", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>나의 그대 - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대를 만나\r\n천일이 넘도록 나는\r\n너무 행복해\r\n그대가 곁에 있어서\r\n날 위해\r\n모든걸 포기한 당신\r\n\r\n너무 아픈 기억 때문에\r\n상처투성이 그대\r\n너무 힘들었었을 그대\r\n애써 강한척 하려 해도\r\n결국 여린 마음에\r\n나를 피해 몰래 울던 너\r\n\r\n그대가 없는 삶이란\r\n상상도 못해\r\n힘들고 지칠때\r\n나를 지켰던\r\n\r\n부족하기만한 나에게\r\n가진것도 없는\r\n그런 나를 선택한 그대\r\n애써 강한척하려 해도\r\n너무 여린 마음에\r\n결국 나를 위해 울던 너\r\n\r\n이젠 내가 그대를\r\n지켜주고 더 사랑할께\r\n나 때문에 많이 울었던\r\n그댈위해 살아갈께요\r\n\r\n지난 시간속에 상처들\r\n모두 지울 만큼\r\n행복하게 해줄께 그대\r\n항상 우리 함께 웃어요\r\n이제 남은 평생을\r\n서로 바라 보며 살아요</p> \n\t\t\t\t\t\t", artist_num: 80261738, album_num: 80416994, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/994/80416994_1396837050630_1_600x600.JPG", song_tjnum: nil, song_num: 82426446, lowkey: nil, highkey: nil},
  {album_id: 95, title: "나의 그대 (MR)", ganre1: "가요", ganre2: "발라드", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>나의 그대 (MR) - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80261738, album_num: 80416994, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/994/80416994_1396837050630_1_600x600.JPG", song_tjnum: nil, song_num: 82426447, lowkey: nil, highkey: nil},
  {album_id: 96, title: "숨쉬다", ganre1: "가요", ganre2: "락", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>숨쉬다 - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">두 눈을 감고,\r\n두 비를 맞고,\r\n어둠에 쌓인\r\n길을 걸었죠.\r\n\r\n나에게 남은\r\n작은 불씨들은\r\n점점 희미(점점 더욱)\r\n해져가고 있죠.\r\n(커 가고 있죠)\r\n\r\n아직도 흘러가는 시간\r\n이대로 멈출 수 있다면\r\n\r\n너에 대한 추억이\r\n남아있는\r\n지금 내가 서있는\r\n이곳에서\r\n너에 대해 말할게\r\n큰 소리로\r\n아직 내가 숨쉬고\r\n있다고\r\n\r\n거울에 비친\r\n꿈꾸던 나의\r\n잃어버린 시간\r\n너무 그리워\r\n\r\n아직도 여기\r\n남아있는 작은\r\n추억\r\n잊을 수가 없네요.\r\n\r\n아직도 흘러가는 시간\r\n이대로 멈출 수 있다면\r\n\r\n너에 대한 추억이\r\n(남아있는)\r\n지금 내가 서 있는\r\n(이곳에서)\r\n너에 대해 말할게\r\n(큰 소리로)\r\n아직 내가 숨쉬고\r\n있다고\r\n\r\n그저 이렇게 멍하니\r\n멈춰 있는 기억\r\n\r\n거울 속에 내 모습\r\n\r\n너에 대한 추억이\r\n(남이있는)\r\n지금 내가 서 있는\r\n(이곳에서)\r\n너에 대해 말할게\r\n(큰 소리로)\r\n아직 내가 숨쉬고\r\n있다고\r\n\r\n너에 대한 추억이\r\n지금 내가 서 있는\r\n너에게 말할게\r\n(큰 소리로)\r\n아직 내가 숨쉬고\r\n있다고\r\n\r\n그대여\r\n그대는 잘 지냅니까\r\n그대는 어떻습니까?\r\n그대여\r\n4년전 그 겨울\r\n시장 거리에서의\r\n그 고백을\r\n기억하십니까?\r\n제 마음은\r\n그 때와 \r\n똑같습니다.</p> \n\t\t\t\t\t\t", artist_num: 80071394, album_num: 80416995, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/995/80416995_1396837268701_1_600x600.JPG", song_tjnum: nil, song_num: 82426448, lowkey: nil, highkey: nil},
  {album_id: 97, title: "아름다운 시절 (Acoustic Ver.)", ganre1: "OST", ganre2: "드라마", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>아름다운 시절 (Acoustic Ver.) - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내 그리웠던 날들이 \r\n조용히 저물어가고 \r\n추억을 헤는 별들이 \r\n가슴 위로 뜨는 밤 \r\n그 별빛처럼 흐르던 \r\n그대와 나의 이야기 \r\n이제는 사라져버린 \r\n꿈결 같은 약속들 \r\n어디로 갔나요 \r\n그 눈부시던 눈동자 \r\n세상 가득히 퍼져가던 \r\n그대 향기와 따뜻한 음성\r\n그 아름다운 날들이 \r\n바람에 흩어졌어도 \r\n귓가에 아직 들리는 \r\n지난 날의 속삭임 \r\n어디에 있나요 \r\n그 타오르던 입술과 \r\n내 맘 아득히 퍼져오던 \r\n그대 향기와 수줍은 미소 \r\n외로운 날이 길 때면 \r\n환하게 떠오는 얼굴 \r\n이제는 사라져버린 \r\n아름다운 그 날들 \r\n다시는 갈 수가 없는 \r\n그 향기롭던 날</p> \n\t\t\t\t\t\t", artist_num: 80163043, album_num: 80416996, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/163/043/80163043_6_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/996/80416996_1396693527025_1_600x600.JPG", song_tjnum: nil, song_num: 82426449, lowkey: nil, highkey: nil},
  {album_id: 98, title: "인연", ganre1: "가요", ganre2: "발라드", runtime: "07:34", lyrics: "\n\t\t\t\t\t\t\t<div>인연 - 07:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">인연이라고 하죠\r\n거부할 수가 없죠\r\n이 사랑이 녹슬지 않도록\r\n늘 닦아 비출게요\r\n약속해요 이 순간이 다 지나고\r\n다시 보게 되는 그 날\r\n모든걸 버리고 그대 곁에 서서\r\n남은 길을 가리란 걸\r\n인연이라고 하죠\r\n거부 할 수가 없죠\r\n내 생애 이처럼 아름다운 날\r\n또 다시 올 수 있을까요\r\n우우 우우우 우우우우우\r\n우우우 우우 우\r\n취한 듯 만남은 짧았지만\r\n빗장 열어 자리했죠\r\n맺지 못한대도 후회하진 않죠\r\n영원한건 없으니까\r\n운명이라고 하죠\r\n거부 할 수가 없죠\r\n내 생애 이처럼 아름다운 날\r\n또 다시 올 수 있을까요\r\n고달픈 삶의 길에\r\n당신은 선물인걸\r\n이 사랑이 녹슬지 않도록\r\n늘 닦아 비출게요\r\n고달픈 삶의 길에\r\n당신은 선물인걸\r\n이 사랑이 녹슬지 않도록\r\n늘 닦아 비출게요\r\n나 그대에게 그대에게 우워\r\n평생 이 곳에서\r\n늘 기다리고 기다릴게요 우워\r\n내 그대여 잊지 말아요\r\n하고픈 말 많지만\r\n당신은 아실테죠\r\n먼 길 돌아 만나게 되는 날\r\n다신 놓지 말아요\r\n이 생애 못다한 사랑\r\n이 생애 못다한 인연\r\n먼 길 돌아 다시 만나는 날\r\n나를 놓지 말아요\r\n나를 놓지 말아요\r\n\r\n나를 놓지 말아요</p> \n\t\t\t\t\t\t", artist_num: 80261739, album_num: 80416997, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/997/80416997_1396693378366_1_600x600.JPG", song_tjnum: nil, song_num: 82426450, lowkey: nil, highkey: nil},
