  {album_id: 98, title: "알고 싶어요", ganre1: "가요", ganre2: "발라드", runtime: "05:14", lyrics: "\n\t\t\t\t\t\t\t<div>알고 싶어요 - 05:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">때로는 일기장에 \r\n내 얘기도 쓰시나요 \r\n바쁠 때 전화해도 \r\n내 목소리 반갑나요 \r\n달 밝은 밤에 그대는 \r\n누구를 생각하세요 \r\n잠이 들면 그대는 \r\n무슨 꿈 꾸시나요 \r\n깊은 밤에 홀로 깨어 \r\n눈물 흘린 적 없나요\r\n때로는 일기장에 \r\n내 얘기도 쓰시나요 \r\n바쁠 때 전화해도 \r\n내 목소리 반갑나요 \r\n하루 중에서 내 생각 \r\n얼만큼 많이 하나요\r\n내가 정말 그대의 \r\n마음에 드시나요\r\n참새처럼 떠들어도 \r\n여전히 귀여운가요\r\n바쁠때 전화해도 \r\n내 목소리 반갑나요\r\n눈 뜨면 제일 먼저\r\n내 얼굴이 스치나요 어떤가요\r\n때로는 일기장에\r\n내 얘기도 쓰시나요\r\n지금도 내 노래가\r\n그대란걸 아시나요\r\n내가 많이 어여쁜가요\r\n진정 날 사랑하나요\r\n난 정말 알고 싶어요\r\n얘기를 해주세요</p> \n\t\t\t\t\t\t", artist_num: 80183957, album_num: 80416997, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/997/80416997_1396693378366_1_600x600.JPG", song_tjnum: nil, song_num: 82426455, lowkey: nil, highkey: nil},
  {album_id: 99, title: "Who's Lovin' You", ganre1: "가요", ganre2: "발라드", runtime: "03:03", lyrics: "\n\t\t\t\t\t\t\t<div>Who's Lovin' You - 03:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">When I had you\r\ntreated you bad\r\nand wrong, my dear\r\nBut since, since\r\nyou went away\r\n\r\nDon't you know\r\nI sit around\r\nWith my head hangin' down\r\nAnd I wonder\r\nwho's lovin' you\r\n\r\nI, I, I, I,\r\nI should have never\r\nnever ever made you cry\r\nBut, girl, since,\r\nsince you've been gone\r\nDon't you know\r\nI sit around\r\nWith my head hangin' down\r\nAnd I wonder\r\nwho's lovin' you\r\n\r\nLife without love\r\nIt's all lonely babe.\r\nI don't think,\r\nI don't think\r\nI'm gonna make it\r\nAll my life,\r\nall my life yeah \r\nI've been lost to you only\r\ncome on home, baby,\r\nCome on and take it.\r\n\r\nAll, \r\nall I can do,\r\nsince you've gone is cry.\r\nAnd don't you ever wonder\r\nor worry your pretty\r\nlittle head\r\nabout what I will do.\r\nDon't you know\r\nI sit around\r\nWith my head hanging down\r\nAnd I wonder\r\nwho's lovin' you.</p> \n\t\t\t\t\t\t", artist_num: 80251944, album_num: 80416998, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/251/944/80251944_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/998/80416998_1396776331991_1_600x600.JPG", song_tjnum: nil, song_num: 82426456, lowkey: nil, highkey: nil},
  {album_id: 99, title: "LOVE", ganre1: "가요", ganre2: "발라드", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>LOVE - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I can call it love My babe\r\n나도 몰래 찾아 오는 설레임에\r\nYou can call it love\r\n망설이지마\r\nGotta take you\r\nlove for me yeah\r\n\r\n매일 똑같은 지루함 속에\r\n널 만나는걸\r\nGirl I'm feelin' you\r\n\r\nI know you feel it too\r\nCause 너의 눈 속에\r\n언제부턴가 내 모습이\r\n보이고 있어\r\n\r\n어린아이 같은걸\r\n숨길 수가 없는걸\r\n두근거림조차 느껴져\r\nI wanna be loved\r\n\r\n내게 다가와\r\n너의 손을 잡을게\r\n내 눈에 너를 담을래\r\n\r\nI can call it love My babe\r\n나도 몰래 다가오는 설레임에\r\nYou can call it love\r\n망설이지마 \r\n도망치지마 늘 곁에 있어줘\r\n\r\nI can call it love My babe\r\n나도 몰래 다가오는 설레임에\r\nYou can call it love\r\nYou can call it love\r\nGotta take you\r\nlove for me yeah\r\n\r\nI can call it love My babe\r\n나도 몰래 다가오는 설레임에\r\nYou can call it love\r\n망설이지마 \r\n도망치지마 늘 곁에 있어줘\r\n\r\nI can call it love\r\n나도 몰래 다가오는 설레임에\r\nYou can call it love\r\nYou can call it love\r\nGotta take you\r\nlove for me yeah\r\n\r\nYou can call it love\r\nYou can call it love</p> \n\t\t\t\t\t\t", artist_num: 80254546, album_num: 80416998, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/251/944/80251944_4_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/416/998/80416998_1396776331991_1_600x600.JPG", song_tjnum: nil, song_num: 82426457, lowkey: nil, highkey: nil},
