  {album_id: 103, title: "First Date (Feat. 낙천)", ganre1: "가요", ganre2: "R&amp;B/소울", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>First Date (Feat. 낙천) - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">친구가 아닌 연인으로\r\n처음 서로를 보는 오늘\r\nFirst date\r\n샤워를 하고 옷을 입고\r\n머릴 만지면서도\r\n난 입가에 미소만\r\n\r\n가벼운 발걸음\r\n널 만나러 가는 길\r\n날 어색해하진 않을까\r\n무슨 얘길 나눌까\r\n매일 걷던 이 길이\r\n멀게만 느껴질까\r\n조금이라도 널\r\n빨리 난 보고싶어\r\nI'm in love with you\r\n\r\n따스한 봄날의 햇살도\r\n흩날리는 꽃잎도\r\n바람도 우리의 사랑을\r\n축복하는 것 같아\r\n\r\n저기서 날 향해 걸어오는\r\n해맑게 웃는 Beautiful lady\r\n하늘에서 온 천사일까\r\n그녀와 함께 맞이할\r\n오늘은 Special day\r\n\r\n한 손엔 향긋한 커피를 들고서\r\n손 깍지끼고 발을 맞춰 걸어요\r\n이 거리를\r\n활짝 핀 꽃들도\r\n아름다운 하늘도\r\n너와 함께 볼 수 있음에\r\n난 감사해\r\nI'm in love with you\r\n\r\n따스한 봄날의 햇살도\r\n흩날리는 꽃잎도\r\n바람도 우리의 사랑을\r\n축복하는 것 같아\r\n\r\n내가 알던 너가 아냐\r\n내 마음이 진정이 안돼\r\n처음 보는 것 마냥\r\n괜히 긴장해서\r\n눈도 제대로 못 마주쳐\r\n어색한 얼굴로\r\n아무렇지도 않은 척\r\n\r\n계획대로 안돼 \r\n짜놓은 코스도 물거품\r\n그저 연인이 된 너가\r\n내 옆에 있는 것 뿐인데\r\n바보가 되는 지금이 행복해서\r\n그냥 이대로 시간이\r\n멈추는 것도 좋겠어\r\n\r\n따스한 봄날의 햇살도\r\n흩날리는 꽃잎도\r\n바람도 우리의 사랑을\r\n축복하는 것 같아\r\n\r\n따스한 봄날의 햇살도\r\n흩날리는 꽃잎도\r\n바람도 우리의 사랑을\r\n축복하는 것 같아</p> \n\t\t\t\t\t\t", artist_num: 80261742, album_num: 80417003, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/742/80261742_2_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/003/80417003_1396834932452_1_600x600.JPG", song_tjnum: nil, song_num: 82426506, lowkey: nil, highkey: nil},
