  {album_id: 105, title: "연애할래 (Feat. 슬라임 of 리퀴드)", ganre1: "가요", ganre2: "발라드", runtime: "03:16", lyrics: "\n\t\t\t\t\t\t\t<div>연애할래 (Feat. 슬라임 of 리퀴드) - 03:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">a girl I think \r\nit's a good day to love, \r\nya dig\r\nhey 엘른! sing it!\r\n\r\n오늘 밤 너의 목소리에 잠들고\r\n다음날 아침 너의 문자로 \r\n하룰 시작해\r\n부드러운 목소리 \r\n다정한 말투까지\r\n기분 좋은 느낌\r\nfeel so good\r\n\r\n연애할래? 웃는게 예쁜남자 \r\n내 이상형이거든\r\n그 미소에 난 그저 \r\nI'm falling in love\r\n어쩜 그래 어쩜 그렇게 멋져\r\noh my sweet boy baby \r\n머리부터 발끝까지\r\n내 눈엔 계속 너만 보여\r\n\r\nhey girl 너와 거리를 걸을때\r\n너와 내 손이 살짝 ㅎ 닿을때\r\n내 심장은 \r\npumping fast and hard\r\n지금 너도 할까 내 생각, 어?\r\n\r\n상큼한 허브향 추억 만들어가\r\n귓가에 들려오는 사랑의 노래\r\n따뜻한 너의 손과 \r\n포근한 너의 품속\r\n너에게 빠졌나봐 \r\n(i love you baby)\r\n\r\n연애할래? 웃는게 예쁜남자 \r\n내 이상형이거든\r\n그 미소에 난 그저 \r\nI'm falling in love\r\n어쩜 그래 어쩜 그렇게 멋져\r\noh my sweet boy baby \r\n머리부터 발끝까지\r\n내 눈엔 계속 너만 보여\r\n\r\noh yes I'm falling in love \r\n날씨도 좋은 날에\r\n완벽한 너와 함께 하는 \r\n데이트, 나에게\r\n이런 행복이 찾아오다니\r\n내 맘에 봄을 안겨준 \r\n너라는 나비\r\nI'll be next to you, \r\nalways I promise you\r\n이제 내 손을 잡아 놀러가자 \r\n어디든\r\n너와 함께라면 \r\nbaby I don't care\r\n걱정하지마 내 맘은 안 변해\r\n\r\n널 만나러 가는 설레임속 \r\n달콤한 향기\r\n그 안에 너와 나 \r\n행복한 추억들\r\n이제는 너와 함께 갈래\r\n\r\n연애할래? 웃는게 예쁜남자 \r\n내 이상형이거든\r\n그 미소에 난 그저 \r\nI'm falling in love\r\n어쩜 그래 어쩜 그렇게 멋져\r\noh my sweet boy baby \r\n머리부터 발끝까지\r\n내 눈엔 계속 너만 보여\r\n\r\n너와 하고 싶은 것도, \r\n가고 싶은 곳도\r\n난 아주 많어 너가 \r\n좋아지는걸 점점\r\nI can't stop \r\nthinkin bout you\r\nI think I love you, girl, \r\nhow bout you?</p> \n\t\t\t\t\t\t", artist_num: 80261743, album_num: 80417005, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/743/80261743_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/005/80417005_1396958628351_1_600x600.JPG", song_tjnum: nil, song_num: 82426511, lowkey: nil, highkey: nil},
