  {album_id: 111, title: "Run To You", ganre1: "OST", ganre2: "드라마", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>Run To You - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">With you...\r\nEverything seems so easy\r\nWith you...\r\nMy heartbeat has found\r\nits rhythm\r\nWith you...\r\nI'm so close to\r\nfinding my home\r\n\r\nWith you...\r\nI dont care\r\nif I'm a little bit crazy\r\nCause with you\r\nnothing's wrong\r\nI was broken, I was wasted\r\nThen you came\r\nlike an angel in the rain\r\n\r\nLove used to slip trough me\r\nlike waters slips trough hands\r\nBut with you it changed I know,\r\nI feel I'm closer to your heart\r\n\r\nI am run-run-running to you\r\nAnd I'll keep you safe forever\r\nThrough the tears,\r\ntrough the love\r\nand all the nights\r\n\r\nwe share\r\nI am run-run-running to you\r\nAnd I'll keep you safe forever\r\nDon't you know my love,\r\ndon't you know two hearts\r\ncan beat as one?\r\n\r\nLove used to slip\r\ntrough me like water\r\nslips trough hands\r\nbut no more\r\nNo more lonely nights,\r\nno more, no more\r\nSo c'mon, c'mon,\r\nhold on, hold on, hold on\r\n\r\nI am run-run-running to you\r\nAnd I'll keep you safe forever\r\nThrough the tears,\r\ntrough the love\r\nand all the nights\r\n\r\nwe share\r\nI am run-run-running to you\r\nAnd I'll keep you safe forever\r\nDon't you know my love,\r\ndon't you know two hearts\r\ncan...\r\n\r\nI am run-run-running to you\r\nAnd I'll keep you safe forever\r\nThrough the tears,\r\ntrough the love\r\nand all the nights\r\n\r\nwe share\r\nI am run-run-running to you\r\nAnd I'll keep you safe forever\r\nDon't you know two hearts\r\ncan beat as one?</p> \n\t\t\t\t\t\t", artist_num: 14947050, album_num: 80417011, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/947/050/14947050_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/011/80417011_1396835063384_1_600x600.JPG", song_tjnum: nil, song_num: 82426546, lowkey: nil, highkey: nil},
  {album_id: 111, title: "Run To You (Inst.)", ganre1: "OST", ganre2: "드라마", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>Run To You (Inst.) - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 14947050, album_num: 80417011, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/947/050/14947050_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/011/80417011_1396835063384_1_600x600.JPG", song_tjnum: nil, song_num: 82426547, lowkey: nil, highkey: nil},
  {album_id: 112, title: "그런 여자", ganre1: "가요", ganre2: "발라드", runtime: "03:07", lyrics: "\n\t\t\t\t\t\t\t<div>그런 여자 - 03:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지치고 힘든 하루끝에\r\n괜찮냐고 웃어주면서\r\n안아 주는 여자\r\n오빠 내가 왜 화났는지\r\n정말 몰라?\r\n그런거 절대 물어보지 않는여자\r\n\r\n흥청망청 술자리에서\r\n딴 여자 하루밤\r\n어떻게든 해보려 하던\r\n그날밤 전화기 배터리가\r\n나갔단 우스개소릴 해도\r\n쿨하게 넘기는 여자\r\n\r\n그런 여자가 미쳤다고 널 만나냐\r\n너도 양심이 있을거 아니냐 \r\n자꾸만 김치녀들이\r\n자꾸 꼬인다는건\r\n너도 김치남이란 얘기야\r\n\r\n김치찌개 하날 먹어도 \r\n아주 강남타령에\r\n리스로 지른 외제차에 \r\n아주 허세 허세가 의리의리한\r\n일베하는 널 만나 주면서\r\n오빠오빠 하는 여자가\r\n\r\n약을 먹었니\r\n사랑으로 널 만나겠냐  \r\n뭔지 사이즈 딱 나오지 않냐\r\n자꾸만 김치녀들이\r\n자꾸 꼬인다는건\r\n이여자 저여자 찝적대 보아도\r\n뭔가 살~짝 아깝다는 얘기는 \r\n너도 살짝 모자라다는 얘기야\r\n노예녀를 찾는다면\r\n소라넷에 가세요\r\n불법사이트 인건 함정</p> \n\t\t\t\t\t\t", artist_num: 80260190, album_num: 80417012, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/012/80417012_1396844907331_1_600x600.JPG", song_tjnum: nil, song_num: 82426548, lowkey: nil, highkey: nil},
