  {album_id: 114, title: "The Beat In The Light", ganre1: "가요", ganre2: "댄스", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>The Beat In The Light - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80258410, album_num: 80417015, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/015/80417015_1396837821290_1_600x600.JPG", song_tjnum: nil, song_num: 82426557, lowkey: nil, highkey: nil},
  {album_id: 115, title: "대자보", ganre1: "가요", ganre2: "트로트", runtime: "03:30", lyrics: "\n\t\t\t\t\t\t\t<div>대자보 - 03:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">안녕하세요 안녕하세요 \r\n형편은 좀 나아지셨나요 \r\n안녕하세요 안녕하세요 \r\n오랜만에 인사 올립니다\r\n\r\n다들 그렇게 살죠 \r\n다들 입 버릇처럼 \r\n아이구 힘들어 죽겠다고 \r\n허나 두번은 말고 \r\n딱 한번만은 \r\n살아볼 만한 게 \r\n인생 아닌가요\r\n\r\n안녕하세요 안녕하세요\r\n희망은 좀 보이시나요 \r\n안녕하세요 안녕하세요\r\n반가워서 인사 올립니다 \r\n\r\n다들 그렇게 살죠 \r\n다들 입 버릇처럼\r\n아이고 돈 없어 돈돈돈 돈 \r\n허나 두 번은 말고 \r\n딱 한 번만은 \r\n살아볼 만한 게 \r\n인생 아닌가요\r\n\r\n허나 두 번은 말고 \r\n딱 한 번만은 \r\n살아볼 만한 게 \r\n인생 아닌가요\r\n살아볼만 한 게 인생~ \r\n우리 인생</p> \n\t\t\t\t\t\t", artist_num: 14945059, album_num: 80417016, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/945/059/14945059_2_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/016/80417016_1396851921469_1_600x600.JPG", song_tjnum: nil, song_num: 82426558, lowkey: nil, highkey: nil},
  {album_id: 115, title: "쭉~서울", ganre1: "가요", ganre2: "트로트", runtime: "03:01", lyrics: "\n\t\t\t\t\t\t\t<div>쭉~서울 - 03:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">중학교 졸업하고 \r\n곧장 서울로 왔죠\r\n아버지 병 들어 \r\n어쩔 수 없었죠\r\n그땐 그랬죠 \r\n다 돈 벌로 서울로 왔죠\r\n그때부터 쭉 고향 서울\r\n\r\n서울은 나의 고향 \r\n나의 종착역\r\n서울은 나의 고향 \r\n쭉 서울 고향 \r\n나 태어난 고향 \r\n삽다리 내 고향 \r\n열여섯부터 쭉 고향 서울\r\n\r\n처음엔 무서웠죠 \r\n처음엔 서툴렀죠\r\n그래도 내 할일 \r\n얼추 해냈죠 \r\n노래도 부르고 \r\n그림도 그리고\r\n그때부터 쭉 고향서울\r\n\r\n서울은 나의 고향 \r\n나의 종착역\r\n서울은 나의 고향 \r\n쭉 서울 고향 \r\n나 태어난 고향 \r\n삽다리 내 고향 \r\n열여섯부터 쭉 고향 서울\r\n\r\n스무살부터 쭉 고향 서울\r\n서른살부터 쭉 고향 서울\r\n죽을 때까지 쭉 고향 서울\r\n죽을 때까지 쭉 고향 서울</p> \n\t\t\t\t\t\t", artist_num: 14945059, album_num: 80417016, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/014/945/059/14945059_2_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/016/80417016_1396851921469_1_600x600.JPG", song_tjnum: nil, song_num: 82426559, lowkey: nil, highkey: nil},
