  {album_id: 116, title: "Tell Me Why (Broadcasting Ver.)", ganre1: "가요", ganre2: "댄스", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>Tell Me Why (Broadcasting Ver.) - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Tell Me Why\r\n\r\n부탁해 Tell Me Why\r\n난 강해지고 싶어\r\n뜻도 모른 채 널 놓치긴 싫어\r\n\r\n하늘의 별처럼\r\n넌 나를 비추지만\r\n네가 떠나면 난 어둠에 갇혀\r\n\r\nWanna Go Touch\r\nWanna Get Tips\r\n조금 더 내게 기회를 줘\r\n제발 안 된다고 하지마\r\n애원해 난\r\n\r\n피지 못한 Tiny Dream \r\n멈춰선 Tiny Dream\r\n왜 안 돼 내가 계속 가겠다는데\r\n내 길이야 Make A Dream \r\n막지 마 Make A Dream\r\n누가 감히 끝을 정할 수 있어\r\n\r\n대답해 Tell Me Why\r\n날 이해시켜 제발\r\n네가 원해도 못 하는 게 있어\r\n\r\n뒤틀린 사랑을\r\n난 바로 잡고 싶어\r\n그냥 떠나면 난 미칠지 몰라\r\n\r\nWanna Go Touch\r\nWanna Get Tips\r\n한 번 더 나를 믿어줘\r\n이리 잔인하게 가지마\r\n부탁해 난\r\n\r\n피지 못한 Tiny Dream \r\n멈춰선 Tiny Dream\r\n왜 안 돼 내가 계속 가겠다는데\r\n내 길이야 Make A Dream \r\n막지 마 Make A Dream\r\n누가 감히 끝을 정할 수 있어\r\n\r\nLove Is Blind \r\n더는 넘지마 그 Line 그 Lies\r\n차갑디 차가운 네 눈빛을 봐\r\n이미 닿지 않던 사이 Good-Bye\r\nI Cry But\r\n금방 돌아와 줄거라 믿어\r\n나 빌어\r\n곧 행복해질 거라 믿어\r\n왜 그래 솔직히 말해\r\n진짜 네가 필요해\r\n강한 척 말하고 달래도\r\n약한 난 시들고 멍들고 찢기고\r\nSeems Like I Should Leave You\r\n그래 갈 거라면 꼭 다시 돌아와\r\n\r\n안 된다고 Time To Cry \r\n멈춰줘 Time To Cry\r\n나를 봐 눈물로 널 잡고 있잖아\r\n내 길이야 Make A Dream \r\n막지 마 Make A Dream\r\n누가 감히 끝을 정할 수 있어\r\n\r\nOh, 나란 남잔 사랑 앞에\r\n겁날 게 없어 \r\n모든 걸 잃어도\r\n너만 얻으면 돼\r\nOh, 그 무엇도 간절함을\r\n이길 순 없어\r\nYou're The Only One\r\nNot Else Everyone \r\nThe One And Only One \r\nThe One And Only One \r\nOne Love</p> \n\t\t\t\t\t\t", artist_num: 80255569, album_num: 80417017, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/255/569/80255569_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/017/80417017_1396837230408_1_600x600.JPG", song_tjnum: nil, song_num: 82426562, lowkey: nil, highkey: nil},
