  {album_id: 123, title: "인연  (因緣)", ganre1: "가요", ganre2: "전체", runtime: "01:42", lyrics: "\n\t\t\t\t\t\t\t<div>인연  (因緣) - 01:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80237163, album_num: 80417025, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/025/80417025_1397019127962_1_600x600.JPG", song_tjnum: nil, song_num: 82426600, lowkey: nil, highkey: nil},
  {album_id: 124, title: "아직도 난", ganre1: "OST", ganre2: "드라마", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>아직도 난 - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어려웠었지\r\n맨발로 걷기만 했던\r\n차가운 바람 불고\r\n어디로 가야할지도 잃은 날\r\n\r\n난 망설였었지\r\n돌아갈 곳은 분명했었고\r\n아주 멀지않은 저 뒤에는\r\n날 기다리는 \r\n예전의 나, 편안한 집\r\n\r\n돌아보지 않으려 해도\r\n끝없는 그리움이\r\n나의 발을 멈추고\r\n좋았던 기억이 손 끝에서\r\n굽이쳐 올라\r\n\r\n떨쳐내려 눈을 감아도\r\n날 외롭게 했던 시간들에 \r\n더욱 흔들리네 아직도 난\r\n\r\n더 단단해야 해\r\n끊임없이 난 반복하잖아\r\n두 눈을 꼭 감고서\r\n두 귀를 막고서\r\n자유로울수 있도록\r\n지금까지 해 왔잖아\r\n흔들리지 마\r\n다신 의미없는 어둠은 싫어\r\n예전의 나, 익숙한 집\r\n\r\n돌아보지 않으려 해도\r\n끝없는 그리움이\r\n나의 발을 멈추고\r\n좋았던 기억이 손 끝에서\r\n굽이쳐 올라\r\n\r\n떨쳐내려 눈을 감아도\r\n날 외롭게 했던 시간들에 \r\n더욱 흔들리네\r\n아직도 이렇게</p> \n\t\t\t\t\t\t", artist_num: 80214321, album_num: 80417024, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/214/321/80214321_2_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/024/80417024_1396837685774_1_600x600.JPG", song_tjnum: nil, song_num: 82426601, lowkey: nil, highkey: nil},
