  {album_id: 127, title: "Out Of My Head (Live At The Battersea Arts Centre)", ganre1: "POP", ganre2: "팝", runtime: "03:47", lyrics: "\n\t\t\t\t\t\t\t<div>Out Of My Head (Live At The Battersea Arts Centre) - 03:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80226636, album_num: 80417028, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/226/636/80226636_2_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/028/80417028_1396837991346_1_600x600.JPG", song_tjnum: nil, song_num: 82426609, lowkey: nil, highkey: nil},
  {album_id: 128, title: "Reflection (Radio Mix)", ganre1: "가요", ganre2: "일렉트로니카", runtime: "03:11", lyrics: "\n\t\t\t\t\t\t\t<div>Reflection (Radio Mix) - 03:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80175357, album_num: 80417029, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/029/80417029_1396849866443_1_600x600.JPG", song_tjnum: nil, song_num: 82426610, lowkey: nil, highkey: nil},
  {album_id: 129, title: "마음에 둔", ganre1: "가요", ganre2: "인디", runtime: "03:15", lyrics: "\n\t\t\t\t\t\t\t<div>마음에 둔 - 03:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">마음에 그려둔 마음에 담아둔 \r\n마음에 숨겨둔 \r\n마음에 묻어둔 마음에 남겨둔 \r\n마음에 품어둔 \r\n\r\n가슴으로 살게해준 \r\n발가벗은 날 깨운 \r\n멈춤없이 뛰게해준 \r\n함께 있어온 \r\n\r\n웃음과 흥, 여유와 춤 \r\n꿀같은 순간들 늘 가득 \r\n깊음과 뜻, 기품과 멋 \r\n주옥같은 것과도 불가분 이것은 \r\n숨가쁜 뛴걸음으로만 \r\n불같은 뜨거움으로만 \r\n가질 수 있어\r\n믿음이 더하면 안성맞춤 \r\n기나긴 시간이 가도 시련이 와도 \r\n비극을 앞둔 시점이 라도 \r\n가질 수 있어 깊숙이 새겨둔다면</p> \n\t\t\t\t\t\t", artist_num: 80261773, album_num: 80417030, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/773/80261773_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/030/80417030_1396859846069_1_600x600.JPG", song_tjnum: nil, song_num: 82426611, lowkey: nil, highkey: nil},
  {album_id: 129, title: "너는 왜", ganre1: "가요", ganre2: "인디", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>너는 왜 - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너는 왜 답답하게 행동하니 지금 \r\n너는 왜 답답하게 살아가니 지금 \r\n\r\n이게 맞을까 이 길이 옳을까\r\n낭만주의일까 아님 망상일까\r\n팔짱끼고 방안을 왔다 갔다\r\n처음 만난 자리에서도 고민상담\r\n늘 들려오는 말 '니 자신알라'혹은\r\n'그지된다 인마' 말에 귀가 쫑긋\r\n오늘도 얼굴옆 작은 날개들은\r\n말 바람에 팔랑 대다 결국\r\n\r\n'그래 나는 아냐' 고개를 젓지\r\n'평범 하잖아' 모든걸 접지\r\n안전우선 장남의 숙명\r\n온갖 말 갖다붙여 어떻게든 부정\r\n시작보다는 포기가 먼저\r\n내인생영환 남들이 주연\r\n고민 또 고민 또 고민\r\n또 고민 또 고민\r\n그냥하면 되는 것을\r\n바라만 보는 너는 왜\r\n\r\n너는 왜 답답하게 행동하니 지금 \r\n너는 왜 답답하게 살아가니 지금 \r\n\r\n이 길로 가려면 이것부터 하라고\r\n과정의 아름다움 한계단씩 하라고\r\n인생은 마라톤 천리길도 한걸음\r\n잠깐만 잠깐만 혹시 나 모르냐 너\r\n나란 놈 한마디로 핵폭탄보다\r\n백배 강력한 백두산폭발\r\n보기보다 배포가득찬\r\n내모습보고도 단계를 논하나\r\n\r\n'그건 내가 아냐' 손을 내젓지\r\n'너무 늦잖아' 혼자 초현실\r\n인생한방 뼛속까지 남자\r\n온갖 말 갖다붙여 어떻게든 부정\r\n텅빈 채 수레티만 내\r\n처진 채 승부수만 내\r\n높이 더 높이 더 높이\r\n더 높이 더 높이\r\n시작조차 못하면서\r\n콧대만 세우는 너는 왜\r\n\r\n너는 왜 답답하게 행동하니 지금 \r\n너는 왜 답답하게 살아가니 지금 \r\n\r\n고민보단 고집으로\r\n조심보단 초심으로\r\n존심보단 무식으로\r\n생각하지마 그냥 해\r\n머리보단 두 손으로\r\n머리보단 가슴으로\r\n머리보단 온몸으로\r\n달려가면 할 수 있는데\r\n\r\n너는 왜 답답하게 행동하니 지금 \r\n너는 왜 답답하게 살아가니 지금</p> \n\t\t\t\t\t\t", artist_num: 80261773, album_num: 80417030, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/773/80261773_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/030/80417030_1396859846069_1_600x600.JPG", song_tjnum: nil, song_num: 82426612, lowkey: nil, highkey: nil},
  {album_id: 129, title: "추억의 명곡", ganre1: "가요", ganre2: "인디", runtime: "05:36", lyrics: "\n\t\t\t\t\t\t\t<div>추억의 명곡 - 05:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잊고 있었던 노래가\r\n생각난 적 있나요\r\n오래된 어느 음반에\r\n들어있던 그 곡\r\n\r\n맘속에 간직하고 있는\r\n잊혀지지 않는 멜로디\r\n꺼내어보아요 흥얼거려봐요\r\n\r\n흐르는 음악 소리 함께\r\n타고 오는 기억은 모두 다르지만\r\n두근대는 가슴 있는 건\r\n누구나 같을테죠\r\n남에겐 흔한 노랠 수도 있지만\r\n당신에겐 특별한\r\n사연이 있는 곡\r\n웃음 때로는 눈물짓게 하겠죠\r\n\r\n언제나 아끼고 싶은 순간이 있겠죠\r\n누군가를 처음 만나고 설레던 그 날\r\n\r\n맘속에 간직하기에는\r\n너무 아픈 순간도 있죠\r\n눈을 감아봐요 노랠 들어봐요\r\n\r\n흐르는 음악 소리 함께\r\n타고 오는 기억은 모두 다르지만\r\n두근대는 가슴 있는 건\r\n누구나 같을테죠\r\n남에겐 흔한 노랠 수도 있지만\r\n당신에겐 특별한\r\n사연이 있는 곡\r\n웃음 때로는 눈물짓게 하겠죠\r\n\r\n우리 함께했던 모든 시간들이\r\n노래 속에 살았으면 해요\r\n\r\n보잘 것 없지만 나의 노래들이\r\n당신에게 남았으면 해요\r\n\r\n흐르는 음악 속에\r\n살아 움직이는 시간은\r\n모두 다르지만\r\n자기만의 노래 있는 건\r\n누구나 같을테죠\r\n남에겐 그저 그럴 수도 있지만\r\n오직 내겐 특별한\r\n이야기가 있죠\r\n불러볼까요</p> \n\t\t\t\t\t\t", artist_num: 80261773, album_num: 80417030, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/773/80261773_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/030/80417030_1396859846069_1_600x600.JPG", song_tjnum: nil, song_num: 82426613, lowkey: nil, highkey: nil},
  {album_id: 129, title: "망치를 든 아이 (Feat. 지나가던 조씨)", ganre1: "가요", ganre2: "인디", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>망치를 든 아이 (Feat. 지나가던 조씨) - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가끔은 이런 생각들을 해\r\n난 이미 패배한 인생\r\n바다에 나간 사람은\r\n꿈을 거침없이 이뤄내지\r\n목숨마저 걸고서\r\n겁도없이 들이대지\r\n무한한 용기 그런 건 없지\r\n두드러진 나만의 끼 것도 그다지\r\n없어 그저 벌써부터 평범속성 \r\n버져비턴 꿈도 못꿔\r\n뼛속부터 후보근성\r\n \r\n존경하는 선장은 내게 말해\r\n한번뿐인 인생 이렇게 살순 없대\r\n알아 하지만 너의 가치관\r\n따라가기란 쉽진 않아\r\n막막한 바다 강한 마음만\r\n갖고 가기란 어렵잖아\r\n안정적으로 좀더 느리게\r\n가는 걸 택하지 \r\n난 사람들에게 당당하게 \r\n나의 마음을 전하지\r\n돌아가는 것이지 포기가 아니야\r\n말하면서도 패배감이\r\n밀려오는 나의 맘\r\n  \r\n저 바달보며 한숨을 쉬어\r\n저 바달보며 눈물 흘려\r\n \r\n돌아 간다니 너도나도 돌아간대\r\n솔까 말로 좋단 길을 골라가는\r\n우리가 결국 올라간대\r\n패자로 볼까봐 혼자만 낙오자가\r\n될까봐서 옳다라며\r\n현자라고 몰아가\r\n입만 산 놈들의 말장난 때문에\r\n난장판 된 나의 순수한 맘\r\n나같은 놈도 결국엔 똑같은 놈인가\r\n실망을 할 때 무렵\r\n나에게 말했지 누군가\r\n \r\n바다 가는 꿈 누구나꾸지\r\n하지만 대부분은\r\n가지 못해서 머물지\r\n바다 얘기만 하며 끊임없이\r\n망치만을 두들겨\r\n의자만 들고 집을 짓고\r\n바다와는 멀어져\r\n손에는 망치 그것이 너를\r\n더욱 더 슬프게 하지\r\n하지만 집이 아닌\r\n커다란 배를 만드는 중이라면\r\n끊임없이 두들겨 넌 패자가 아니야\r\n \r\n저 바달보며 한숨을 쉬어\r\n저 바달보며 눈물 흘려\r\n \r\n니가 하는 일이 너의 꿈과\r\n아무런 상관없는 것으로 보이는가\r\n그건 너의 꿈으로 가기 위한 \r\n발판을 만들고 있는 중요한 시간\r\n\r\n니가 하는 일이 너의 꿈과\r\n아무런 상관없는 것으로 보이는가\r\n그건 너의 꿈으로 가기 위한\r\n용기있는 선택 절대 주저하지마\r\n \r\n저 바달보며 한숨을 쉬어\r\n저 바달보며 눈물 흘려</p> \n\t\t\t\t\t\t", artist_num: 80261773, album_num: 80417030, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/773/80261773_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/030/80417030_1396859846069_1_600x600.JPG", song_tjnum: nil, song_num: 82426614, lowkey: nil, highkey: nil},
  {album_id: 129, title: "자전거 탄 남매", ganre1: "가요", ganre2: "인디", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>자전거 탄 남매 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아침 출근길에 항상 마주치는\r\n꼬마 아이 둘이 있어\r\n학교 가는 길 언제나\r\n서툴게 자전거를 타지\r\n뒤에 동생을 태우고 씩씩하게\r\n자전거 모는 오빠와\r\n신발주머니 두 개 들고\r\n등 뒤에 꼭 매달린 동생\r\n\r\n힘든 오르막길이\r\n나올 때면 잠시 내려서\r\n둘이 함께 자전거를 끌고 오르지\r\n정말 잠시뿐이야\r\n다시 준비해볼까\r\n학교까지 단숨에 달려볼까\r\n페달에 몸을 싣고\r\n\r\n신나게 달려라 씽씽씽 \r\n저 앞에 보이는\r\n자동차보다 빠르게\r\n너희의 꿈도 해맑은 웃음도\r\n다치지 않았으면 해\r\n항상 힘차게 달려라 씽씽씽 \r\n하늘 위로 날으는\r\n비행기보다 더 멀리\r\n거칠 것 없이 지금처럼\r\n서로를 위하면서\r\n\r\n바람같이 슝 달리는 자전거 \r\n저기요 따르릉 하면서 \r\n한달음 또 단숨에\r\n달려서 갈 수 있어.\r\n계속 그렇게 씽씽씽 \r\n근심 걱정은 휙휙휙\r\n어느샌가 저 뒤로\r\n어디 한번 빠르게 가볼까 저기로\r\n순간 이미 너희 맘은 그 곳\r\n\r\n돌부리에 쿵 흔들리는 자전거\r\n에이쿠 중심을 못 잡았어.\r\n좌로 우로 흔들흔들 \r\n길은 울퉁불퉁 멈칫\r\n우물쭈물 꾸물거려.\r\n걱정마 길은 쭉 뻗어있어 \r\n두려워마 너흰 늘 함께 있어\r\n계속 달려 눈썹 휘날리게\r\n맞이해 밝은 피날레\r\n\r\n가파른 내리막이\r\n나올 때면 잠시 내려서\r\n둘이 함께 자전거를 붙들고 가지\r\n이건 잠시뿐이야 다시 준비해야지\r\n저기까지 잽싸게 달려볼까\r\n페달에 몸을 싣고\r\n\r\n신나게 달려라 씽씽씽 \r\n저 앞에 보이는\r\n자동차보다 빠르게\r\n너희의 꿈도 해맑은 웃음도\r\n다치지 않았으면 해\r\n항상 힘차게 달려라 씽씽씽 \r\n하늘 위로 날으는\r\n비행기보다 더 멀리\r\n거칠 것 없이 지금처럼\r\n서로를 위하면서\r\n\r\n가끔씩은 넘어질 수도 있겠지\r\n아프겠지만 겨우 그것만이 너희를\r\n막을 순 없을거야\r\n\r\n신나게 달려라 씽씽씽 \r\n저 앞에 보이는\r\n자동차보다 빠르게\r\n너희의 꿈도 해맑은 웃음도\r\n다치지 않았으면 해\r\n항상 힘차게 달려라 씽씽씽 \r\n하늘 위로 날으는\r\n비행기보다 더 멀리\r\n거칠 것 없이 지금처럼\r\n서로를 위하면서</p> \n\t\t\t\t\t\t", artist_num: 80261773, album_num: 80417030, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/773/80261773_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/030/80417030_1396859846069_1_600x600.JPG", song_tjnum: nil, song_num: 82426615, lowkey: nil, highkey: nil},
  {album_id: 129, title: "기억속의 바다", ganre1: "가요", ganre2: "인디", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>기억속의 바다 - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">푸른 별빛 내 눈에 \r\n거센 파도 내 손에 내 기억 속엔\r\n\r\n선이 없는 푸름 속 \r\n마주보는 태양사이 \r\n한없이 넓은 그곳에선 \r\n갈 수 있었어 그 어디든지 \r\n폭풍우타고 손을 뻗어 \r\n구름손잡고 춤을 췄었지 \r\n\r\n행복했던 날들 속에 \r\n웃음띄던 나 \r\n내 안에서 피어나던 \r\n눈부신 나다움 \r\n\r\n얼굴잃은 버팀들 \r\n갈 수 없는 경계사이 \r\n견딜 수 없는 이 곳에서 \r\n떠나가겠어 그 곳을 향해서 \r\n물바람부는 흐름따라 \r\n돌아가겠어 나를 위해서 \r\n\r\n행복한 나날들 속에 \r\n웃음짓고파 \r\n내 안에서 피어나는 \r\n눈부신 나다움 \r\n \r\n내 모든걸 가지고서 \r\n달려갈꺼야 \r\n나 다운 날 기억하는 \r\n넓은 바다로 \r\n\r\n위에서 아래로 흐르는 것처럼 \r\n해가 저물고 또 뜨는 것처럼 \r\n푸름의 부름에 반응하는 것은 \r\n너무도 당연한\r\n나의 마음의 흐름 \r\n모르는 놈 거리며\r\n또 거들먹거리며 \r\n조소를 곁들이며 흐름을 부정 \r\n흐름을 거스르는\r\n걸음을 걷는 그들 \r\n어른의 멋스러움은 포기라 우겨 \r\n\r\n큰소리 뻥 근데 부르르 떨어 \r\n배부른 척 가슴은 꼬르륵 거려 \r\n스스로 만들어놓은\r\n그 둑을 헐고서 \r\n두 귀를 열면은 진리가 들려 \r\n두려움 부르는\r\n두 눈을 스르르 감고 \r\n푸름의 속으로 흐르는 흐름을 타 \r\n두려움 부르는\r\n두 눈을 스르르 감고 \r\n푸름의 속으로 흐르는 흐름을 타 \r\n\r\n푸른바다 네 안에</p> \n\t\t\t\t\t\t", artist_num: 80261773, album_num: 80417030, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/773/80261773_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/030/80417030_1396859846069_1_600x600.JPG", song_tjnum: nil, song_num: 82426616, lowkey: nil, highkey: nil},
