  {album_id: 134, title: "나쁜놈아 (Feat. 단디)", ganre1: "가요", ganre2: "발라드", runtime: "03:12", lyrics: "\n\t\t\t\t\t\t\t<div>나쁜놈아 (Feat. 단디) - 03:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가끔씩은\r\n먼저 전화해도 되잖아\r\n손가락이\r\n부러진것도 아니잖아\r\n넌 너무해 나쁜놈아\r\n\r\n처음에는\r\n시시콜콜한 그 얘기도\r\n다정하게\r\n잘만 들어주곤하더니\r\n넌 변했어 나쁜놈아\r\n\r\n아무래도 난\r\n점점 지쳐가나봐\r\n하루종일\r\n혼자라고 느껴질때\r\n널보고싶은걸\r\n\r\n날 사랑한다던 말도\r\n순진하게 다 믿었죠\r\n지켜준다던 그 말도 다\r\n\r\n[단디 RAP]\r\n삐치지마 애기야\r\n이쁜얼굴 망가져\r\n잠시 내가\r\n바빴던 것 뿐이야\r\n이런것도 이해못해?\r\n말했잖아 니 옆에\r\n꼭 붙어있는다고\r\n그림자처럼\r\n\r\n또 그렇게\r\n바쁘단 핑계는 대지마\r\n꼭 그렇게\r\n귀찮다는 티좀 내지마\r\n날 바라봐 나쁜놈아\r\n\r\n소리없던 밤\r\n빛나던 달빛아래\r\n가로등은\r\n불을켜고 비춰주던\r\n너와의 첫키스\r\n\r\n날 사랑한다던 말도\r\n순진하게 다 믿었죠\r\n지켜준다던 그 말도 다\r\n\r\n아껴줄거라했어\r\n사랑한다고했어\r\n지켜줄거라했어\r\n난그말다믿었어\r\n그런데왜그랬어\r\n자꾸왜내맘아프게해\r\n\r\n날 사랑한다던 말도\r\n순진하게 다 믿었죠\r\n지켜준다던 그 말도 다\r\n\r\n날 사랑한다던 말도\r\n순진하게 다 믿었죠\r\n지켜준다던 그 말도 다\r\n\r\nlove love love love you\r\nlovelovelove</p> \n\t\t\t\t\t\t", artist_num: 80053233, album_num: 80417036, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/053/233/80053233_3_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/036/80417036_1396849683974_1_600x600.JPG", song_tjnum: nil, song_num: 82426650, lowkey: nil, highkey: nil},
