  {album_id: 137, title: "너를 만나러 가다 (Feat. 투피아노 &amp; 김나영)", ganre1: "가요", ganre2: "발라드", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>너를 만나러 가다 (Feat. 투피아노 &amp; 김나영) - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오래된 사진을 꺼냈어 \r\n먼지 쌓인 편지통도 꺼냈어 \r\n장난스런 너의 그 웃음소리가 \r\n익숙한듯 문득 생각이 났어\r\n\r\n니가 준 선물이 보이고\r\n니가 차린 음식도 보이고\r\n거울에 비친 불안한 내 두눈이\r\n지웠던 너를 자꾸만 떠오르게 해\r\n\r\n지금 너를 만나러 간다\r\n너를 찾으러 간다\r\n내게 할말 못해준 말\r\n모두 다 가지러 너를 만나러 간다\r\n지금 너를 만나러 간다\r\n너를 찾으러 간다\r\n아무런 말도 내게 하지마 \r\n너를 만나러 간다\r\n\r\n잠을 자도 니가 보이고 \r\n꿈을 꿔도 난 매일 똑같아\r\n니가 부른 멜로디도 떠올라서 \r\n지웠던 니 모습만 자꾸 떠오른다\r\n\r\n못해준 말도 너무나 많은데 \r\n아직 너와 함께 할\r\n시간이 참 많은데 \r\n어떻게 할지 나 모르겠어 \r\n모든게 너인것만 같아 \r\n하루가 가고 또 하루가 지나도\r\n하루종일 또 아무것도 할수가 없어\r\n\r\n지금 너를 만나러 간다\r\n너를 찾으러 간다\r\n내게 할말 못해준 말\r\n모두 다 가지러 너를 만나러 간다\r\n지금 너를 만나러 간다\r\n너를 찾으러 간다\r\n아무런 말도 내게 하지마 \r\n너를 만나러 간다</p> \n\t\t\t\t\t\t", artist_num: 80261800, album_num: 80417038, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/038/80417038_1396839299919_1_600x600.JPG", song_tjnum: nil, song_num: 82426697, lowkey: nil, highkey: nil},
