  {album_id: 140, title: "Hello", ganre1: "가요", ganre2: "인디", runtime: "02:51", lyrics: "\n\t\t\t\t\t\t\t<div>Hello - 02:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I put on blue jeans,\r\nwearing T-shirts\r\nand black glasses \r\nAnd I'll pick you up,\r\nwith gorgeous car. Um~\r\n\r\n＂Hello, how are you doing?＂\r\nThat's all,\r\nwhat can I say you?\r\nAnd so I'm confused\r\nall about you\r\n\r\nSomebody said,\r\n＂It is not love,\r\njust a infatuation phase.＂\r\nRight, maybe it's true.\r\nBut I want to try\r\nmy chance anyway.\r\n\r\n＂Hello,\r\nhow are you doing?＂ \r\nThat's all,\r\nwhat can I say you?\r\nAnd so I'm confused\r\nall about you\r\n\r\n＂Hello,\r\nhow are you doing?＂ \r\nThat's all,\r\nwhat can I say you?\r\nAnd so I'm confused\r\nall about you\r\nI'm confused all about you\r\nI'm confused all about you</p> \n\t\t\t\t\t\t", artist_num: 80261798, album_num: 80417041, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/798/80261798_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/041/80417041_1396936910939_1_600x600.JPG", song_tjnum: nil, song_num: 82426751, lowkey: nil, highkey: nil},
  {album_id: 140, title: "B.E.A.Utiful", ganre1: "가요", ganre2: "인디", runtime: "03:03", lyrics: "\n\t\t\t\t\t\t\t<div>B.E.A.Utiful - 03:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">B. E. A. Utiful\r\nFall in love\r\nB. E. A. Utiful\r\nForever\r\n\r\nA little girl lives in\r\nsmall countryside with\r\nher lovely parents\r\nShe and mama grew some\r\nyellow lemon trees. \r\nOne day, she went to the\r\nbeach and met a surfing boy\r\nAnd she fell\r\nin love with him.\r\n\r\nB. E. A. Utiful\r\nFall in love\r\nB. E. A. Utiful\r\nForever\r\n\r\nThe whale boy is an orphan\r\nand he surfing everyday.\r\nHe likes the ocean \r\nso wanna be a surfer\r\nOne day, he surfed on the\r\nsea and met a little girl.\r\nAnd he fell in love with her\r\n\r\nB. E. A. Utiful\r\nFall in love\r\nB. E. A. Utiful\r\nForever\r\n\r\nShe's getting\r\nweaker day by day.\r\nHe just prayed everyday\r\nShe was in agony so deep\r\nHe stood by her\r\n\r\nB. E. A. Utiful\r\nFall in love\r\nB. E. A. Utiful\r\nForever</p> \n\t\t\t\t\t\t", artist_num: 80261798, album_num: 80417041, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/798/80261798_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/041/80417041_1396936910939_1_600x600.JPG", song_tjnum: nil, song_num: 82426752, lowkey: nil, highkey: nil},
  {album_id: 140, title: "I Can Go", ganre1: "가요", ganre2: "인디", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>I Can Go - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Baby, I looked\r\naround my world\r\nThere was nothing,\r\nno righteousness, No welfare\r\nHelp me out!\r\nThere is nothing I can do.\r\nTrying to escape from\r\nthis dreadful\r\nnightmare, Yeah\r\n\r\nWhat can I say\r\nabout my life?\r\nWhat can I do\r\nfor my last time?\r\nWhat should I trust\r\non my soul?\r\nI believe I can go\r\n\r\nMorning sun is\r\nshining on my life\r\nSunshine covers all\r\nmy fear and anxiety\r\nMaybe, I want to find myself\r\nI wish I could write my\r\nnext page with you. Yeah\r\n\r\nWhat can I say\r\nabout my life?\r\nWhat can I do for\r\nmy last time?\r\nWhat should I trust\r\non my soul?\r\nI believe (I believe)\r\nI can go (I can go).\r\n\r\nWhat can I say\r\nabout my life?\r\nWhat can I do for\r\nmy last time?\r\nWhat should I trust\r\non my soul?\r\nI believe (I believe)\r\nI can go (I can go)\r\n\r\nI believe (I believe)\r\nI can go (I can go)\r\nWhere you go,\r\nI can go, tonight.</p> \n\t\t\t\t\t\t", artist_num: 80261798, album_num: 80417041, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/798/80261798_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/041/80417041_1396936910939_1_600x600.JPG", song_tjnum: nil, song_num: 82426753, lowkey: nil, highkey: nil},
  {album_id: 140, title: "Lonely Cage", ganre1: "가요", ganre2: "인디", runtime: "04:11", lyrics: "\n\t\t\t\t\t\t\t<div>Lonely Cage - 04:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">You said, this is\r\nnot a dramatic art\r\nAs I was still standing\r\nwhen you left me\r\nWhen I took a shower\r\nI realized\r\nWhat is left of\r\nmy world fell apart\r\n\r\nLove is a lonely cage\r\nI can't see you in darkness\r\nLove is a lonely cage\r\nI can't fly away\r\nbecause of you\r\n\r\nI filled the room with\r\nfurniture without you\r\nBut all I feel is alone;\r\nI don't know what to do\r\nShould I runaway\r\nfrom the gloom\r\nOr burning on my passion,\r\nAm I empty now?\r\n\r\nLove is a lonely cage\r\nI can't see you in darkness\r\nLove is a lonely cage\r\nI can't fly away\r\nbecause of you\r\n\r\nLove is a lonely cage\r\nI can't see you in darkness\r\nLove is a lonely cage\r\nI can't fly away\r\nbecause of you</p> \n\t\t\t\t\t\t", artist_num: 80261798, album_num: 80417041, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/798/80261798_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/041/80417041_1396936910939_1_600x600.JPG", song_tjnum: nil, song_num: 82426754, lowkey: nil, highkey: nil},
  {album_id: 140, title: "Think About...", ganre1: "가요", ganre2: "인디", runtime: "05:12", lyrics: "\n\t\t\t\t\t\t\t<div>Think About... - 05:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I think about me,\r\nthink about you\r\nHere I am, I'm ok\r\nI think about me,\r\nthink about you\r\nDon't surrender,\r\nwhere are you?\r\n\r\nWoo, Tonight,\r\nI'm gonna get closer to you\r\nWoo, Tonight,\r\nI am with you\r\n\r\nMy broken heart,\r\nempty house\r\nI asked myself,\r\n＂Who am I?＂\r\nRain is falling down,\r\nwavin' blouse\r\nYou come away,\r\nwhere did you go?\r\n\r\nWoo, Tonight,\r\nI'm gonna get closer to you\r\nWoo, Tonight,\r\nI am with you\r\n\r\nYou are in my life.\r\nYou are in my heart\r\nYou are in my breath,\r\njust you.\r\n\r\nYou are in my life.\r\nYou are in my heart\r\nYou are in my breath,\r\njust you.\r\n\r\nYou are in my life.\r\nYou are in my heart\r\nYou are in my breath,\r\njust you.\r\n\r\nYou are in my life.\r\nYou are in my heart\r\nYou are in my breath,\r\njust you.\r\n\r\nWoo, Tonight, (Tonight)\r\nI'm gonna get closer to you\r\nWoo, Tonight, (Tonight)\r\nI am with you\r\n\r\nWoo, Tonight, (Tonight)\r\nI'm gonna get closer to you\r\nWoo, Tonight, (Tonight)\r\nI am with you</p> \n\t\t\t\t\t\t", artist_num: 80261798, album_num: 80417041, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/798/80261798_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/041/80417041_1396936910939_1_600x600.JPG", song_tjnum: nil, song_num: 82426755, lowkey: nil, highkey: nil},
  {album_id: 140, title: "해바라기", ganre1: "가요", ganre2: "인디", runtime: "03:13", lyrics: "\n\t\t\t\t\t\t\t<div>해바라기 - 03:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어젯밤 꿈 속에서 널 만나,\r\n살며시 내 품에 안겨 와\r\n잠에서 깨고 나서도\r\n한참을 멍해 있었어\r\n뒤숭숭 하루 종일 복잡해,\r\n내 맘이 나에게 묻네\r\n어쩌려고 이러는 거니,\r\n지금 무슨 생각해\r\n\r\nHey, 오늘도 아무 일도 없는 듯이\r\n널 또 만나겠지\r\n\r\n랄라랄라 언제나 바보처럼\r\n랄라랄라 \r\n랄라랄라 꿈만 꾸는 해바라기\r\n랄라랄라\r\n\r\n우리가 나누었던 말들과,\r\n시간이 내겐 소중해\r\n가끔 너의 웃는 얼굴에,\r\n조금은 가슴이 아려\r\n차라리 이 정도의 사이가\r\n서로에겐 편해 보여도\r\n앞으로도 이럴 자신 없을 땐,\r\n나는 어떡해야해\r\n\r\nHey, 오늘도 아무 일도 없는 듯이\r\n널 또 만나겠지\r\n\r\n랄라랄라 언제나 바보처럼\r\n랄라랄라 \r\n랄라랄라 꿈만 꾸는 해바라기\r\n랄라랄라\r\n\r\n랄라랄라 언제나 바보처럼\r\n랄라랄라 \r\n랄라랄라 꿈만 꾸는 해바라기\r\n랄라랄라</p> \n\t\t\t\t\t\t", artist_num: 80261798, album_num: 80417041, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/798/80261798_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/041/80417041_1396936910939_1_600x600.JPG", song_tjnum: nil, song_num: 82426756, lowkey: nil, highkey: nil},
