  {album_id: 145, title: "C1 Lonely Quarter Rest", ganre1: "동요/태교", ganre2: "동요", runtime: "09:38", lyrics: "\n\t\t\t\t\t\t\t<div>C1 Lonely Quarter Rest - 09:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", artist_num: 80261801, album_num: 80417047, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/801/80261801_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/047/80417047_1396850081056_1_600x600.JPG", song_tjnum: nil, song_num: 82426777, lowkey: nil, highkey: nil},
  {album_id: 145, title: "C1-1 Ti Ta Ta-a Rest", ganre1: "동요/태교", ganre2: "동요", runtime: "01:25", lyrics: "\n\t\t\t\t\t\t\t<div>C1-1 Ti Ta Ta-a Rest - 01:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Hi, I'm Eighth Note. Hi\r\nPeople call me Ti.\r\nTogether!             \r\nTi Ti Ti Ti Ti Ti Ti Ti \r\nThere comes Quarter Note.\r\n\r\nHi, I'm Quarter Note. Hi\r\nPeople call me Ta.\r\nTogether!             \r\nTa Ta Ta Ta\r\nI count beat on time.\r\n\r\nOh, look there!\r\nWhat's that light?\r\n\r\nHello. I'm Half Note.\r\nHello\r\nI count beat Ta-a.\r\nTogether!               \r\nTa-a Ta-a                  \r\nI'm the longest one.\r\nHo ho ho\r\n\r\nHi, I'm Quarter Rest.\r\nHello\r\nPeople call me Uh-uh.\r\n\r\nSh-. That's right.\r\nNobody calls me.</p> \n\t\t\t\t\t\t", artist_num: 80261801, album_num: 80417047, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/801/80261801_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/047/80417047_1396850081056_1_600x600.JPG", song_tjnum: nil, song_num: 82426778, lowkey: nil, highkey: nil},
  {album_id: 145, title: "C1-2 Laughing At Quarter Rest", ganre1: "동요/태교", ganre2: "동요", runtime: "00:27", lyrics: "\n\t\t\t\t\t\t\t<div>C1-2 Laughing At Quarter Rest - 00:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I don't have a head.\r\nBoo-\r\nI don't have a stem.\r\nBoo-\r\nBut I have a flag like them.Boo-</p> \n\t\t\t\t\t\t", artist_num: 80261801, album_num: 80417047, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/801/80261801_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/047/80417047_1396850081056_1_600x600.JPG", song_tjnum: nil, song_num: 82426779, lowkey: nil, highkey: nil},
  {album_id: 145, title: "C1-3 Lonely Quarter Rest", ganre1: "동요/태교", ganre2: "동요", runtime: "01:20", lyrics: "\n\t\t\t\t\t\t\t<div>C1-3 Lonely Quarter Rest - 01:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I'm always alone.\r\nI am different\r\nfrom the others.\r\nI don't have a head.\r\nNo stem.\r\nI have a flag. Yes I have.\r\n\r\nBut it's not like\r\nmy brother's!\r\n\r\nI freeze everyone because I'm the quarter rest.\r\nI freeze him.\r\nI freeze her.\r\nI make you pause,\r\nbut not me.           \r\nI'm always alone.        \r\nI hope someone\r\nwould love me.\r\nI'm not so cute,\r\nnot on time,\r\nnot super or on key.\r\n\r\nHow wonderful\r\nit would be to look\r\nlike them\r\nJust for a day\r\njust.</p> \n\t\t\t\t\t\t", artist_num: 80261801, album_num: 80417047, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/801/80261801_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/047/80417047_1396850081056_1_600x600.JPG", song_tjnum: nil, song_num: 82426780, lowkey: nil, highkey: nil},
  {album_id: 145, title: "C1-4 Call For Quarter Rest", ganre1: "동요/태교", ganre2: "동요", runtime: "00:53", lyrics: "\n\t\t\t\t\t\t\t<div>C1-4 Call For Quarter Rest - 00:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Ti Ti Ti \r\nI need you, need you.\r\nI need you.\r\n\r\nTa Ta Ta \r\nI want you, want you.\r\nI want you.\r\n\r\nTa-a\r\nWhere are you,\r\nQuarter Rest!\r\nHurry up! Hurry! Hurry!\r\n\r\nPlease stop us.\r\nPlease help us.\r\nDear Quarter Rest!\r\nMake us stop.\r\n\r\nQuarter Rest!\r\nQuarter Rest!\r\nDid you call my name?\r\n\r\nDo you need me? \r\nDo you really\r\nneed my help?\r\nOf course\r\nI will help you.</p> \n\t\t\t\t\t\t", artist_num: 80261801, album_num: 80417047, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/801/80261801_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/047/80417047_1396850081056_1_600x600.JPG", song_tjnum: nil, song_num: 82426781, lowkey: nil, highkey: nil},
  {album_id: 145, title: "C1-5 Ti Ta Ta-a Rest (Together)", ganre1: "동요/태교", ganre2: "동요", runtime: "01:25", lyrics: "\n\t\t\t\t\t\t\t<div>C1-5 Ti Ta Ta-a Rest (Together) - 01:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Hi, I'm Eighth Note. Hi\r\nPeople call me Ti.\r\nTogether!             \r\nTi Ti Ti Ti Ti Ti Ti Ti \r\nThere comes Quarter Note.\r\n\r\nHi, I'm Quarter Note. Hi\r\nPeople call me Ta.\r\nTogether!             \r\nTa Ta Ta Ta  \r\nI count beat on time.\r\n\r\nOh, look there!\r\nWhat's that light?\r\n\r\nHello. I'm Half Note.\r\nHello\r\nI count beat Ta-a.\r\nTogether!              \r\nTa-a Ta-a                  \r\nI'm the longest one.\r\nHo ho ho\r\n\r\nHi, I'm Quarter Rest.\r\nHello\r\nPeople call me Rest.\r\nTogether!\r\nRest Rest Rest Rest\r\nThey need pause like me.\r\nYippee!</p> \n\t\t\t\t\t\t", artist_num: 80261801, album_num: 80417047, artist_photo: "http://image.genie.co.kr/Y/IMAGE/IMG_ARTIST/080/261/801/80261801_1_600x600.JPG", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/047/80417047_1396850081056_1_600x600.JPG", song_tjnum: nil, song_num: 82426782, lowkey: nil, highkey: nil},
