  {album_id: 165, title: "사는게 다 그렇치 뭐 (Feat. Brian J)", ganre1: "가요", ganre2: "랩/힙합", runtime: "03:27", lyrics: "\n\t\t\t\t\t\t\t<div>사는게 다 그렇치 뭐 (Feat. Brian J) - 03:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap 1-1]\r\n\r\n사는게 다 그렇치 뭐 \r\n잘나가는 사람있으면 \r\n좀 못나가는 사람있고\r\n높은 사람 있으면 \r\n아랫사람도 있고 \r\n하나부터 열까지 \r\n다 괜히 눈치보게되고\r\n주인공이 있으면 \r\n단역배우도 있고 \r\n사장님이 있으면 \r\n말단사원도 있어\r\n어느쪽에 있든 \r\n열심히 살아 꿈을 향해 \r\n달려간다는 것 \r\n사는게 다 그렇치 뭐 \r\n\r\nRap 1-2]\r\n\r\n사는게 다 그렇치 뭐\r\n기쁜일 있으면 \r\n슬픈일도 있고 섭섭한 일 \r\n때문에 가끔 눈물도 나고\r\n내맘 몰라줄때면 \r\n징그럽게도 밉지만 \r\n그래도 고마워\r\n많이 가진사람도 \r\n적게가진 사람도 \r\n어차피 잠깐 한번 \r\n들려가는 나그네 길\r\n누가뭐래도 인생길 \r\n사는게 다 그렇치 뭐 \r\n\r\nCHORUS]\r\n\r\nTake my hands forever \r\nnever leave you alone\r\n너의 아침이 되어 줄께\r\ndon't forget this moment \r\nnever give up your \r\n조금 늦어도 괜찮아\r\n\r\n매일매일 반복되는 하루\r\n이리치고 저리치어도\r\n오늘도 이래저래 \r\n또 하루가고\r\n사는게 다 그렇치 뭐 \r\n\r\nRap 2-1]\r\n\r\n오랜만에 나간 \r\n동참모임은 \r\n지 잘난 이야기 \r\n꽃으로 시작되\r\n억대 연봉의 우쭐한 \r\n친구의 성공은 하루종일 \r\n일해도 꿈꾸지 못할 \r\n나의 백일몽\r\n그 말많았던 내입에 \r\n굳건히 자물통을 채워\r\n애꿎은 담배만 주구장창 \r\n죽어라 태워\r\n그래도 잘나가는 친구가 \r\n자랑스러워 부러워\r\n사는게 다 그렇치 뭐\r\n\r\nRap 2-2]\r\n\r\n어김없이 오늘도 \r\n아침해는 뜨고 사람들에 \r\n등떠밀려 출근길은 멀고\r\n눈치백단 뽐내가며 \r\n시작되는 오늘 하루도 \r\n발바닥 불나도록 또 뛰고\r\n확신없는 미래지만 \r\n오늘도 허심탄 하게 한숨 \r\n벹어내면 그걸로 그만\r\n이 넓은 세상 내것하나 \r\n없지만 잘난것도 없어 \r\n사는게 다 그렇치 뭐\r\n\r\nCHORUS]\r\n\r\nTake my hands forever \r\nnever leave you alone\r\n너의 아침이 되어 줄께\r\ndon't forget this moment \r\nnever give up your \r\n조금 늦어도 괜찮아\r\n\r\n매일매일 반복되는 하루\r\n이리치고 저리치어도\r\n오늘도 이래저래 \r\n또 하루가고\r\n사는게 다 그렇치 뭐</p> \n\t\t\t\t\t\t", artist_num: 48894780, album_num: 80417068, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/068/80417068_1396851944694_1_600x600.JPG", song_tjnum: nil, song_num: 82426933, lowkey: nil, highkey: nil},
