  {album_id: 170, title: "The Road (Finer Things) (Feat. Nicky Da B)", ganre1: "OST", ganre2: "해외영화", runtime: "03:17", lyrics: "\n\t\t\t\t\t\t\t<div>The Road (Finer Things) (Feat. Nicky Da B) - 03:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Only the strong\r\nsurvive so open wide\r\nBend it on over\r\nnow exercise \r\n\r\nPicture this,\r\nnow I done made it\r\nto da stadium\r\nthis bitch is packed\r\nI tell the DJ turn me up,\r\nthey hear me in the back\r\nMic check, mic check,\r\nalways comin' correct\r\nLook at the crowd,\r\nget the utmost respect\r\n\r\nThey say Nicky's\r\nin the house tonight,\r\nCuz I what? Cuz I who?\r\nCuz I rocks it right\r\nI just get up on stage\r\nand I grab the mic\r\nLike a pipe or a piece\r\nI be ready to eat\r\n\r\nCompetition they too weak\r\nthey ain't fuckin' wit me\r\nWhen you hear my voice you\r\nin no position to speak\r\nYou thought that\r\nyou could keep me down,\r\nlook I'm laughin', I'm weak\r\nYou better read\r\nbetween the lines\r\nbefore you fuck with the B</p> \n\t\t\t\t\t\t", artist_num: 80261847, album_num: 80417073, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/073/80417073_1396848479697_1_600x600.JPG", song_tjnum: nil, song_num: 82426971, lowkey: nil, highkey: nil},
  {album_id: 170, title: "Fall For You", ganre1: "OST", ganre2: "해외영화", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>Fall For You - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">This could not\r\nhave been the plan\r\nto be exactly where I am\r\nNever found a place to land\r\nnever found a flame to fan\r\nnot getting used to it\r\nI won't get used to this\r\n\r\nand the dreams that\r\ncame upon us\r\nfound out they don't\r\nreally want us\r\nchase them down to let em go\r\nThey run faster\r\nthan you'd hoped\r\nnot getting used to it\r\nI won't get used to this\r\n\r\nI wanna fall for you, baby\r\nI know it's nothing new, baby\r\nwhy does it all\r\nseem so hard lately\r\nI wanna fall for you\r\n\r\nand the years\r\nthey keep me hoping\r\nI'll find out where I'm going\r\nhow long is it going to take\r\nhow much before it breaks\r\nnot getting used to it\r\nI won't get used to this\r\n\r\nAnd the door keeps\r\ngetting farther\r\nI know I've been foolish,\r\nit's been harder\r\ncould I hold you\r\nlike a secret\r\nIf I was strong\r\nenough to keep it\r\nNot getting used to it\r\nI won't get used to this\r\n\r\nI wanna fall for you, baby\r\nI know it's nothing new, baby\r\nwhy does it all\r\nseem so hard lately\r\nI wanna fall for you</p> \n\t\t\t\t\t\t", artist_num: 80261848, album_num: 80417073, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/073/80417073_1396848479697_1_600x600.JPG", song_tjnum: nil, song_num: 82426972, lowkey: nil, highkey: nil},
