  {album_id: 170, title: "Catching Shadows", ganre1: "OST", ganre2: "해외영화", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>Catching Shadows - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Wake up in the morning\r\nTry'nawish the night away\r\nHiding in the corner \r\nWaiting for the light\r\nto change, yeah \r\n\r\nAnd you can tell yourself\r\nThat the drama doesn't help \r\nGood luck getting out of\r\nyour own way\r\nPrayin' you can stop\r\nChasing everything you're not\r\nMaking all the same mistakes\r\n\r\nAnd when forever's slipping\r\nthrough my arms again\r\nI dive inside me\r\nI know I'll find a way\r\nto hold on 'til the end\r\nThe dark won't blind me\r\n\r\nThis burden on my back \r\nFeels like it's\r\ngot me trapped\r\nBut I'mma keep on trying\r\nI'll go on reaching till the\r\nworld is in my hands\r\nI'm CATCHING SHADOWS\r\n\r\nEverywhere I'm tuning\r\nWatch another game begin\r\nKnowing where I'm going\r\nAnywhere but where I've been\r\n\r\nNever looking back\r\nAnd I'm never gonna crack\r\nGonna fill myself with\r\nmy own strength\r\nI'll be movin' on\r\nUntil all the pain is gone\r\nGiving everything it takes\r\n\r\nAnd when forever's slipping\r\nthrough my arms again\r\nI dive inside me\r\nI know I'll find a way\r\nto hold on 'til the end\r\nThe dark won't blind me\r\n\r\nThis burden on my back \r\nFeels like it's\r\ngot me trapped\r\nBut I'mma keep on trying\r\nI'll go on reaching till the\r\nworld is in my hands\r\nI'm CATCHING SHADOWS\r\n\r\nGonna open every window\r\nGonna let the hurting go and\r\nfeel the sun come streaming in\r\nGonna find a million candles\r\nGonna light 'em one by one\r\nuntil the darkness ends\r\n\r\nAnd when forever's slipping\r\nthrough my arms again\r\nI dive inside me\r\nI know I'll find a way\r\nto hold on 'til the end\r\nThe dark won't blind me\r\n\r\nThis burden on my back \r\nFeels like it's\r\ngot me trapped\r\nBut I'mma keep on trying\r\nI'll go on reaching till the\r\nworld is in my hands\r\nI'm CATCHING SHADOWS</