  {album_id: 170, title: "Breathing Love", ganre1: "OST", ganre2: "해외영화", runtime: "05:13", lyrics: "\n\t\t\t\t\t\t\t<div>Breathing Love - 05:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Like the sun\r\nlights up the dark\r\nThere you are\r\nYou shine on me\r\nEven when we're miles apart\r\nI can still hear your heart\r\nYour Heart beat\r\n\r\nIt's like my feet never\r\ntouch the ground\r\nand all that was broken\r\nhas been made new\r\nYou can still hear the sound\r\nA wish unspoken\r\nCan still come true\r\n(When you come unglued)\r\n\r\nAnd you made me believe\r\nI could get lost\r\nin this feeling\r\nI'm breathing Love\r\nYou touched\r\nthe deepest part of me\r\nFeels like I'm dreaming\r\nI'm breathing Love\r\n(Can't believe\r\nwhat I'm feeling)\r\n(Better than I ever dreamed)\r\n\r\nLying safe in your arms\r\nWas never a thought\r\nWho could've planned\r\n\r\nYou were blazing\r\nlike a shooting star\r\nMan on Fire\r\n(Set this place on fire)\r\nWith me here you land\r\n\r\nFriendship caught on fire\r\n\r\nAnd now you hold my heart\r\nMy heart in your hands\r\n\r\nMelodye</p> \n\t\t\t\t\t\t", artist_num: 80261870, album_num: 80417073, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/073/80417073_1396848479697_1_600x600.JPG", song_tjnum: nil, song_num: 82426978, lowkey: nil, highkey: nil},
  {album_id: 171, title: "봄날의 회상", ganre1: "가요", ganre2: "락", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>봄날의 회상 - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">꽃향기가 참 그렇게 \r\n온 세상을 덮고 있던\r\n참 따듯한 그 추억이 \r\n내 기억에 남아 있어\r\n너는 내 곁에 없어도 \r\n난 그대 사랑했었어\r\n\r\n손 꼭 잡고 함께 걷던 \r\n그 길가엔 추억들이\r\n떨어지는 꽃잎처럼 \r\n봄바람에 흩어지고\r\n이젠 추억이 되버린 \r\n그리운 사랑 만남아\r\n\r\n(간주)\r\n\r\n참 가끔씩 보고 싶어 \r\n무심하게 고개 들고 \r\n창밖 넘어 바라 보면 \r\n좋았었던 그 날들이\r\n손에 잡힐 듯 자꾸만 \r\n눈에서 아른거리지\r\n\r\n가끔 돌아가고 싶어 \r\n그때 우리 그 모습 그대로\r\n\r\n꽃향기가 참 그렇게 \r\n온 세상을 덮고 있던\r\n참 따듯한 그 날들에 \r\n한가로운 시간들이\r\n좋던 예전의 기억을 \r\n잠시 떠오르게 했지</p> \n\t\t\t\t\t\t", artist_num: 80261819, album_num: 80417074, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/074/80417074_1396854807940_1_600x600.JPG", song_tjnum: nil, song_num: 82426979, lowkey: nil, highkey: nil},
  {album_id: 171, title: "그대에게", ganre1: "가요", ganre2: "락", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>그대에게 - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">자꾸 내게 벅찬 \r\n한 사람이\r\n사랑으로 내게 다가와 \r\n시작하려고 해요\r\n그대보다 더 날 위해 \r\n주는 사람이 울고 있네요\r\n\r\n미안해요 나 이제 \r\n지쳤나 봐요\r\n영원토록 그대 만을 \r\n사랑 할 줄 알았는데\r\n그댈 보낼 때 너무 \r\n힘들던 시간들이\r\n그대를 멀리 보냈나 봐요\r\n\r\n한 번 씩은 그리워 할께요\r\n그렇지만 내게 욕심을 \r\n부리지는 말아요\r\n두 번 다시 그대 사랑 \r\n할 일 없을 테니까\r\n\r\n너무 오래 기다렸나 봐요\r\n기다림에 너무 지쳐서 \r\n자꾸 울기만 했죠\r\n그 앤 착해서 한마디 \r\n말도 못하고 아파하네요\r\n\r\n더 이상은 모른 \r\n척할 수 없네요\r\n나를 보며 서성이며 \r\n눈물만 흘리면서\r\n나 에게는 들키지 \r\n않으려 하다\r\n참지 못하고 많이 우네요 \r\n\r\n한 번씩은 그리워 할게요 \r\n그렇지만 내게 기대는 \r\n너무 하지 말아요 \r\n두 번 다시 그대 \r\n찾을 일은 없을 테니까</p> \n\t\t\t\t\t\t", artist_num: 80261819, album_num: 80417074, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/074/80417074_1396854807940_1_600x600.JPG", song_tjnum: nil, song_num: 82426980, lowkey: nil, highkey: nil},
  {album_id: 171, title: "결국엔 우린", ganre1: "가요", ganre2: "락", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>결국엔 우린 - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">모진 시간 우린 \r\n견뎌왔지만\r\n결국 이렇게 \r\n허무하게 끝나죠\r\n난 왜 그렇게 고집했는지\r\n결국 아무것도 아닌 일들에\r\n\r\n이렇게 쉽게 끝날 걸 \r\n처음에 알았다면\r\n굳이 왜 그렇게 어려운 \r\n시간들을 버텼는지\r\n이젠 모든 게 끝나버렸죠\r\n결국 내겐 눈물만이 \r\n남았죠\r\n\r\n(간주)\r\n\r\n정말 우리 사랑 했었었는지\r\n결국 이렇게 쉽게 \r\n끝나버렸죠\r\n니가 세상에 모두였는데\r\n결국 아무것도 아닌 거였죠\r\n\r\n이렇게 쉽게 끝날 걸 \r\n처음에 알았다면\r\n굳이 왜 그렇게 어려운 \r\n시간들을 버텼는지\r\n사랑했었죠 지난 일이죠\r\n결국 우린 지금 잊고 살아요\r\n\r\n처음부터 아니었나요 \r\n어쩌면 우리 이렇게 \r\n될 거였나요\r\n\r\n이렇게 쉽게 끝날 걸 \r\n처음에 알았다면\r\n굳이 왜 그렇게 어려운 \r\n시간들을 버텼는지\r\n참 오래전에 끝난 거였죠\r\n결국 내겐 추억만이 남았죠</p> \n\t\t\t\t\t\t", artist_num: 80261819, album_num: 80417074, artist_photo: "http://image.genie.co.kr", jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/417/074/80417074_1396854807940_1_600x600.JPG", song_tjnum: nil, song_num: 82426981, lowkey: nil, highkey: nil},
